(202, 73, 1, 'deferredfeedback', 325, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'As the population continued to expand and the islands kept on receiving immigrants from the original population, the calls in all locations would have eventually regressed to the average pulse rate of the founder colony. In the decades that followed, scientists noticed that the geographical variations reported in 1969 were not obvious anymore. . . . In the early 2010s, while studying northern elephant seals on Año Nuevo Island, [researcher Caroline] Casey noticed, too, that what Le Boeuf had heard decades ago was not what she heard now. . . . By performing more sophisticated statistical analyses on both sets of data, [Casey and Le Boeuf] confirmed that dialects existed back then but had vanished. Yet there are other differences between the males from the late 1960s and their great-great grandsons: Modern males exhibit more individual diversity, and their calls are more complex. While 50 years ago the drumming pattern was quite simple and the dialects denoted just a change in tempo, Casey explained, the calls recorded today have more complex structures, sometimes featuring doublets or triplets. . . .\n\nFrom the passage it can be inferred that the call pulse rate of male northern elephant seals in the southern rookeries was faster because:\n\n: the male northern elephant seals of Isla Guadalupe with faster call pulse rates might have been the original settlers of the southern rookeries.\n\n; a large number of male northern elephant seals from Año Nuevo Island might have migrated to the southern rookeries to recolonise them.\n\n; the calls of male northern elephant seals in the southern rookeries have more sophisticated structures, containing doublets and triplets.\n\n; a large number of male northern elephant seals migrated from the southern rookeries to Año Nuevo Island in the early 1970s\n\n', 'the male northern elephant seals of Isla Guadalupe with faster call pulse rates might have been the original settlers of the southern rookeries.\n\n', NULL, 1614158267),
(203, 74, 1, 'deferredfeedback', 326, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The passage given below is followed by four alternate summaries. Choose the option \n\nthat best captures the essence of the passage. \n\nFor  years,  movies  and  television  series  like  Crime  Scene  Investigation  (CSI)  paint  an \n\nunrealistic picture of the “science of voices.” In the 1994 movie Clear and Present Danger an \n\nexpert listens to a brief recorded utterance and declares that the speaker is “Cuban, aged 35 \n\nto  45,  educated  in  the  […]  eastern  United  States.”  The  recording  is  then  fed  to  a supercomputer that matches the voice to that of a suspect, concluding that the probability \n\nof correct  identification is 90%.  This sequence  sums up  a  good number of misimpressions \n\nabout  forensic  phonetics,  which  have  led  to  errors  in  real life   justice.  Indeed,  that  movie \n\nscene  exemplifies  the  so-called  “CSI  effect”—the  phenomenon  in  which  judges  hold \n\nunrealistic expectations of the capabilities of forensic science. \n: Voice  recognition  has  started  to  feature  prominently  in  crime-scene  intelligence \n\ninvestigations because of movies and television series\n; Although  voice  recognition  is  often  presented  as  evidence  in  legal  cases,  its  scientific \n\nbasis can be shaky. \n; Voice recognition as used in many movies to identify criminals has been used to identify \n\ncriminals in real life also. \n; Movies and televisions have led to the belief that the use of forensic phonetics in legal \n\ninvestigations is robust and fool proof.\n', 'Movies and televisions have led to the belief that the use of forensic phonetics in legal \n\ninvestigations is robust and fool proof.\n', NULL, 1614158809),
(204, 75, 1, 'deferredfeedback', 327, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'FIVE JUMBLED UP SENTENCES, RELATED TO A TOPIC, ARE GIVEN BELOW. FOUR OF THEM CAN BE\n\nPUT TOGETHER TO FORM A COHERENT PARAGRAPH. IDENTIFY THE ODD ONE OUT AND KEY IN THE NUMBER\n\nOF THE SENTENCE AS YOUR ANSWER:\n: For feminists,  the question of how  we  read  is  inextricably linked with  the question of \n\nwhat we read. \n; Elaine Showalter’s critique of the literary curriculum is exemplary of this work. \n\n; The  documentation  of  this  realization  was  one  of  the  earliest  tasks  undertaken  by \n\nfeminist critics. \n; Androcentric literature  structures  the reading  experience  differently  depending  on the \n\ngender of the reader\n', 'Androcentric literature  structures  the reading  experience  differently  depending  on the \n\ngender of the reader\n', NULL, 1614159095),
(205, 76, 1, 'deferredfeedback', 328, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'TEN MUSICIANS (A, B, C, D, E, F, G, H, I AND J) ARE EXPERTS IN AT LEAST ONE OF THE FOLLOWING THREE\n\npercussion instruments: tabla, mridangam, and ghatam. Among them, three are experts in \n\ntabla but not in mridangam or ghatam, another three are experts in mridangam but not in \n\ntabla or ghatam, and one is an expert in ghatam but not in tabla or mridangam. Further, two \n\nare  experts  in  tabla and  mridangam but not  in  ghatam,  and  one  is an  expert in  tabla  and \n\nghatam but not in mridangam\n\nThe following facts are known about these ten musicians. \n\n1.  Both A and  B  are  experts in  mridangam, but only one  of them  is also an  expert in \n\ntabla. \n\n2.  D is an expert in both tabla and ghatam. \n\n3.  Both  F  and  G  are  experts  in  tabla,  but  only  one  of  them  is  also  an  expert  in \n\nmridangam. \n\n4.  Neither I nor J is an expert in tabla. \n\n5.  Neither  H  nor  I  is  an  expert  in  mridangam,  but  only  one  of  them  is  an  expert  in \n\nghatam. \n\nWho  among  the  following  is  DEFINITELY  an  expert  in  tabla  but  not  in  either \n\nmridangam or ghatam?\n: H; A\n; ; C\n; F', 'H', NULL, 1614161304),
