(875, 556, 1, 'deferredfeedback', 1366, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'DIRECTION: In this section, you have two\\short passages. Read the passages and answer the items that follow. You are required to select your answers based on the contents of the passage and opinion of the author only.\n\nI was beginning to tire a little now. I had been cutting steps continuously for two hours, and Tenzing ,too,wasmoving very slowly. As I chipped steps around still another corner, I wondered rather dully just how long we could keep it up. Our original zest had now quite gone and it was turning more into a grim struggle. I then realized that the ridge ahead ,instead of still monotonously rising, now dropped sharply away, and far below I could see the North Col and Rong buk glacier. I looked to see an arrow ridge running up to a snowy summit. A few more whacks of the ice-axe in the firm snow and we stood on top.\n\n‘It was turning more into a grim struggle’ would mean\n\n:  that he was in a mood to give up ultimately\n\n;  that after the long exertion he was feeling so weak that any further climbing meant a hard struggle with the force of nature\n\n;  that strong cold wind was pushing him down from above and that hehad to struggle with the forces of nature\n\n;  that Tenzing was making the task more difficult\n\n', ' that after the long exertion he was feeling so weak that any further climbing meant a hard struggle with the force of nature\n\n', NULL, 1615895157),
