(1190, 871, 1, 'deferredfeedback', 2087, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' The ratio of kinetic energy to the total energy of an electron in a Bohr orbit of the hydrogen atom is:\n\n: 1 : 1; 1 : -2; 2 : -1; 1 : -1', '1 : -1', NULL, 1616073047),
(1191, 872, 1, 'deferredfeedback', 2099, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' A block of mass m is placed on a smooth inclined wedge ABC of inclination θ as shown in the figure. The wedge is given an acceleration \'a\' towards the right. The relation between a and for the block to remain stationary on the wedge is:  \n\n: a= g/cosgecθ ; a = g cos θ; a = g tan θ; a = g/sinθ', 'a = g tan θ', NULL, 1616073591),
