(1197, 878, 1, 'deferredfeedback', 2126, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In Young\'s double-slit experiment, the separation d between the slits is 2 mm, the wavelengthλ of the light\nused is 5896 Å and distance D between the screen and slits is 100 cm. It is found that the angular width of the\nfringes is 0.20°. To increase the fringe angular width to 0.21° (with sameλ and D) the separation between the\nslits needs to be changed to:-\n\n: 1.7 mm; 1.8 mm; 1.9 mm; 2.1 mm', '1.9 mm', NULL, 1616075475),
(1198, 879, 1, 'deferredfeedback', 2136, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Unpolarised light is incident from the air on  a  plane surface of a material of refractive index \'μ\'. At  a particular angle of incidence \'i\', it is found that  the reflected and refracted rays are perpendicular to each other. Which of the following options is correct for this situation?\n\n:  The reflected light is polarised with its electric vector parallel to the plane of incidence.\n; [image]; [image];  The reflected light is polarised with its electric vector perpendicular to the plane of incidence.\n', ' The reflected light is polarised with its electric vector perpendicular to the plane of incidence.\n', NULL, 1616076926),
