(1286, 967, 1, 'deferredfeedback', 2204, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Placentation, in which ovules develop on the inner wall of the ovary or in peripheral part, is:\n\n: basal; Free central\n; Parietal; Axile', 'Parietal', NULL, 1616151456),
(1287, 968, 1, 'deferredfeedback', 2205, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The correct difference between first- and second-order reaction is that\n\n:   the rate of a first-order reaction does depend on reactant concentrations; the rate of a second-order\n\nThen the species undergoing disproportionation is:- 1.\n\n2.\n\n3.\n\n4. HBrO 57.\n\nIn which case is the number of molecules of  water maximum?\n\n1. 18 mL of water\n\n2. 0.18 g of water\n\n3. 0.00224 L of water vapours at 1 atm and 273 K\n\n4. 10–3 mol of water 58.\n\nMagnesium reacts with an element (X) to form an ionic compound. If the ground state electronic configuration of (X) is 1s22s22p3 the simplest formula for this compound is\n\n1. Mg2 X3\n\n2. MgX2\n\n3. Mg2 X\n\n4. Mg3 X2\n\n59.\n\nIron exhibits bcc structure at room temperature. Above 900\n\n°C, it transforms to fcc structure. The ratio of density of iron at room temperature to that at 900 °C (assuming molar mass and atomic radii of iron  remains  constant with temperature) is\n\nreaction does not depend on reactant concentrations\n\n; a first-order reaction can be catalyzed; a second-order reaction cannot be catalyzed\n\n;  the rate of a first-order reaction does not depend on reactant concentration; the rate of a secondorder reaction does depend on reactant concentrations.\n\n; the half-life of a first-order reaction does not depend  on [A]0; the half-life of a second-order reaction does depend on [A]0\n\n', 'the half-life of a first-order reaction does not depend  on [A]0; the half-life of a second-order reaction does depend on [A]0\n\n', NULL, 1616151552),
(1288, 969, 1, 'deferredfeedback', 2205, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The correct difference between first- and second-order reaction is that\n\n: a first-order reaction can be catalyzed; a second-order reaction cannot be catalyzed\n\n; the half-life of a first-order reaction does not depend  on [A]0; the half-life of a second-order reaction does depend on [A]0\n\n;  the rate of a first-order reaction does not depend on reactant concentration; the rate of a secondorder reaction does depend on reactant concentrations.\n\n;   the rate of a first-order reaction does depend on reactant concentrations; the rate of a second-order\n\nThen the species undergoing disproportionation is:- 1.\n\n2.\n\n3.\n\n4. HBrO 57.\n\nIn which case is the number of molecules of  water maximum?\n\n1. 18 mL of water\n\n2. 0.18 g of water\n\n3. 0.00224 L of water vapours at 1 atm and 273 K\n\n4. 10–3 mol of water 58.\n\nMagnesium reacts with an element (X) to form an ionic compound. If the ground state electronic configuration of (X) is 1s22s22p3 the simplest formula for this compound is\n\n1. Mg2 X3\n\n2. MgX2\n\n3. Mg2 X\n\n4. Mg3 X2\n\n59.\n\nIron exhibits bcc structure at room temperature. Above 900\n\n°C, it transforms to fcc structure. The ratio of density of iron at room temperature to that at 900 °C (assuming molar mass and atomic radii of iron  remains  constant with temperature) is\n\nreaction does not depend on reactant concentrations\n\n', 'the half-life of a first-order reaction does not depend  on [A]0; the half-life of a second-order reaction does depend on [A]0\n\n', NULL, 1616151563),
