(1298, 979, 1, 'deferredfeedback', 2206, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Select the correct group of biocontrol agents : Trichoderma, Baculovirus, Bacillus thuringiensis\n; Bacillus thuringiensis. Tobacco mosaic virus, Aphids\n; Oscilatoria, Rhizobium, Trichoderma\n\n; Nostoc, Azospirillium, Nucleopolyhedrovirus\n', 'Trichoderma, Baculovirus, Bacillus thuringiensis\n', NULL, 1616152032),
(1299, 980, 1, 'deferredfeedback', 1935, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In which of the following devices, the eddy current effect is not used?\n\n: induction furnace\n\n; magnetic braking in train\n\n; electromagnet\n\n; electric heater\n\n', 'electric heater\n\n', NULL, 1616152554),
(1300, 981, 1, 'deferredfeedback', 1938, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The average velocity of a particle executing SHM in one complete vibration is:\n\n: Aω\n\n; Aω / 2\n\n; zero\n\n; _Aω_2 /2\n\n', 'zero\n\n', NULL, 1616152559),
(1301, 982, 1, 'deferredfeedback', 1940, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The speed of a swimmer in still water is 20 m/s. The speed of river water is 10 m/s and is flowing due east. If he is standing on the south bank and wishes to cross the river along the shortest path, the angle at which he should make his stroke w.r.t north is given by:\n\n: 30° west of north\n\n; 45° west of north\n\n; 0° west of north\n\n; 60° west of north\n\n', '30° west of north\n\n', NULL, 1616152563),
(1302, 983, 1, 'deferredfeedback', 1942, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In the circuits shown below, the readings of the voltmeters and the ammeters will be:\n\n: V2>V1ANDI1=I2\n\n; V2=V1ANDI1>I2\n\n; V2>V1ANDI1>I2\n\n; V2=V1ANDI1=I2\n\n', 'V2=V1ANDI1=I2\n\n', NULL, 1616152566),
(1303, 984, 1, 'deferredfeedback', 1944, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A copper rod of 88 cm and an aluminium rod of unknown length have an equal increase in their lengths independent of an increase in temperature. The length of the aluminium rod is : (αCu=1.7×10-5  K   -1 and αAl=2.2×10-5K-1)\n\n: 113.9 cm\n\n;  68 cm\n\n; 88 cm\n\n; 6.8 cm\n\n', ' 68 cm\n\n', NULL, 1616152570),
(1304, 985, 1, 'deferredfeedback', 1945, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The unit of thermal conductivity is:\n\n: _J_ _m_ _K_-1\n\n; J m-1K-1\n; W m K-1\n\n; W m-1K-1\n\n', 'W m-1K-1\n\n', NULL, 1616152574),
(1305, 986, 1, 'deferredfeedback', 1946, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'For a p-type semiconductor, which of the following statements is true?\n\n: Electrons are the majority carriers and pentavalent atoms are the dopants.\n\n; Holes are the majority carriers and trivalent atoms are the dopants.\n\n; Holes are the majority carriers and pentavalent atoms are the dopants.\n\n; Electrons are the majority carriers and trivalent atoms are the dopants\n\n', 'Holes are the majority carriers and trivalent atoms are the dopants.\n\n', NULL, 1616152581),
(1306, 987, 1, 'deferredfeedback', 1947, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A cylindrical conductor of radius R is carrying a constant current. The plot of the magnitude of the magnetic field, B with the distance d from the centre of the conductor is correctly represented by the figure:\n\n: ; ; ; ', '', NULL, 1616152587),
(1307, 988, 1, 'deferredfeedback', 1948, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Body A of mass 4m moving with speed u collides with another body B of mass 2m, at rest. The collision is head-on and elastic in nature. After the collision the fraction of energy lost by the colliding body A is:\n\n: 4/9\n; 8/9\n; 5/9; 1/9', '8/9\n', NULL, 1616152601),
(1308, 989, 1, 'deferredfeedback', 1949, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The correct Boolean operation represented by the circuit diagram drawn is :\n\n: AND\n\n; NAND\n\n; OR\n\n; NOR\n\n', 'NAND\n\n', NULL, 1616152605),
(1309, 990, 1, 'deferredfeedback', 1952, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'When an object is shot from the bottom of a long smooth inclined plane kept at an angle of 60° with horizontal, it can travel a distance x1 along the plane. But when the inclination is decreased to 30° and the same object is shot with the same velocity, it can travel x2 distance. Then x1:x2 will be:\n\n: 1:2√3\n\n; √2:1\n\n; 1:√3\n\n; 1:√2\n\n', '1:√3\n\n', NULL, 1616152612),
(1310, 991, 1, 'deferredfeedback', 1953, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The work done to raise a mass m from the surface of the earth to a height h, which is equal to the radius of the earth, is:\n\n: 2mgR\n; 3/2 mgR\n; mgR\n\n; 1/2 mgR\n', '1/2 mgR\n', NULL, 1616152616),
(1311, 992, 1, 'deferredfeedback', 1954, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The total energy of an electron in an atom in an orbit is -3.4eV. Its kinetic and potential energies are, respectively:\n\n: -3.4 eV, -3.4 eV\n\n; 3.4 eV, -6.8 eV\n\n; 3.4 eV, 3.4 eV\n\n; -3.4 eV, -6.8 eV\n\n', '3.4 eV, -6.8 eV\n\n', NULL, 1616152624),
(1312, 993, 1, 'deferredfeedback', 1956, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In which of the following processes, heat is neither absorbed nor released by a system?\n\n:  isothermal\n\n;  isobaric\n\n; adiabatic\n\n;  isochoric\n\n', 'adiabatic\n\n', NULL, 1616152628),
(1313, 994, 1, 'deferredfeedback', 1959, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A hollow metal sphere of radius R is uniformly charged. The electric field due to the sphere at a distance r from the centre:\n\n: decreases as r increases for r < R and for r > R\n\n; zero as r increases for r < R, increases as r increases for r > R\n\n; increases as r increases for r < R and for r > R\n\n; zero as r increases for r < R, decreases as r increases for r > R\n\n', 'zero as r increases for r < R, decreases as r increases for r > R\n\n', NULL, 1616152633),
(1314, 995, 1, 'deferredfeedback', 1960, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Pick the wrong statement in the context with a rainbow.\n\n: When the light rays undergo two internal reflections in a water drop, a secondary rainbow is formed.\n\n; An observer can see a rainbow when his front is towards the sun.\n\n; Rainbow is a combined effect of dispersion, refraction, and reflection of sunlight.\n\n; The order of colors is reversed in the secondary rainbow.\n\n', 'An observer can see a rainbow when his front is towards the sun.\n\n', NULL, 1616152637),
(1315, 996, 1, 'deferredfeedback', 1963, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A small hole of an area of cross-section 2 mm2 is present near the bottom of a fully filled open tank of height 2 m. Taking g= 10 m/s2, the rate of flow of water through the open hole would be nearly:\n\n: 8.9×10-6 m3/s\n\n; 6.4×10-6 m3/s \n\n; 2.23×10-6 m3/s\n\n; 12.6×10-6 m3/s\n\n', '12.6×10-6 m3/s\n\n', NULL, 1616152640),
(1316, 997, 1, 'deferredfeedback', 1965, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following acts as a circuit protection device?\n\n: switch\n\n; conductor\n\n; fuse\n\n; inductor\n\n', 'fuse\n\n', NULL, 1616152646),
(1317, 998, 1, 'deferredfeedback', 1967, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Two point charges A and B, having charges +Q and -Q respectively. are placed at certain distance apart and force acting between them is F. If 25% charge of A is tranfered to B, then force between the charges becomes:\n\n: 16F/9\n\n;  9F/16\n\n;  4F/3\n\n; F\n\n', ' 9F/16\n\n', NULL, 1616152651),
(1318, 999, 1, 'deferredfeedback', 1968, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which colour of the light has the longest wavelength?\n\n: green\n\n; violet\n\n;  red\n\n; blue\n\n', ' red\n\n', NULL, 1616152656),
(1319, 1000, 1, 'deferredfeedback', 1971, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The radius of the circle, the period of revolution, initial position and sense of revolution are indicated in the figure.\n\ny-projection of the radius vector of rotating particle P is:\n\n: _y_(_t_)= -3 cos2πt , _where_ _y_ _in_ _m_\n\n;  y(t)= 3 cos(3πt2), where y in m\n\n; y(t)= 4 sin(πt2), where y in m\n\n; y(t)= 3 cos(πt2), where y in m\n\n', 'y(t)= 3 cos(πt2), where y in m\n\n', NULL, 1616152660),
(1320, 1001, 1, 'deferredfeedback', 1973, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'α-particle consists of:\n\n: 2 protons and 2 neutrons only\n\n; 2 protons only\n\n; 2 electrons, 2 protons, and 2 neutrons\n\n; 2 electrons and 4 protons only\n\n', '2 protons and 2 neutrons only\n\n', NULL, 1616152671),
(1321, 1002, 1, 'deferredfeedback', 1974, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A solid cylinder of mass 2 kg and radius 4 cm is rotating about its axis at the rate of 3 rpm. The torque required to stop after 2π revolutions is:\n\n: 12×10-4 N m\n\n;  2×106 N m\n\n;  2×10-3 N m\n\n; 2×10-6 N m\n\n', '2×10-6 N m\n\n', NULL, 1616152678),
(1322, 1003, 1, 'deferredfeedback', 1978, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In a double-slit experiment, when light of wavelength 400 nm was used, the angular width of the first minima formed on a screen placed 1 m away, was found to be 0.2°. What will be the angular width of the first minima, if the entire experimental apparatus is immersed in water?  (μwater=4/3)\n\n: 0.05°\n\n; 0.266°\n\n;  0.15°\n\n; 0.1°\n\n', ' 0.15°\n\n', NULL, 1616152682),
(1323, 1004, 1, 'deferredfeedback', 1980, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'At a point A on the earth\'s surface the angle of dip, δ=+25°. At a point B on the earth\'s surface the angle of dip, δ=-25°. We can interpret that:\n\n: A and B are both located in the southern hemisphere\n\n;  A is located in the southern hemisphere and B is located in the northern hemisphere.\n\n; A is located in the northern hemisphere and B is located in the southern hemisphere.\n\n; A and B are both located in the northern hemisphere.\n\n', 'A is located in the northern hemisphere and B is located in the southern hemisphere.\n\n', NULL, 1616152686),
(1324, 1005, 1, 'deferredfeedback', 1982, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A force F= 20+10y acts on a particle in the y-direction where F is in Newton and y in meter. Work done by this force to move the particle from y=0 to y= 1m is:\n\n: 30 J\n\n;  25 J\n\n;  20 J\n\n; 5 J\n\n', ' 25 J\n\n', NULL, 1616152690),
(1325, 1006, 1, 'deferredfeedback', 1985, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'When a block of mass M is suspended by a long wire of length L, the length of the wire becomes (L+l). The elastic potential energy stored in the extended wire is\n\n: 1/2MgL\n; MgL\n\n; Mgl\n\n; 1/2Mgl\n\n', '1/2Mgl\n\n', NULL, 1616152694),
(1326, 1007, 1, 'deferredfeedback', 1987, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A parallel plate capacitor of capacitance 20 μF is being charged by a voltage source whose potential is changing at the rate of 3 V/s. The conduction current through the connecting wires, and the displacement current through the plates of the capacitor, would be, respectively:\n\n: 60μA, zero\n\n;  zero, 60μA\n\n; 60μA, 60μA\n\n; zero, zero\n\n', '60μA, 60μA\n\n', NULL, 1616152699),
(1327, 1008, 1, 'deferredfeedback', 1989, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A mass m is attached to a thin wire and whirled in a vertical circle. The wire is most likely to break when:\n\n: the mass is at the highest point\n\n; the wire is horizontal\n\n; the mass is at the lowest point.\n\n;  inclined at an angle of 600 from vertical\n\n', 'the mass is at the lowest point.\n\n', NULL, 1616152702),
(1328, 1009, 1, 'deferredfeedback', 1992, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Six similar bulbs are connected as shown in the figure with a DC source of emf E and zero internal resistance.\n\nThe ratio of power consumption by the bulbs when (i) all are glowing and (ii) in the situation when two from section A and one from section B are glowing, will be:\n\n: 2: 1\n\n; 4: 9\n\n; 1: 2\n\n; 9: 4\n\n', '9: 4\n\n', NULL, 1616152706),
(1329, 1010, 1, 'deferredfeedback', 1993, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In total internal reflection when the angle of incidence is equal to the critical angle for the pair of media in contact, what will be angle of refraction?\n\n: 90°\n\n; 180°\n\n; 0°\n\n; equal to angle of incidence\n\n', '90°\n\n', NULL, 1616152713),
(1330, 1011, 1, 'deferredfeedback', 1995, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Two similar thin equi-convex lenses, of focal length f each, are kept coaxially in contact with each other such that the focal length of the combination is F1. When the space between the two lenses is filled with glycerin which has the same refractive index (μ=1.5) as that of glass, then the equivalent focal length is F2. The ratio F1:F2 will be:\n\n: 3 : 4\n\n; 2 : 1\n\n; 2 : 3\n\n;  1 : 2\n\n', ' 1 : 2\n\n', NULL, 1616152719),
