(2093, 1652, 1, 'deferredfeedback', 3676, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In Funaria, 20 chromosomes are present in rhizoids, then the number of chromosome in calyptra, theca and foot will be\n\n: 20, 40, 20 respectively\n\n;  40, 20, 20 respectively\n\n;  20, 40, 40 respectively\n\n; 40, 10, 20 respectively\n\n', ' 20, 40, 40 respectively\n\n', NULL, 1616842878),
