(2097, 1656, 1, 'deferredfeedback', 3683, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Flowering plants are more successful than other members of the plant world because\n\n: They are large and have a good vascular tissue system\n\n; They carry out variety of pollination mechanism\n\n; The protected plant embryo can survive in the period of unfavourable conditions\n\n; All of these\n\n', 'All of these\n\n', NULL, 1616843397),
(2098, 1657, 1, 'deferredfeedback', 3685, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the labels A, B, C and D in the figure given below\n\n: A - Sporophyte; B - Meiosis\n C - Gametogenesis; D - Zygote\n\n;  A - Gametophyte; B - Meiosis\nC - Gametogenesis; D -Zygote\n\n; A - Sporophyte; B - Meiosis\nC - Gametogenesis; D - Endosperm\n\n; A - Sporophyte; B - Mitosis\n C - Gametogenesis; D - Zygote\n\n', 'A - Sporophyte; B - Meiosis\n C - Gametogenesis; D - Zygote\n\n', NULL, 1616843566),
(2099, 1658, 1, 'deferredfeedback', 3687, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Monoecious plant of Chara shows occurrence of : [NEET-2013]\n\n: Antheridiophore and archegoniophore on the same plant\n\n; Stamen and carpel on the same plant\n\n; Upper antheridium and lower oogonium on the same plant\n\n; Upper oogonium and lower antheridium on the same plant\n\n', 'Upper oogonium and lower antheridium on the same plant\n\n', NULL, 1616843673),
(2100, 1659, 1, 'deferredfeedback', 3704, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Consider the following features:\n\nI. Chlorophyll a and Chlorophyll c\n\nII. Fucoxanthin\n\nIII. Floridean starch\n\nIV. Flagella 2 in number, unequal and lateral\n\nWhich of these are seen in Phaeophyceae?\n\n:  I, II, III\n\n;  I, II, IV\n\n;  I, II, III, IV\n\n; II, III, IV\n\n', ' I, II, IV\n\n', NULL, 1616846375),
(2101, 1660, 1, 'deferredfeedback', 3705, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The endosperm of a gymnosperm develops _______ fertilization, whereas the endosperm of an angiosperm develops _________ fertilization.\n\n: after, after\n\n; before, after\n\n; after, before\n\n;  before, before\n\n', 'before, after\n\n', NULL, 1616846450),
(2102, 1661, 1, 'deferredfeedback', 3707, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In _Pinus,_\n\nI. The stem is branched\n\nII. Roots have fungal association in the form of mycorrhiza\n\nIII. The male and female strobili are borne on different trees\n\nOf the above statements:\n\n: Only I is correct\n\n; Only II is correct\n\n;  I, II and III are correct\n\n; Only I and II are correct\n\n', 'Only I and II are correct\n\n', NULL, 1616846544),
(2103, 1662, 1, 'deferredfeedback', 3708, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the incorrect statement:\n\n: Artificial systems gave equal weightage to vegetative and sexual characteristics.\n\n; Natural classification systems are based on natural affinities among the organisms\n\n; The earliest systems of classification used only gross superficial morphological characters.\n\n; Linnaeus classification of plants was a natural classification as it was based on the androecium structure.\n\n', 'Linnaeus classification of plants was a natural classification as it was based on the androecium structure.\n\n', NULL, 1616846647),
(2104, 1663, 1, 'deferredfeedback', 3710, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the incorrecty statement:\n\n:  Cytotaxonomy is based on cytological information like chromosome number, structure, behaviour\n\n; More weightage is given to reproductive characters and all other characters are given equal importance in numerical taxonomy.\n\n; Numerical Taxonomy is based on all observable characteristics.\n\n; Chemotaxonomy uses the chemical constituents of the plant\n\n', 'More weightage is given to reproductive characters and all other characters are given equal importance in numerical taxonomy.\n\n', NULL, 1616846738);
