(2105, 1664, 1, 'deferredfeedback', 3712, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the incorrect statement regarding algae:\n\n: Certain marine brown and red agae produce large amounts of hydrocolloids (water holding substances), e.g., algin (brown algae) and carrageen (red algae) which are used commercially.\n\n; Around 70 species of freshwater algae can be used as food.\n\n; At least a half of the total carbon dioxide fixation on earth is carried out by algae through photosynthesis.\n\n; Agar, obtained from Gelidium and Gracilaria are used to grow microbes and in preparations of ice-creams and jellies.\n\n', 'Around 70 species of freshwater algae can be used as food.\n\n', NULL, 1616846902),
(2106, 1665, 1, 'deferredfeedback', 3710, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the incorrecty statement:\n\n: Chemotaxonomy uses the chemical constituents of the plant\n\n;  Cytotaxonomy is based on cytological information like chromosome number, structure, behaviour\n\n; More weightage is given to reproductive characters and all other characters are given equal importance in numerical taxonomy.\n\n; Numerical Taxonomy is based on all observable characteristics.\n\n', 'More weightage is given to reproductive characters and all other characters are given equal importance in numerical taxonomy.\n\n', NULL, 1616846909),
(2107, 1666, 1, 'deferredfeedback', 3714, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What is not true for red algae?\n\n: Accessory pigments include phycocyanin, phycoeythrin and allophycocyanin\n\n; They reproduce using alternation of generation\n\n; Lack centriole and flagella\n\n; The stored food is floridean starch very similar to cellulose\n\n', 'The stored food is floridean starch very similar to cellulose\n\n', NULL, 1616847017),
(2108, 1667, 1, 'deferredfeedback', 3716, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Consider the following statements regarding bryophytes: \n\nI. Bryophytes are also called amphibians of the plant kingdom because they are depndent on water for sexual reproduction.\n\nII. They play an important role in plant succession on bare rocks.\n\nIII. They lack true roots, stem or leaves.\n\nIV. The sex organs in bryophytes are multicelluar.\n\nV. They produce biflagellate zoospres.\n\nVI. Archegonium is flask-shaped and produces a single egg.\n\nThe number of corrected statements is\n\n: 3\n; 5\n; 6\n; 4\n', '5\n', NULL, 1616847152),
(2109, 1668, 1, 'deferredfeedback', 3718, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following algae is likely to be found in the deepest waters?\n\n: Green\n; All are found at equal depths\n\n; Brown\n; Red\n', 'Red\n', NULL, 1616847283),
(2110, 1669, 1, 'deferredfeedback', 3721, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The gemmae produced by some liverworts function as:\n\n:  An asexual structure\n\n; A sexual structure\n\n; A light capturing structure\n\n;  A water gathering structure\n\n', ' An asexual structure\n\n', NULL, 1616847400),
(2111, 1670, 1, 'deferredfeedback', 3723, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The life cycle is not haplo-diplontic in:\n\n: Bryophytes\n\n; Pteridophytes\n\n; _Fucus_\n\n; _Polysiphonia_\n', '_Fucus_\n\n', NULL, 1616847498),
(2112, 1671, 1, 'deferredfeedback', 3724, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In mosses, the sex organs are seen in:\n\n: Leafy stage\n\n; Seta of the sporophyte\n\n; Protonema stage\n\n; Capsule of the sporophyte\n\n', 'Leafy stage\n\n', NULL, 1616847597),
(2113, 1672, 1, 'deferredfeedback', 3725, 1, '1.0000000', '0.0000000', '1.0000000', 0, '   Read the following five statements (I to V) and select the option with all correct statements.\n\nI. Mosses and lichens are the first organisms to colonise a bare rock.\n\nII. Selaginella is a homosporous pteridophyte.\n\nIII. Coralloid roots in Cycas have VAM.\n\nIV. main plant body in bryophytes is gametophytic, whereas in pteridophytes it is sporophytic.\n\nV. In gymnosperms, male and female gametophytes are present within sporangia located on sporophyte.\n\n:  II, III and V\n\n; I, III and IV\n\n; I, IV and V\n\n; II, III and IV\n\n', 'I, IV and V\n\n', NULL, 1616847729),
(2114, 1673, 1, 'deferredfeedback', 3727, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Life cycle of _Ectocarpus_ and _Fucus_ respectively are\n\n: Diplontic, Haplodiplontic\n\n; Haplodiplontic, Diplontic\n\n; Haplontic, Diplontic\n\n; Haplodiplontic, Haplontic\n\n', 'Haplodiplontic, Diplontic\n\n', NULL, 1616847822),
