(2265, 1766, 1, 'deferredfeedback', 3914, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How many of the following statements are true for meristem-\n\n* Intercellular spaces are absent	* Immature cells	* Only primary cell wall is present	* Metabolically high active	* Iso-diametric cells	* Totipotency is present\n\n: 6\n; 3\n; 4\n; 5\n', '6\n', NULL, 1617101086),
