(2282, 1783, 1, 'deferredfeedback', 3927, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'When the xylem and phloem are situated at the same radius of vascular bundles, the vascular bundle is said to be\n\n: Open\n; Redial\n; Conjoint; Close\n', 'Conjoint', NULL, 1617101986),
