(2285, 1786, 1, 'deferredfeedback', 3929, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Match the column I with column II\n\n             COLUMN I COLUMN II\n\n	* Xylem parenchyma                                     (i)   Absent in most of the monocots\n	* Sclereids                                                        (ii)  Long cylindrical tube-like structure\n	* Phloem parenchyma                                  (iii) Food and tannins\n	* Vessel                                                             (iv) Fruit walls of nuts\n\n: a(i), b(ii), c(iii), d(iv) \n\n; a(iii), b(iv), c(i), d(ii)\n\n;  a(ii), b(iv), c(iii), d(i)\n\n; a(iii), b(ii), c(i), d(iv)\n\n', 'a(iii), b(iv), c(i), d(ii)\n\n', NULL, 1617102253),
(2286, 1787, 1, 'deferredfeedback', 3929, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Match the column I with column II\n\n             COLUMN I COLUMN II\n\n	* Xylem parenchyma                                     (i)   Absent in most of the monocots\n	* Sclereids                                                        (ii)  Long cylindrical tube-like structure\n	* Phloem parenchyma                                  (iii) Food and tannins\n	* Vessel                                                             (iv) Fruit walls of nuts\n\n:  a(ii), b(iv), c(iii), d(i)\n\n; a(iii), b(ii), c(i), d(iv)\n\n; a(i), b(ii), c(iii), d(iv) \n\n; a(iii), b(iv), c(i), d(ii)\n\n', 'a(iii), b(iv), c(i), d(ii)\n\n', NULL, 1617102291),
(2287, 1788, 1, 'deferredfeedback', 3930, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The cells shown in the below diagram are of ______ tissue and can be seen in ______ layer of the dicot stem.\n\n: Collenchyma, Hypodermis\n\n;  Sclerenchyma, Sclereids\n\n; Parenchyma, Pericycle\n\n; Parenchyma, Pith\n\n', 'Collenchyma, Hypodermis\n\n', NULL, 1617108904),
(2288, 1789, 1, 'deferredfeedback', 3931, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Mechanical support to the growing parts of the plant such as young stem and petiole of leaf is provided by a living tissue called\n\n: Chlorenchyma\n\n; Collenchyma\n\n; Sclerenchyma\n\n; Aerenchyma\n\n', 'Collenchyma\n\n', NULL, 1617109056),
(2289, 1790, 1, 'deferredfeedback', 3932, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is correct statement for intercalary meristems?\n\n:  They lie at base of stem always\n\n; They are long lived and cause increase in length\n\n; They lie at tip of root apex\n\n; They are short lived and consumed during primary growth\n\n', 'They are short lived and consumed during primary growth\n\n', NULL, 1617109159),
(2290, 1791, 1, 'deferredfeedback', 3933, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Compare diagram ‘a’ with ‘b’ and find out which statement is incorrect about difference between these two diagrams.\n\n* In ‘a’ mesophyll is of two type where as in case of ‘b’ mesophyll is of single type	* In ‘a’ stomata is mainly at lower surface whereas in ‘b’ stomata is at both the surface	* In ‘a’ vascular bundle is of different size whereas in ‘b’ vascular bundle is of more or less equal size	* In ‘a’ xylem is towards adaxial surface whereas in ‘b’ xylem is towards abaxial surface\n\n: In ‘a’ stomata is mainly at lower surface whereas in ‘b’ stomata is at both the surface\n\n; In ‘a’ vascular bundle is of different size whereas in ‘b’ vascular bundle is of more or less equal size\n\n; In ‘a’ mesophyll is of two type where as in case of ‘b’ mesophyll is of single type\n\n; In ‘a’ xylem is towards adaxial surface whereas in ‘b’ xylem is towards abaxial surface', 'In ‘a’ vascular bundle is of different size whereas in ‘b’ vascular bundle is of more or less equal size\n\n', NULL, 1617109432),
(2291, 1792, 1, 'deferredfeedback', 3934, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Parenchyma differs from meristamatic cells is its\n\n: Larger size, well developed vacuole and peripheral cytosol\n\n; Cell wall composition\n\n; Uneven thickenings in cell wall\n\n;  Having cytoplasm and nucleus\n\n', 'Larger size, well developed vacuole and peripheral cytosol\n\n', NULL, 1617109549),
