(2294, 1795, 1, 'deferredfeedback', 3935, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Lenticels present in woody trees help in\n\n: Only exchange of gases.\n\n; Exchange of gases and guttation.\n\n; Elimination of exudates.\n\n;  Exchange of gases and transpiration.\n\n', ' Exchange of gases and transpiration.\n\n', NULL, 1617109669),
(2295, 1796, 1, 'deferredfeedback', 3936, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The monocot leaves have parallel veination this is reflected in\n\n: Presence of stomata in the lower epidermis.\n\n; Nearly similar sizes of vascular bundles.\n\n; Leaves being isobilateral.\n\n; Conjoint vascular bundles.\n\n', 'Conjoint vascular bundles.\n\n', NULL, 1617109768),
(2296, 1797, 1, 'deferredfeedback', 3939, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is not correctly matched?\n\n: Companion cell – Associated with sieve cells\n\n; Companion cell – Helps in maintaining the pressure gradient in sieve tube\n\n; Companion cell – Albuminous cells in gymnosperm\n\n;  Companion cell – Nucleated structure and its nucleus controls sieve tube\n\n', 'Companion cell – Associated with sieve cells\n\n', NULL, 1617109893),
