(2298, 1799, 1, 'deferredfeedback', 3941, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The heartwood in trees\n\n: Is living and gives mechanical support.\n\n; Is dead but conducts water.\n\n;  Is dead and does not conduct water.\n\n; Surrounds the sap wood.\n\n', ' Is dead and does not conduct water.\n\n', NULL, 1617110106),
(2299, 1800, 1, 'deferredfeedback', 3942, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The bulliform cells in grasses\n\n: Are small resin filled cells.\n\n; Help in transpiration.\n\n; Are present on the upper epidermis of leaves.\n\n; Become turgid and cause the leaves to curl inwards under stress.\n\n', 'Are present on the upper epidermis of leaves.\n\n', NULL, 1617110190),
(2300, 1801, 1, 'deferredfeedback', 3944, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In monocot roots the vascular bundles are\n\n: Radial, exarch and open.; Collateral, exarch and closed; Radial, exarch and closed.; Collateral, endarch and closed.', 'Collateral, endarch and closed.', NULL, 1617110300),
(2301, 1802, 1, 'deferredfeedback', 3945, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The diagram below is transverse section of ______ and shows xylem which is ______.\n\n:  Monocot Root, Polyarch.\n\n; Dicot stem, Endarch.\n\n; Dicot Root, Endarch.\n\n; Dicot stem, Exarch.\n\n', ' Monocot Root, Polyarch.\n\n', NULL, 1617110387),
(2302, 1803, 1, 'deferredfeedback', 3948, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following statement is true ?\n\n: Tracheids are multicellular and with narrow lumen\n\n; Tracheids are unicellular and with wide lumen\n\n; Vessels are unicellular and with narrow lumen\n\n; Vessels are multicellular and with wide lumen\n\n', 'Vessels are multicellular and with wide lumen\n\n', NULL, 1617110681),
(2303, 1804, 1, 'deferredfeedback', 3950, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The endodermis is absent or indistinct in the:-\n\n: Leaves of gymnosperms\n\n; Stems of woody plants\n\n; Stems of pteridophytes\n\n; Roots of all plants\n\n', 'Stems of woody plants\n\n', NULL, 1617110787),
(2304, 1805, 1, 'deferredfeedback', 3952, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The term \'bark\' includes : \n\nI.      Phellogen\n\nII.     Phellem\n\nIII.    Phelloderm\n\nIV.     Secondary phloem\n\n:  I, II and III only\n\n;   I, II, III and IV only\n\n;  II, III and IV only\n\n;  I, II and IV only\n\n', '  I, II, III and IV only\n\n', NULL, 1617110880),
(2305, 1806, 1, 'deferredfeedback', 3953, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Summer wood is:\n\n:  the same as heartwood.\n\n; found to the outside of each annular ring of xylem.\n\n; found to the inside of each annular ring of xylem.\n\n; formed throughout the growing season.\n\n', 'found to the outside of each annular ring of xylem.\n\n', NULL, 1617111012),
(2306, 1807, 1, 'deferredfeedback', 3955, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The annular and spirally thickened conducting elements generally develop in the protoxylem when the root or stem is\n\n: maturing  \n\n; widening \n\n; elongating\n\n; differentiating\n\n', 'widening \n\n', NULL, 1617111111),
