(2393, 1894, 1, 'deferredfeedback', 4148, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Synapsis occurs between\n\n: A male and a female gamete\n\n; mRNA and ribosomes\n\n; Spindle fibres and centromere\n\n; Two homologous chromosomes\n\n', 'Two homologous chromosomes\n\n', NULL, 1617179519),
(2394, 1895, 1, 'deferredfeedback', 4150, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Centromere is required for\n\n: Crossing over\n\n; Movement of chromosomes towards poles\n\n; Cytoplasmic cleavage\n\n; Transcription\n\n', 'Movement of chromosomes towards poles\n\n', NULL, 1617179614),
(2395, 1896, 1, 'deferredfeedback', 4152, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A stage of mitosis is shown in the diagram. Which stage is it and what are its characteristics?\n\n:  Anaphase – centromeres split and chromatids separate and start moving away\n\n; Metaphase – spindle fibres attached to kinetochores, centromeres split and chromatids separate\n\n; Late prophase – chromosomes move to spindle equator\n\n; Metaphase – chromosomes moved to spindle equator chromosomes made up of two sister chromatids\n\n', 'Metaphase – chromosomes moved to spindle equator chromosomes made up of two sister chromatids\n\n', NULL, 1617179687),
(2396, 1897, 1, 'deferredfeedback', 4156, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How many chromosomes will the cell have at G1, after S and after M phase respectively, if it has 14 chromosomes at interphase?\n\n: 14, 14, 7\n; 7, 7, 7\n; 7, 14, 14\n; 14, 14, 14\n', '14, 14, 14\n', NULL, 1617179822),
(2397, 1898, 1, 'deferredfeedback', 4158, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Colchicine is an inhibitory chemical, which\n\n: Prevents attaching of centromeres with rays\n\n;  Stops the functioning of centriole\n\n; Prevents the spindle formation in mitosis\n\n; Prevents the formation of equatorial plane\n\n', 'Prevents the spindle formation in mitosis\n\n', NULL, 1617179896),
(2398, 1899, 1, 'deferredfeedback', 4160, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A bacterium divides every 35 minutes. If a culture containing 105\ncells per ml is grown for 175 minutes, what will be the cell concentration per ml after 175 minutes?\n\n:  85 × 105 cells\n\n;  32 × 105 cells\n\n; 175 × 105 cells\n\n; 35 × 105 cells\n\n', ' 32 × 105 cells\n\n', NULL, 1617179975),
(2399, 1900, 1, 'deferredfeedback', 4160, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A bacterium divides every 35 minutes. If a culture containing 105\ncells per ml is grown for 175 minutes, what will be the cell concentration per ml after 175 minutes?\n\n:  32 × 1055 cells\n\n; 35 × 105 cells\n\n; 175 × 1055 cells\n\n;  85 × 1055cells\n\n', ' 32 × 1055 cells\n\n', NULL, 1617180074),
(2400, 1901, 1, 'deferredfeedback', 4160, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A bacterium divides every 35 minutes. If a culture containing 105\ncells per ml is grown for 175 minutes, what will be the cell concentration per ml after 175 minutes?\n\n: 35 × 1055 cells\n\n;  85 × 1055cells\n\n; 175 × 1055 cells\n\n;  32 × 1055 cells\n\n', ' 32 × 1055 cells\n\n', NULL, 1617180111),
(2401, 1902, 1, 'deferredfeedback', 4178, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Crossing over that results in genetic recombination in higher organisms occurs between\n\n: Two daughter nuclei\n\n; Two different bivalents\n\n; Non-sister chromatids of a bivalent\n\n; Sister chromatids of a bivalent\n\n', 'Non-sister chromatids of a bivalent\n\n', NULL, 1617182406),
(2402, 1903, 1, 'deferredfeedback', 4182, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The phase between the two successive M phase is called as\n\n: Metaphase\n\n; Interphase\n\n; Anaphase\n\n; Prophase\n\n', 'Interphase\n\n', NULL, 1617182523),
(2403, 1904, 1, 'deferredfeedback', 4184, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A biosynthetic phase where cell organelle duplicate itself is\n\n: Anaphase\n\n; Interphase\n\n; Prophase\n\n; Telophase\n\n', 'Interphase\n\n', NULL, 1617182611),
(2404, 1905, 1, 'deferredfeedback', 4185, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Interphase is called the resting phase because\n\n: It is the phase where cell rests before entering into mitosis\n\n; It is the most active phase of the cell cycle\n\n; There is no apparent activity related to cell division\n\n; It does not prepare cell for cell division\n\n', 'There is no apparent activity related to cell division\n\n', NULL, 1617182727),
(2405, 1906, 1, 'deferredfeedback', 4188, 1, '1.0000000', '0.0000000', '1.0000000', 0, '  G1 → S transition is regulated by\n\n: Mitotic cyclin and cdc2 kinase\n\n; Cyclin independent kinases\n\n; G1 cyclin and cdc2 kinase\n\n; Cyclins only\n\n', 'G1 cyclin and cdc2 kinase\n\n', NULL, 1617182836),
(2406, 1907, 1, 'deferredfeedback', 3884, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the correct statement regarding collenchymas in plants:-\n\n: They provide mechanical strength to the growing parts of the plant.\n\n; They occur in layers below the epidermis of monocotyledonous plants.\n\n; Cells are much thickened at the corners due to the deposition of lignin.\n\n; Collenchymatous cells do not contain chloroplasts.\n\n', 'They provide mechanical strength to the growing parts of the plant.\n\n', NULL, 1617182877),
(2407, 1908, 1, 'deferredfeedback', 3885, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What is the number of correct statements amongst the following regarding phloem tissue of plants?\n\nI. Gymnosperms lack albimunous cells and\nsieve cells.\n\nII. The companion cells are specialized\nparenchymatous cells.\n\nIII. Phloem parenchyma is absent in most of the\nmonocotyledons.\n\nIV. Phloem fibers are generally absent in the\nprimary phloem.\n\n: 2\n; 4\n; 0\n; 3\n', '3\n', NULL, 1617182881),
(2408, 1909, 1, 'deferredfeedback', 3886, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In dicot roots, the initiation of the lateral roots and the vascular cambium during the secondary growth takes place in:\n\n: Epidermis\n\n; Endodermis\n\n; Pericycle\n\n; Conjuctive tissue\n\n', 'Pericycle\n\n', NULL, 1617182886),
(2409, 1910, 1, 'deferredfeedback', 3887, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Bulliform cells:\n\n: Are found in dorsiventral leaves and help in photosynthesis.\n\n; Are found in isobilatetral leaves and help in photosynthesis.\n\n; Are found in isobilatetral leaves and help in minimizing water loss.\n\n; Are found in dorsiventral leaves and help in minimizing water loss.\n\n', 'Are found in isobilatetral leaves and help in minimizing water loss.\n\n', NULL, 1617182892),
(2410, 1911, 1, 'deferredfeedback', 3892, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In the dicot root, the vascular cambium:-\n\n: is completely secondary in origin\n\n; is absent\n\n; originates from the tissue just above the phloem bundles\n\n;  does not form a continuous ring\n\n', 'is completely secondary in origin\n\n', NULL, 1617182897),
(2411, 1912, 1, 'deferredfeedback', 4190, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The morphology of the chromosomes is studied during\n\n: Telophase\n\n; Interphase; Metaphase\n\n; Prophase\n\n', 'Metaphase\n\n', NULL, 1617182936),
(2412, 1913, 1, 'deferredfeedback', 4191, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Cyclin Dependent Kinases (CDKs)\n\n: Arrest cell division due to non-formation of spindle\n\n; Act as mitotic poisons\n\n; Cause disassembly of the microtubules\n\n; Control various phases of cell cycle\n\n', 'Control various phases of cell cycle\n\n', NULL, 1617183006),
(2413, 1914, 1, 'deferredfeedback', 4193, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What is not true about cell cycle?\n\na. During G1G1 phase there is active synthesis of RNA and proteins but no change in its DNA content\n\nb. In synthesis or S phase, each chromosome carries a duplicate set of genes\n\nc. During G2G2 phase, a cell contains double the amount (4C) of DNA present in the original diploid cell (2C)\n\nd. In S-phase a cell doubles the original diploid (2n) chromosome number\n\n: d only\n; b, c & d\n; c & d\n; b & c\n', 'd only\n', NULL, 1617183148),
(2414, 1915, 1, 'deferredfeedback', 4196, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the mismatched pair\n\n: B – Stage where cells are inactive metabolically\n\n; D – Period of cytoplasmic growth\n\n; A – Starts with karyokinesis and ends with cytokinesis\n\n; C – Cell grows and carries out normal metabolism\n\n', 'B – Stage where cells are inactive metabolically\n\n', NULL, 1617183244),
(2415, 1916, 1, 'deferredfeedback', 4196, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Identify the mismatched pair\n\n: D – Period of cytoplasmic growth\n\n; C – Cell grows and carries out normal metabolism\n\n; A – Starts with karyokinesis and ends with cytokinesis\n\n; B – Stage where cells are inactive metabolically\n\n', 'B – Stage where cells are inactive metabolically\n\n', NULL, 1617183249),
(2416, 1917, 1, 'deferredfeedback', 4198, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Chromatin fibres duplication, Genetic material - 4C, Histone protein synthesis, Membranous organelle duplication, DNA replication, centriole duplication.\n\nHow many of the above features are associated with synthesis phase of cell cycle?\n\n: Four\n; Three\n; Six\n; Five\n', 'Five\n', NULL, 1617183316),
(2417, 1918, 1, 'deferredfeedback', 4201, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How many generations are required by a cell of meristem to produce 128 cells?\n\n: 7\n; 64\n; 127\n; 32\n', '7\n', NULL, 1617183424),
