(2446, 1947, 1, 'deferredfeedback', 4295, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which one of the following is not a part of a renal pyramid? \n\n:  Convoluted tubules    \n\n; Collecting ducts \n\n; Peritubular capillaries\n\n; Loops of Henle      \n\n', 'Peritubular capillaries\n\n', NULL, 1617189265),
(2447, 1948, 1, 'deferredfeedback', 4297, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A. In dry atmosphere, the relative humidity is low, so the rate of transpiration increases\n\nB. Slow breeze promotes the rate of transpiration\n\nC. ABA promotes transpiration\n\nD. A high salt concentration in soil water increases transpiration\n\n: A and B are correct\n\n; A and C are correct\n\n; B and C are correct\n\n;  C and D are correct\n\n', 'A and B are correct\n\n', NULL, 1617189272),
(2448, 1949, 1, 'deferredfeedback', 4299, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A. Most researchers agree that water is mainly ‘pulled’ upward through the plant, where transpiration is the driving force.\n\nB. Less than one percent of water reaching the leaves is used in plant growth and photosynthesis.\n\nC. Cobalt chloride paper turns blue on absorbing water.\n\n: Only B is incorrect\n\n; Only A is correct\n\n; Only C is incorrect\n\n; All are correct\n\n', 'Only C is incorrect\n\n', NULL, 1617189381),
(2449, 1950, 1, 'deferredfeedback', 4301, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'According to the pressure flow hypothesis\n\nA. Phloem loading produces a hypertonic condition in the sieve tubes.\n\nB. Water potential gradient facilitates the mass movement in the phloem.\n\nC. Phloem unloading is a passive process.\n\n: A & B are incorrect\n\n; A & C are correct\n\n;  B & C are incorrect\n\n; A & B are correct\n\n', 'A & B are correct\n\n', NULL, 1617189539),
(2450, 1951, 1, 'deferredfeedback', 4305, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Although a girdled (upto bast) tree may survive for sometime, but it will eventually die because\n\n: Water will not move downward\n\n; Sugars and other organic solutes will not move downward\n\n; Sugars and other organic solutes will not move upward\n\n; Water will not move upward\n\n', 'Sugars and other organic solutes will not move downward\n\n', NULL, 1617189695),
(2451, 1952, 1, 'deferredfeedback', 4307, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Transpiration and root pressure cause water to rise in plants by\n\n: Pushing and pulling it, respectively\n\n; Pulling it upward\n\n; Pushing it upward\n\n; Pulling and pushing it, respectively\n\n', 'Pulling and pushing it, respectively\n\n', NULL, 1617189882),
(2452, 1953, 1, 'deferredfeedback', 4307, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Transpiration and root pressure cause water to rise in plants by\n\n: Pulling and pushing it, respectively\n\n; Pushing it upward\n\n; Pushing and pulling it, respectively\n\n; Pulling it upward\n\n', 'Pulling and pushing it, respectively\n\n', NULL, 1617189894),
