(2595, 2096, 1, 'deferredfeedback', 5846, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'For the electronic transition from n = 2→→ n =1 which of the following will produce shortest wavelength ?\n\n: He+ ion\n\n;  H atom\n\n; Li2+ ion\n\n; D atom\n\n', 'Li2+ ion\n\n', NULL, 1617865684),
(2596, 2097, 1, 'deferredfeedback', 5849, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If the speed of electron in Bohr first orbit of hydrogen atom be x, then speed of the electron in 3rd orbit is ::  x/9\n\n; x/3\n\n; 9x\n\n;  3x\n\n', 'x/3\n\n', NULL, 1617865797),
(2597, 2098, 1, 'deferredfeedback', 5854, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The main difference in the phenomenon of interference and diffraction is that \n\n: diffraction is caused by reflected waves from a source whereas interference caused is due to refraction of waves from a surface\n\n; diffraction is due to the interaction of light from wavelength, whereas the interference is the interaction of two waves derived from the same source.\n\n; diffraction is due to the interaction of waves derived from the same source, whereas the interference is the bending of light from the same wave front\n\n; diffraction is due to the interaction of light from the same wave front whereas interference is the interaction of waves from two isolated sources.\n\n', 'diffraction is due to the interaction of light from wavelength, whereas the interference is the interaction of two waves derived from the same source.\n\n', NULL, 1617865959),
(2598, 2099, 1, 'deferredfeedback', 5857, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A beam of light AO is incident on a glass slab (μ= 1.54) in a direction as shown in the figure. The reflected ray OB is passed through a Nicol prism on viewing through a Nicol prism, we find on rotating the prism that \n\n:  the intensity reduces down some what and rises again\n\n; there is no change in intensity\n\n; the intensity is reduced down to zero and remains zero\n\n; the intensity gradually reduces to zero and then again increases\n\n', 'the intensity gradually reduces to zero and then again increases\n\n', NULL, 1617866118),
(2599, 2100, 1, 'deferredfeedback', 5861, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If uncertainties in the measurement of position and momentum are equal, the uncertainty in the measurement of velocity is:\n\n: 1/2√mh/π\n; 1/2π√h/m; 1/2m√h/π; None of these\n\n', '1/2m√h/π', NULL, 1617866335),
(2600, 2101, 1, 'deferredfeedback', 5861, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If uncertainties in the measurement of position and momentum are equal, the uncertainty in the measurement of velocity is:\n\n: 1/2√mh/π\n; 1/2π√h/m; 1/2m√h/π\n; None of these\n\n', '1/2m√h/π\n', NULL, 1617866393),
(2601, 2102, 1, 'deferredfeedback', 5862, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How many electrons in 19K have n = 3; l = 0?\n\n: 3\n; 1\n; 4\n; 2\n', '2\n', NULL, 1617866459),
(2602, 2103, 1, 'deferredfeedback', 5865, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The electronic configuration of Mn can be written as :\n\n: [Ar]4s2\n\n; [Ar]3d6,4s2\n\n; [Ar]3d5,4s2\n\n; [Ar]3d5,4s1\n\n', '[Ar]3d5,4s2\n\n', NULL, 1617866648),
(2603, 2104, 1, 'deferredfeedback', 5867, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following sets of quantum numbers is impossible arrangement ?\n\n:  n = 3, m = –3, s = –1/2\n\n;  n = 3, m = –2, s=+1/2\n\n;  n = 5, m = 2, s=–1/2\n\n;  n = 4, m = 3, s = +1/2\n\n', ' n = 3, m = –3, s = –1/2\n\n', NULL, 1617866745),
(2604, 2105, 1, 'deferredfeedback', 5869, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'One unpaired electron causes magnetic moment of 1.1 BM. The magnetic moment of 26Fe2+ is :\n\n: 0\n\n;  4.4\n\n;  5.5\n\n; 2.2\n\n', ' 4.4\n\n', NULL, 1617866857),
(2605, 2106, 1, 'deferredfeedback', 5872, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'For d-electron, the orbital angular momentum is\n\n:  2h/π\n\n; h/2π\n\n; √6h/2π\n\n; √2h/2π\n\n', '√6h/2π\n\n', NULL, 1617867080),
(2606, 2107, 1, 'deferredfeedback', 5874, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The First ionisation enthalpies of Na,Mg,Al and Si are in the order\n\n: Na < Mg < Al < Si\n\n; Na > Mg > Al > Si\n\n; Na > Mg > Al < Si\n\n; Na < Mg > Al < Si\n\n', 'Na < Mg > Al < Si\n\n', NULL, 1617867230),
(2607, 2108, 1, 'deferredfeedback', 5876, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is smallest in size?\n\n: Na+\n\n; O2–\n\n;  F–\n\n; N3–\n\n', 'Na+\n\n', NULL, 1617867401),
(2608, 2109, 1, 'deferredfeedback', 5879, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'For electron affinity of halogens, which of the following is correct?\n\n:  Br > Cl\n\n; Br > F\n\n; F > I\n\n; F > Cl\n\n', 'F > I\n\n', NULL, 1617867486),
(2609, 2110, 1, 'deferredfeedback', 5881, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The figure here shows P and Q as two equally intense coherent sources emitting radiations of wavelength 20 m. The separation PQ is 5.0 m and the phase of P is ahead of the phase of Q by 90°. A, B, and C are three distant points of observation equidistant\nfrom the midpoint of PQ. The intensity of radiations at A, B, C will bear the ratio:\n\n               \n\n:  4:1:0\n\n; 0:1:4\n\n; 2:1:0\n\n; 0:1:2\n\n', '2:1:0\n\n', NULL, 1617867562),
(2610, 2111, 1, 'deferredfeedback', 5882, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following has the highest electron affinity?\n\n:  O–\n\n; F–\n\n; O\n\n;  Na\n\n', 'O\n\n', NULL, 1617867585),
(2611, 2112, 1, 'deferredfeedback', 5884, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Most basic oxide is\n\n: N2O5\n\n; N2O3\n\n; Bi2O5\n\n; Bi2O3\n\n', 'Bi2O3\n\n', NULL, 1617867676),
(2612, 2113, 1, 'deferredfeedback', 5886, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of largest in size?\n\n:  Li+(g)\n\n;  Li+(aq)\n\n;  Cs+(g)\n\n;  Cs+(aq)\n\n', ' Li+(aq)\n\n', NULL, 1617867812),
(2613, 2114, 1, 'deferredfeedback', 5891, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The correct order of 3rd ionisation potential of Na, Mg, Al and Si is\n\n: Si > Al > Mg > Na\n\n;  Mg > Si > Al > Na\n\n; Mg > Na > Si > Al\n\n; Mg > Na > Al > Si\n\n', 'Mg > Na > Si > Al\n\n', NULL, 1617867932),
(2614, 2115, 1, 'deferredfeedback', 5892, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which pair has largest size difference?\n\n: Mg and Mg+\n\n;  Na and Na+\n\n;  Cl and Cl–\n\n;  Na and K\n\n', ' Na and Na+\n\n', NULL, 1617868067),
(2615, 2116, 1, 'deferredfeedback', 5897, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In which of the following options the order of arrangement does not agree with the variation of property indicated against it?\n\n: B < C < N < O (increasing first ionisation enthalpy)\n\n; I < Br < F < Cl (increasing electron gain enthalpy)\n\n; Al3+ < Mg2+ < Na+ <F- (increasing ionic size)\n\n; Li < Na < K < Rb (increasing metallic radius)\n\n', 'B < C < N < O (increasing first ionisation enthalpy)\n\n', NULL, 1617868325),
(2616, 2117, 1, 'deferredfeedback', 5900, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The number of d -electrons in Fe2+ (z = 26) is not equal to the number of electrons in which one of the following?\n\n: p-electrons in Ne (Z = 10)\n\n; d-electrons in Fe (Z = 26)\n;  p-electrons in Cl (Z = 17)\n\n; s-electrons in Mg (Z = 12)\n\n', ' p-electrons in Cl (Z = 17)\n\n', NULL, 1617868480),
(2617, 2118, 1, 'deferredfeedback', 5901, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In Young\'s double-slit experiment, 12 fringes are observed to be formed in a certain segment of the screen when the light of wavelength 600 nm is used. If the wavelength of light is changed to 400 nm, the number of fringes observed in the same segment of the screen is given by\n\n: 30\n; 24\n; 12\n\n; 18\n', '12\n\n', NULL, 1617868500),
(2618, 2119, 1, 'deferredfeedback', 5903, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Fig. shows a transparent slab of length 1 m placed in air whose refractive index in the x-direction varies as μ = 1 + x (0 ≤ x ≤ 1)μ = 1 + x 0 ≤ x ≤ 1. The optical path length of the ray R inside the slab will be\n\n: (2/3) m\n\n; (3/2) m\n\n; √2m\n\n;  1 m\n\n', '(3/2) m\n\n', NULL, 1617868593),
