(3412, 2807, 1, 'deferredfeedback', 330, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Four institutes, A, B, C, and D, had contracts with four vendors W, X, Y, and Z during the ten \n\ncalendar  years from 2010 to 2019. The contracts were either multi-year contracts running \n\nfor  several  consecutive  years  or  single-year  contracts.  No  institute  had  more  than  one \n\ncontract  with  the  same  vendor.  However,  in  a  calendar  year,  an  institute  may  have  had \n\ncontracts  with  multiple  vendors,  and  a  vendor  may  have  had  contracts  with  multiple \n\ninstitutes. It is known that over the decade, the institutes each got into two contracts with \n\ntwo of these vendors, and each vendor got into two contracts with two of these institutes. \n\nThe following facts are also known about these contracts. \n\nI.  Vendor Z had at least one contract in every year. \n\nII.  Vendor X had one or more contracts in every year up to 2015, but no contract in any \n\nyear after that. \n\nIII.  Vendor Y had contracts in 2010 and 2019. Vendor W had contracts only in 2012. \n\nIV.  There were five contracts in 2012. \n\nV.  There were exactly four multi-year contracts. Institute B had a 7-year contract, D had \n\na  4-  year  contract,  and  A  and  C  had  one  3-year  contract  each.  The  other  four \n\ncontracts were single-year contracts. \n\nVI.  Institute C had one or more contracts in 2012 but did not have any contract in 2011\n\nVII.  Institutes B and D each had exactly one contract in 2012. Institute D did not have any \n\ncontract in 2010.\n\n In which of the following years were there two or more contracts?\n\n: 2017 \n\n; 2015 \n\n; 2016 \n\n; 2018 \n\n', '2015 \n\n', NULL, 1619439952),
(3413, 2808, 1, 'deferredfeedback', 331, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An  alloy  is  prepared  by  mixing  three metals  A, B  and C  in  the proportion 3:  4: 7 by \n\nvolume. Weights of the same volume of the metals A, B and C are in the ratio 5: 2: 6. In 130 \n\nkg of the alloy, the weight, in kg, of the metal C is\n: 70 \n\n; 48 \n\n; 84\n\n; 96 \n\n', '84\n\n', NULL, 1619439958),
