(4664, 3382, 8, 'deferredfeedback', 8841, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A diatomic gas (y = 1.4) does 200 J of work when it is expanded isobaric ally. Find the heat given to the gas in the process.\n\n: 700 J\n\n; 900 J\n\n; 600 J\n\n; 500 J\n\n', '700 J\n\n', NULL, 1620045970),
