(4667, 3382, 11, 'deferredfeedback', 9357, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The earth receives solar radiation at a rate of 8.2 J cm-2m min-1. If the sun radiates as the black bodies, the temperature at the surface of the sun will be (the angle subtended by sun on the earth in suppose 0.53 ° and Stefan constant is cr = 5.67x10-8 Wm-2 K4)\n\n:  6700 K\n\n;  7800 K\n\n; 8000 K\n\n;  5800 K\n\n', ' 5800 K\n\n', NULL, 1620045970),
