(4669, 3382, 13, 'deferredfeedback', 9363, 1, '1.0000000', '0.0000000', '1.0000000', 0, '1 kg of water is converted into steam at the same temperature and at 1 atm (100 kPa). The density of water and steam are 1000 kgm-3 and 0.6 kgm-3 respectively. The latent heat of vaporization of water is 2.25 x 106J kg-1. What will be increased in energy?\n\n: None of these\n\n; 2.08 x 106J\n\n;  3 x 105J\n\n; 4 x 106 J\n\n', '2.08 x 106J\n\n', NULL, 1620045970),
