(4671, 3382, 15, 'deferredfeedback', 9369, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A lead ball at 30 °C is dropped from a height of 6.2 km. The ball is heated due to the air resistance and it completely melts just before reaching the ground. The molten substance falls slowly on the ground. If the specific heat of lead = 126 Jkg-toc-1 and melting point of lead= 3300C and suppose that any mechanical energy lost is used to heat the ball, then the latent heat of fusion of lead is\n\n:  4.2 X 103 J kg-1\n\n; 3.6 X 104 J kg-1\n\n; 2.4 X 104 J kg-1\n\n;  7.6 X 102 J kg-1\n\n', '2.4 X 104 J kg-1\n\n', NULL, 1620045970),
(4672, 3382, 16, 'deferredfeedback', 9371, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An inductor (L = 20 H), a resistor (R = 100) and a battery (E = 10 V) are connected in series. After a long time, the circuit is short-circuited and then the battery is disconnected. Find the current in the circuit at 1 ms after short circuiting.\n\n: 4.5 x 106 A\n\n; 6.7 x 10-4 A\n\n; 9.8 x 10-6 A\n\n; 3.2 x 10-5 A\n\n', '6.7 x 10-4 A\n\n', NULL, 1620045970),
