(4751, 3382, 95, 'deferredfeedback', 9735, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In experiment, addition of 4.0 mL of 0.005 M BaCl2 to 16.0 mL of arsenious sulphide sol just causes complete coagulation in 2 h. The flocculating value of the effective ion is:  Ba2+, 2.0\n\n; Cl-, 2.0\n\n; Cl-, 1 .0\n\n; Ba2+, 1 .0\n\n', 'Ba2+, 1 .0\n\n', NULL, 1620045970),
