(4754, 3382, 98, 'deferredfeedback', 9740, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'When H202 is added to ice cold solution of acidified potassium dichromate in ether and the contents are shaken and allowed to stand: A blue colour is obtained in ether because of formation of Cr2 (SO4) a\n\n; A blue colour is obtained in ether because of formation of Cr03\n\n;  Chromyl chloride is formed\n\n; A blue colour is obtained in ether because of formation of Cr05\n\n', 'A blue colour is obtained in ether because of formation of Cr05\n\n', NULL, 1620045970),
