(4757, 3382, 101, 'deferredfeedback', 9745, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'for carbon ion \n \nStability order will be\n\n: P > Q > S > R\n\n; P > R > Q > S\n\n; Q > R > S > R\n\n;  S > R > Q > P\n\n', 'P > R > Q > S\n\n', NULL, 1620045970),
(4758, 3382, 102, 'deferredfeedback', 9747, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The aqueous solution of an unknown sodium salt gives the following reactions. \nI. It decolorizes a solution of iodine in potassium iodide. \nII. It gives white turbidity with dil. HCl solution. \nIII. It gives a white precipitate with AgN03 solution which changes colours and finally becomes black on standing. \nThe unknown sodium salt is\n\n: Sodium thiosulphate\n\n; Sodium sulphide\n\n;  Sodium bisulphite\n\n; Sodium sulphite\n\n', 'Sodium thiosulphate\n\n', NULL, 1620045970),
(4759, 3382, 103, 'deferredfeedback', 9749, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The catenation tendency of C, Si and Ge is in the order Ge < Si < C. The bond energies (in kJ mol-1) of C-C, Si-Si and Ge-Ge bonds respectively are\n\n: 180, 167, 348\n\n; 348, 180, 167\n\n; 167, 180, 348\n\n; 348, 167, 180\n\n', '348, 180, 167\n\n', NULL, 1620045970),
