(4794, 3382, 138, 'deferredfeedback', 9881, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Chlorosis is produced in the leaves due to the deficiency of Fe, Mg, Mn, S or N of these essential elements, those that are exclusive constituents of chlorophyll molecules are\n\n:  Mg, S\n\n;  N, S\n\n; Fe, S\n\n; Mg, N\n\n', 'Mg, N\n\n', NULL, 1620045970),
(4795, 3382, 139, 'deferredfeedback', 9885, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' Read the following statements and choose the correct option. \nI. Leptosporangiate development of sporangium is found in all members Pteropsida. \nII. Seed habit is shown by Selaginella. \nIII. Gnetum leaves are monomorphic and pinnately compound. \nIV. Sporic meiosis is found in Volvox, Chlamydomonas and Ulothrix. \nChoose the correct option. _\n\n: I and IV\n\n; I and II\n\n; I, II and IV\n\n; All of these\n\n', 'I and IV\n\n', NULL, 1620045970),
(4796, 3382, 140, 'deferredfeedback', 9888, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following characteristics out of I, II and III are exhibited by C4 plants? \nI. Kranz anatomy. \nII. The product of photosynthesis is oxalo acetic acid. \nIII. Both PEP carboxylase and ribulose-his phosphate carboxylase act as a carboxylating enzyme. \nChoose the correct option.\n\n: I and II, but not III\n\n; II and III, but not I\n\n; I and III, but not II\n\n; All of these\n\n', 'All of these\n\n', NULL, 1620045970),
(4797, 3382, 141, 'deferredfeedback', 9890, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Match the following column I and II for organismic respiration. \n\n:  A-3 B-2 C-1\n\n; A-1 B-3 C-2\n\n; A-2 B-3 C-1\n\n; A-3 B-1 C-2\n\n', ' A-3 B-2 C-1\n\n', NULL, 1620045970),
(4798, 3382, 142, 'deferredfeedback', 9895, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Compare the statements I and II and choose correct options. \nSTATEMENT (I) Auxin promotes apical dominance by suppressing the activity of lateral buds. \nSTATEMENT (II) In moriculture, periodic pruning of shoot tips is done to make mulberry plants bushy. \nChoose the correct options.\n\n: Both I and II are false\n\n; Both I and II are true\n\n; II is false, but I is true\n\n; I is false, but II is true\n\n', 'Both I and II are true\n\n', NULL, 1620045970),
(4799, 3382, 143, 'deferredfeedback', 9897, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The one advantage of cleistogamy is\n\n: Each visit of a pollinator results in transfer of hundreds of pollen grains\n\n; Seed set is not dependent on pollinators\n\n; Seed dispersal is more efficient and wide spread\n\n; It leads to greater genetic diversity\n\n', 'Seed set is not dependent on pollinators\n\n', NULL, 1620045970),
(4800, 3382, 144, 'deferredfeedback', 9899, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In coconut, the liquid endosperm is formed because\n\n: karyokinesis is not followed by cytokinesis\n\n; karyokinesis is followed by cytokinesis\n\n; Formation of liquid endosperm is not dependent upon karyokinesis and cytokinesis\n\n; None of the above\n\n', 'Formation of liquid endosperm is not dependent upon karyokinesis and cytokinesis\n\n', NULL, 1620045970),
(4801, 3382, 145, 'deferredfeedback', 9901, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Keeping in view the structure of cell membrane, which one of the following statements is correct with respect to the movements of liquid and proteins from one liquid monolayer to the other (flip flop movement).\n\n: Both lipids and proteins can flip flop\n\n; While proteins can flip flop, liquids can not\n\n; While lipids can flip-flop at times, proteins can not\n\n; Neither lipids, nor proteins can flip flop\n\n', 'While lipids can flip-flop at times, proteins can not\n\n', NULL, 1620045970),
(4802, 3382, 146, 'deferredfeedback', 9903, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Ribosomes are particles about 200 A units in diameter consisting of protein and RNA. The percentage of protein and RNA is respectively\n\n:  80% and 20%\n\n; 60% and 40%\n\n; 50% and 50%\n\n; 40% and 60%\n\n', '60% and 40%\n\n', NULL, 1620045970),
(4803, 3382, 147, 'deferredfeedback', 9905, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Match the biological molecule listed under column I with their biological function listed under column II. Choose the answer which gives correct combination of alphabets of the two columns. \n\n		Column I\n\n(Biological Molecule)\n\nColumn II\n\n(Function)\n\nA.   Glycogen\n\nB.   Globulin\n\nC.   Steroid\n\nD.   Thrombin\n\n1.    Hormone\n\n2.    Biocatalyst\n\n3.    Antibody\n\n4.    Storage product\n\n: A-4 B-2 C-1 D-3\n\n; A-2 B-4 C-3 D-1\n\n; A-4 B-3 C-1 D-2\n\n; A-3 B-2 C-4 D-1\n\n', 'A-4 B-3 C-1 D-2\n\n', NULL, 1620045970),
(4804, 3382, 148, 'deferredfeedback', 9908, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In pea plants, yellow seeds are dominant to green. If a heterozygous yellow seeded plant is crossed with a green seeded plant, what ratio of yellow and green seeded plants could you expect in F1-generation?\n\n: 1: 3.\n\n; 3: 1\n\n; 50: 50\n\n; 9 : 1\n\n', '50: 50\n\n', NULL, 1620045970),
(4805, 3382, 149, 'deferredfeedback', 9909, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In a mutational event, when adenine is replaced by guanine, it is a case of\n\n:  Transition\n\n; Transcription\n\n; Frameshift mutation\n\n; Transversion\n\n', ' Transition\n\n', NULL, 1620045970),
(4806, 3382, 150, 'deferredfeedback', 9911, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Independent assortment of gene occurs due to the orientation of chromosomes at\n\n: Metaphase-I of mitosis\n\n;  Metaphase-II of meiosis\n\n; Metaphase-I Of meiosis\n\n;  Any phase of the cell division\n\n', 'Metaphase-I Of meiosis\n\n', NULL, 1620045970),
(4807, 3382, 151, 'deferredfeedback', 9913, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The non-disjunction, in meiosis may result is extra copy of a chromosome in a sperm cell. During which phase the above phenomenon may occur?\n\n: AnaphaseI1, telophase-II\n\n; Prophase-1, prophase-II\n\n; Anaphase-I, anaphase-II\n\n;  Metaphase-I, anaphase-II\n\n', 'Anaphase-I, anaphase-II\n\n', NULL, 1620045970),
(4808, 3382, 152, 'deferredfeedback', 9914, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is true regarding the phage lambda, a virus which infects bacteria\n\n: In the lytic cycle, the bacterial host replicates viral DNA, passing it on to daughter cells during binary fission\n\n; In the lysogenic cycle, the bacterial host replicates viral DNA, passing it onto daughter cells during binary fission\n\n;  In the lytic cycle, viral DNA is integrated into the host genome\n\n; In the lysogenic cycle, the host bacterial cell burst, releasing phases\n\n', 'In the lysogenic cycle, the bacterial host replicates viral DNA, passing it onto daughter cells during binary fission\n\n', NULL, 1620045970),
(4809, 3382, 153, 'deferredfeedback', 9916, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The part of the bacterial chromosome sharing homology with genome fragment transferred from the recipients to cell during merozygote formation is known as\n\n:  Exogenote\n\n; Eugenic\n\n; Dysgenic\n\n; Endogenote\n\n', 'Endogenote\n\n', NULL, 1620045970),
(4810, 3382, 154, 'deferredfeedback', 9917, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In 1944, Avery, McCarty and MacLeod isolated a substance from heat-killed virulent form of bacteria and added to non-virulent form of bacteria which changed the non-virulent to virulent from this substance can be destroyed by\n\n: Protease\n\n; Amylase\n\n; Lipase\n\n; DNAase\n\n', 'DNAase\n\n', NULL, 1620045970),
(4811, 3382, 155, 'deferredfeedback', 9918, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Thermococcus, Methanococcus and Methanobacterium are groups of\n\n: Archaebacteria with peptidoglycan in their cell wall\n\n; Most advanced type of bacteria\n\n; Archaebacteria that consists of protein homologous to eukaryotic core histones\n\n; Bacteria containing a cytoskeleton and all membrane bound organelles\n\n', 'Archaebacteria that consists of protein homologous to eukaryotic core histones\n\n', NULL, 1620045970),
(4812, 3382, 156, 'deferredfeedback', 9920, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Match the following Column I with Column II.\n\nColumn I\n\nColumn II\n\nA.    Complementary ratio\n\nB.    Supplementary ratio\n\nC.    Epistatic ratio\n\nD.    Inhibitory ratio\n\n1.    9 : 7\n\n2.    9 : 3 : 4\n\n3.    12 : 3 : 1\n\n4.    13 : 3\n\n: A-4 B-1 C-2 D-3\n\n; A-4 B-1 C-2 D-3\n\n; A-1 B-2 C-3 D-4\n\n; A-1 B-3 C-2 D-4\n\n', 'A-1 B-2 C-3 D-4\n\n', NULL, 1620045970),
(4813, 3382, 157, 'deferredfeedback', 9921, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following sequences represent a possible pathway in the production of a secretory protein?\n\n: Ribosome → Rough ER → Golgi apparatus → Secretory vesicle\n\n; Rough ER → Ribosomes → Secretory vesicles → Golgi apparatus\n\n;  Rough ER → Secretory vesicle → Ribosome → Golgi apparatus\n\n; Secretory vesicle → Golgi apparatus - → Ribosomes → Rough ER\n\n', 'Ribosome → Rough ER → Golgi apparatus → Secretory vesicle\n\n', NULL, 1620045970),
