(5398, 3595, 1, 'deferredfeedback', 10766, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A rocket is intended to leave the Earth’s gravitational field. The fuel in tis main engine is a little less than the amount that is necessary and an auxiliary engine, (only capable of operating for a short time) has to be used as well. When is it best to switch on the auxiliary engine?\n\n: It doesn’t matter.\n\n; when the rocket has nearly stopped with respect to the Earth.\n\n; Can’t say\n\n; at take-off\n\n', 'at take-off\n\n', NULL, 1620205319),
