(5406, 3603, 1, 'deferredfeedback', 10791, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A particle of mass m is executing oscillation about the origin on X-axis.Its potential energy is V(x) = K|x|3 . Where K is a positive constant. If the amplitude of oscillation is a, then its time period T is proportional to\n: a 3/2\n\n; a\n\n; 1/√a\n\n; √a\n\n', '1/√a\n\n', NULL, 1620213688),
(5407, 3604, 1, 'deferredfeedback', 10797, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A solid cylinder is attached to a horizontal massless spring as shown in figure. If the cylinder rolls without slipping, the time period of oscillation of the cylinder is \n\n: ; ; ; ', '', NULL, 1620214143),
(5408, 3605, 1, 'deferredfeedback', 10807, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A skier starts from rest at point A and slides down the hill without turning or breaking. The friction coefficientis μ. When he stops at point B, his horizontal displacement is S. What is the height difference between points A and B (The velocity of the skier is small so that the additional pressure on the snow due to the curvature can be neglected. Neglect also the friction of air and the dependence of μ on the velocity of the skier.)\n\n: h =μS2\n\n; h =2μS\n\n; h = μS\n\n; h = μ/S\n\n', 'h = μS\n\n', NULL, 1620215053),
