(5937, 3829, 1, 'deferredfeedback', 11877, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The vapor pressures of benzene, toluene and a xylene are 75 Torr, 22 Torr and 10 Torr at 20°C. Which of the following is not a possible value of the vapor pressure of an equimolar binary/ternary solution of these at 20°C ? Assume all form ideal solution with each other.\n\n: 48 1/2\n\n; 53 1/2\n\n;  16\n\n; 35 2/3\n\n', '53 1/2\n\n', NULL, 1620808567),
(5938, 3830, 1, 'deferredfeedback', 11875, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An ideal mixture of liquids A and B with 2 moles of A and 2 moles of B has a total vapour pressure of 1 atm at a certain temperature. Another mixture with 1 mole of A and 3 moles of B has a vapour pressure greater than 1 atm. But if 4 moles of C are added to the second mixture, the vapour pressure comes down to 1 atm. Vapour pressure of C, Pc° = 0.8 atm. Calculate the vapour pressures of pure A and pure B.\n\n: PA = 1.4 atm, PB° = 0.6 atm\n\n; PA° = 0.6 atm, PB° = 1.4 atm\n\n; PA = 1.2 atm, PB° = 0.6 atm\n\n; PA° = 1.4 atm, PB° = 0.7 atm\n\n', 'PA° = 0.6 atm, PB° = 1.4 atm\n\n', NULL, 1620808571),
(5939, 3831, 1, 'deferredfeedback', 11875, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An ideal mixture of liquids A and B with 2 moles of A and 2 moles of B has a total vapour pressure of 1 atm at a certain temperature. Another mixture with 1 mole of A and 3 moles of B has a vapour pressure greater than 1 atm. But if 4 moles of C are added to the second mixture, the vapour pressure comes down to 1 atm. Vapour pressure of C, Pc° = 0.8 atm. Calculate the vapour pressures of pure A and pure B.\n\n: PA° = 0.6 atm, PB° = 1.4 atm\n\n; PA = 1.4 atm, PB° = 0.6 atm\n\n; PA = 1.2 atm, PB° = 0.6 atm\n\n; PA° = 1.4 atm, PB° = 0.7 atm\n\n', 'PA° = 0.6 atm, PB° = 1.4 atm\n\n', NULL, 1620808583),
