(6295, 4187, 1, 'deferredfeedback', 12669, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The potential of hydrogen electrode having a\npH = 10 is\n\n: –0.59V\n\n; –0.059V\n\n; 0.59V\n\n;  zero volts\n\n', '–0.59V\n\n', NULL, 1621063193),
(6296, 4188, 1, 'deferredfeedback', 12670, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Zinc gives H2 with H2SO4 and HCl but not with\nHNO3 because\n\n:  NO−3 is reduced is preference to hydronium ion; HNO3 is a weaker acid then H2SO4 and HCl\n\n; In electrochemical series zinc is above\nhydrogen\n\n; Zinc acts as oxidising agent when reacts with\nHNO3\n\n', ' NO−3 is reduced is preference to hydronium ion', NULL, 1621063505),
