(6415, 4307, 1, 'deferredfeedback', 13569, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'WHICH ONE OF THE FOLLOWING STATEMENT IS CORRECT\n\n: The constitution is individual centric or individual oriented\n\n; The constitution has not ignored individual but has endeavored to harmonise the individual.\n\n; The constitution gives more important to the society as a whole\n\n; The constitution is socio economic pattern of the society but ignores the individual\n\n', 'The constitution has not ignored individual but has endeavored to harmonise the individual.\n\n', NULL, 1621493844),
(6416, 4308, 1, 'deferredfeedback', 13427, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' Read the following passage carefully and answer the questions given below it.   Goldfish can be kept easily in small ponds and and aquariums, they make good pets, but like many other pets, they must have proper care and the right kind of place to live. A two inch fish requires a minimum of two gallons of water containing sufficient oxygen to support life. Some oxygen will make its way into the water of an aquarium from the air that touches the surface. Plants in an aquarium also help to furnish oxygen. Snails help to keep an aquarium clean. Thus, with plenty of plants and snail, the water in an aquarium does not have to be changed frequently. A large lake may prove to be a quite unsuitable abode for goldfish. It is important that goldfish should not be overfed. They can be fed such things as dried insects in addition to commercially prepared goldfish food, but they should never be fed more than once a day. Even then, they should not be given more food than can be consumed in about five minutes. This ensures prolonged life.\nWhich of the following statements is true?\n: Snails eat up the goldfish in an aquarium.\n\n;  Goldfish comes above the surface of water to get oxygen from air\n\n; Plants provide food to the snails\n\n; Goldfish should be given food only once a day\n\n', 'Goldfish should be given food only once a day\n\n', NULL, 1621495158),
(6417, 4309, 1, 'deferredfeedback', 13427, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' Read the following passage carefully and answer the questions given below it.   Goldfish can be kept easily in small ponds and and aquariums, they make good pets, but like many other pets, they must have proper care and the right kind of place to live. A two inch fish requires a minimum of two gallons of water containing sufficient oxygen to support life. Some oxygen will make its way into the water of an aquarium from the air that touches the surface. Plants in an aquarium also help to furnish oxygen. Snails help to keep an aquarium clean. Thus, with plenty of plants and snail, the water in an aquarium does not have to be changed frequently. A large lake may prove to be a quite unsuitable abode for goldfish. It is important that goldfish should not be overfed. They can be fed such things as dried insects in addition to commercially prepared goldfish food, but they should never be fed more than once a day. Even then, they should not be given more food than can be consumed in about five minutes. This ensures prolonged life.\nWhich of the following statements is true?\n: Goldfish should be given food only once a day\n\n;  Goldfish comes above the surface of water to get oxygen from air\n\n; Snails eat up the goldfish in an aquarium.\n\n; Plants provide food to the snails\n\n', 'Goldfish should be given food only once a day\n\n', NULL, 1621495166),
