(8989, 5144, 1, 'deferredfeedback', 1927, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following refer to correct example(s) of organisms which have evolved due to changes in environment brought about by anthropogenic action?\n\n(a) Darwin\'s Finches of Galapagos islands\n\n(b) Herbicide resistant weeds\n\n(c) Drug resistant eukaryotes\n\n(d) Man-created breeds of domesticated animals like dogs\n\n: (a) and (c)\n\n; (b), (c) and (d)\n\n; only (d) \n\n; only (a) \n\n', '(b), (c) and (d)\n\n', NULL, 1628840994),
(8990, 5145, 1, 'deferredfeedback', 1928, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Meiotic division of the secondary oocyte is completed:\n\n:  Prior to ovulation\n\n; After zygote formation\n\n; At the time of copulation\n\n; At the time of fusion of a sperm with an ovum\n\n', 'At the time of fusion of a sperm with an ovum\n\n', NULL, 1628840999),
