(8992, 5147, 1, 'deferredfeedback', 1931, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The plant parts which consists of two generations one within the other:\n\n(a) Pollen grains inside the anther\n\n(b) Germinated pollen grain with two male gametes\n\n(c) Seed inside the fruit\n\n(d) Embryo sac inside the ovule\n\n:  (c) and (d)\n\n;  (a) only \n\n;  (a), (b) and (c)\n\n;  (a) and (d) \n\n', ' (a) and (d) \n\n', NULL, 1628841009),
