(10217, 5215, 1, 'deferredfeedback', 18426, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' The vehicle moving on a level circular path will exert pressure such that _________.\n\n: it depends on the speed\n\n; the reaction on the outer wheels will be more\n\n; the reaction on the inner wheels will be more\n\n; the reaction on the inner wheels as well as on the outer wheels will be equal\n\n', 'the reaction on the outer wheels will be more\n\n', NULL, 1630582297),
