(10219, 5217, 1, 'deferredfeedback', 18430, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which one of the following laws is not applicable for a simple pendulum?\n\n: the time period is inversely proportional to square root of its acceleration due to gravity\n\n; the time period is proportional to its length\n\n; the time period is proportional to square root of its length\n\n; the time period does not depend on its magnitude\n\n', 'the time period is proportional to square root of its length\n\n', NULL, 1630582465),
(10220, 5218, 1, 'deferredfeedback', 18431, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In a parallel circuit operating with a source of 30 V AC, designed to carry a total current of 6 A, what happens to the protection device (fuse) when the resistance suddenly changes to 2Ω?\n\n: There is no change\n\n; It closes\n\n; It opens\n\n; It shorts to ground\n\n', 'It opens\n\n', NULL, 1630582595),
(10221, 5219, 1, 'deferredfeedback', 18432, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The ___________ is a dimensionless quantity used in heat transfer calculations.\n\n: Biot number\n\n; Grashoff number\n\n; Stanton number\n\n; Prandtl number\n\n', 'Biot number\n\n', NULL, 1630582636),
(10222, 5220, 1, 'deferredfeedback', 18433, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In order to double the period of a simple pendulum __________.\n\n: the mass of its bob should be quadrupled\n\n; its length should be doubled\n\n; the mass of its bob should be doubled\n\n; its length should be quadrupled\n\n', 'its length should be quadrupled\n\n', NULL, 1630582646),
(10223, 5221, 1, 'deferredfeedback', 18434, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following determines total power in a series circuit?\n\n: Total voltage applied to the circuit\n\n; Current flowing through a switch\n\n; Source voltage times the current\n\n; Average of the wattage consumed by each resistor\n\n', 'Source voltage times the current\n\n', NULL, 1630582746),
(10224, 5222, 1, 'deferredfeedback', 18436, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What should be observed when connecting a voltmeter into a DC circuit?\n\n: Power factor\n\n; Polarity\n\n; RMS\n\n; Resistance\n\n', 'Polarity\n\n', NULL, 1630582879),
(10225, 5223, 1, 'deferredfeedback', 18437, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A potential divider is normally connected _____________.\n\n: outside the generator circuit towards the load circuit\n\n; Within the generator circuit\n\n; at a distance V/100 metres from the generator where V is the voltage to be measured in KV\n\n; None of these\n\n', 'outside the generator circuit towards the load circuit\n\n', NULL, 1630582999),
