(10229, 5227, 1, 'deferredfeedback', 18444, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A bucket of water weighing 10 kg is pulled up from a 20 m deep well by a rope weighing 1 kg/m length, then the work done is __________.\n\n: 600 kg-m\n\n; 200 kg-m\n\n; 400 kg-m\n\n; 500 kg-m\n\n', '400 kg-m\n\n', NULL, 1630583687),
