(10545, 5410, 1, 'deferredfeedback', 18724, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction: Which of the following will come in place of the question mark? AC, BE, DH, ?, KQ\n\n: GK\n\n; HL\n\n; HM\n\n; GL\n\n', 'GL\n\n', NULL, 1631084726),
(10546, 5411, 1, 'deferredfeedback', 18725, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The positions of how many alphabets will remain unchanged if each of the alphabets in the word PROACTIVE is arranged in alphabetical order from left to right\n\n: None\n\n; One\n\n; Two\n\n; Three\n\n; More than three\n\n', 'None\n\n', NULL, 1631085015),
(10547, 5412, 1, 'deferredfeedback', 18727, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (3-7) Study the information given below and answer the questions based on it. Eight boxes P, Q, R, S, T, U, V and W are kept one above another. Top position is 1st and bottom position is last. Three boxes are between S and Q. Box V is immediately above box S. 3 boxes are kept between R and P. Box R is above P. There are the same number of boxes between R and W as between W and S. One box is kept between V and U. Box U is below box V.\n\nHow many boxes are between P and Q?\n\n: None\n\n; 2\n; 3\n; 4\n; 1\n', '1\n', NULL, 1631085556),
(10548, 5413, 1, 'deferredfeedback', 18730, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following box is at the top position?\n\n: T\n\n; P\n\n; R\n\n; W\n; V\n', 'R\n\n', NULL, 1631085975),
(10549, 5414, 1, 'deferredfeedback', 18734, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following box at the last but one position?\n\n: P\n; V\n; U\n; S\n; W\n', 'S\n', NULL, 1631086848),
(10550, 5415, 1, 'deferredfeedback', 18736, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following box is above box W?\n\n: P\n; V\n; S\n; U\n; T\n', 'T\n', NULL, 1631087190),
(10551, 5416, 1, 'deferredfeedback', 18739, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How many boxes are below U?\n\n: None\n\n; 1\n; 2\n; 3\n; 4\n', 'None\n\n', NULL, 1631087411),
(10552, 5417, 1, 'deferredfeedback', 18740, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction (8-12): In the following questions, relationship between different elements are shown in the statements. These statements are followed by two conclusions. Give answer .\n\nStatements A ≥ J = N; H > Y > I < S = N Conclusions: I. A = N II. A > N\n\n: Only conclusion II is true\n\n; Neither conclusion I nor conclusion II is true\n\n; Only conclusion I is true\n\n; Either conclusion I or conclusion II is true\n\n; Both the conclusion I and conclusion II are true\n\n', 'Either conclusion I or conclusion II is true\n\n', NULL, 1631087896),
(10553, 5418, 1, 'deferredfeedback', 18742, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Statements: T ≤ J > F; U > J ≤ H= S Conclusions: I. F ≤ U II. U > T\n\n: Neither conclusion I nor conclusion II is true\n\n; Only conclusion I is true\n\n; Either conclusion I or conclusion II is true\n\n; Both the conclusion I and conclusion II are true\n\n; Only conclusion II is true\n\n', 'Only conclusion II is true\n\n', NULL, 1631088038),
(10554, 5419, 1, 'deferredfeedback', 18743, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Statements: Y > U ≤ H = Q; R ≤ U > M Conclusions: I. R ≤ Q II. Q ≥ M\n\n: Only conclusion I is true\n\n; Both the conclusion I and conclusion II are true\n\n; Neither conclusion I nor conclusion II is true\n\n; Either conclusion I or conclusion II is true\n\n; Only conclusion II is true\n\n', 'Only conclusion I is true\n\n', NULL, 1631088305),
(10555, 5420, 1, 'deferredfeedback', 18745, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Statements: L ≥ F > G ≤ W; H < S = L Conclusions: I. H > G II. W ≤ L\n\n: Neither conclusion I nor conclusion II is true\n\n; Only conclusion I is true\n\n; Only conclusion II is true\n\n; Both the conclusion I and conclusion II are true\n\n; Either conclusion I or conclusion II is true\n\n', 'Neither conclusion I nor conclusion II is true\n\n', NULL, 1631088520),
(10556, 5421, 1, 'deferredfeedback', 18746, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Statements: T > U ≥ V ≥ W; X < Y = W > Z Conclusions: I. Z > U II. W < T\n\n: Neither conclusion I nor conclusion II follows.\n\n; Both conclusions I and II follow.\n\n; Only conclusion II follows.\n\n; Only conclusion I follow.\n\n; Either conclusion I or conclusion II follows.\n\n', 'Only conclusion II follows.\n\n', NULL, 1631088680),
(10557, 5422, 1, 'deferredfeedback', 18747, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If \'2\' is subtracted from each even digit and \'1\' is added to each odd digit in the number 8367284, then how many digits will appear twice in the new number thus formed?\n\n: Two\n\n; More than three\n\n; None of these\n\n; Three\n\n; One\n\n', 'Two\n\n', NULL, 1631088863);
INSERT INTO `mo_question_attempts` (`id`, `questionusageid`, `slot`, `behaviour`, `questionid`, `variant`, `maxmark`, `minfraction`, `maxfraction`, `flagged`, `questionsummary`, `rightanswer`, `responsesummary`, `timemodified`) VALUES
(10558, 5423, 1, 'deferredfeedback', 18751, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction: In the following question, two equations are given. You have to solve these equations and give the answer:\n\n1) 36x2= 1 \n\n2) 3y2 + 7y +2= 0\n\n: x = y or relationship cannot be establish\n\n; y >x\n\n; x > y\n\n; y ≥ x; x ≥ y\n\n', 'x > y\n\n', NULL, 1631090480),
(10559, 5424, 1, 'deferredfeedback', 18748, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction: In the following question, there are two equations. Solve the equations and answer accordingly:\n\n: x=y OR No relation can be established(CND)\n\n; x<y\n\n; x>y\n\n; x≤y\n\n; x≥y\n\n', 'x=y OR No relation can be established(CND)\n\n', NULL, 1631090488),
(10560, 5425, 1, 'deferredfeedback', 18747, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If \'2\' is subtracted from each even digit and \'1\' is added to each odd digit in the number 8367284, then how many digits will appear twice in the new number thus formed?\n\n: None of these\n\n; Two\n\n; One\n\n; Three\n\n; More than three\n\n', 'Two\n\n', NULL, 1631091567),
(10561, 5426, 1, 'deferredfeedback', 18754, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How many such digits are there in the number 935126 which remain same in the number as when the digits are rearranged in descending order within the number?\n\n: One\n; Three\n; More than three\n\n; None\n\n; Two\n', 'Three\n', NULL, 1631091713),
(10562, 5427, 1, 'deferredfeedback', 18755, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction: If it is possible to make only one meaningful word from the first, fifth, seventh and eighth letters of the word SPONTANEOUS, then the second letter from the left is your answer. If no such word can be formed then your answer is X and if more than one such word can be formed your answer is Y.\n\n: Y\n; T\n\n; E\n; X\n\n; S\n', 'Y\n', NULL, 1631091821),
(10563, 5428, 1, 'deferredfeedback', 18756, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction (16-20) : Study the information given below and answer the questions based on it. In a certain language, ‘bright and intellectual students’ is written as ‘mt la ga pa’ ‘fresh and bright mind’ is written as ‘la pa ni dh’ ‘in mind thoughts clear’ is written as ’dh pz ma mi’ ‘intellectual thoughts in mind’ is written as ‘ma pz dh ga’\n\nHow is ‘mind’ written in that code language?\n\n: mi\n\n; pz\n\n; None of these\n\n; dh\n\n; Can’t be determined\n\n', 'dh\n\n', NULL, 1631092553),
(10564, 5429, 1, 'deferredfeedback', 18757, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What will be the possible code for ‘bright and clear’ in the given code language?\n\n: la pa mi\n\n; mi ga mt\n\n; la pa mi\n\n; pa la dh\n\n; None of these\n\n', 'la pa mi\n\n', NULL, 1631092705),
(10565, 5430, 1, 'deferredfeedback', 18758, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In the given code language, what does the code ‘ni’ stand for?\n\n: intellectual\n\n; None of these\n\n; Can’t be determined\n\n; fresh\n\n; fresh\n\n', 'fresh\n\n', NULL, 1631092855),
(10566, 5431, 1, 'deferredfeedback', 18759, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'How is ‘thoughts’ written in that code language?\n\n: Only (B) and (C)\n\n; mi\n\n; either (A) or (B)\n\n; pz\n\n; ma\n\n', 'either (A) or (B)\n\n', NULL, 1631092994),
(10567, 5432, 1, 'deferredfeedback', 18760, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In the given code language, what does the code ‘ga’ stand for?\n\n: ntellectual\n\n; None of these\n\n; bright\n\n; fresh\n\n; mind\n\n', 'ntellectual\n\n', NULL, 1631093145),
(10568, 5433, 1, 'deferredfeedback', 18761, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction (21-25) : Study the information given below and answer the questions based on it. Seven persons P, Q, R, S, T, U and V buy cars in different months i.e. June, July, August, September, October, November and December, not necessarily in the same order. U bought a car in a month which was having 30 days but not in September. Three persons bought cars between U and T. Two persons bought cars between T and Q. Three persons bought cars between Q and P. P bought car one of the months before Q. Two persons bought cars between P and V. S bought car one of the months after V.\n\nWho among the following bought car in August?\n\n: U\n; Q\n; V\n; P\n; R\n', 'R\n', NULL, 1631093429),
