(10691, 5556, 1, 'deferredfeedback', 18886, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The average of five positive numbers is 128. The average of the first two numbers is 118 and the average of last two numbers is 126. What is the third number?\n\n: Cannot be determined\n\n; 152\n; 56\n; 86\n; None of these\n\n', '86\n', NULL, 1631536298),
