(10693, 5558, 1, 'deferredfeedback', 18888, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A man sold an article at a loss of 20%. If he had sold that article for Rs. 24 more then he would have gained 10%. Find the cost price of that article:\n\n: None of these\n\n; Rs. 120\n\n; Rs. 112\n; Rs. 80\n; Rs. 90\n', 'Rs. 112\n', NULL, 1631536782),
(10694, 5559, 1, 'deferredfeedback', 18889, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A started a business with investing Rs. 8000 and after some months, B joined with investing Rs. 5000. At the end of one year, total profit was Rs. 4250 and share of A is Rs. 3000. After how many months did B join?\n\n: 5\n; 1\n; 2\n; 4\n; Date inadequate\n\n', '5\n', NULL, 1631537319),
(10695, 5560, 1, 'deferredfeedback', 18890, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Train P crosses a pole in 6 sec. Train Q coming from opposite direction crosses a bogie of train P of length 1/3 of train P in 4 seconds. Length of Train P and Train Q are in the ratio 5 : 4. Find the speed of Train P, if the speed of Train Q is 21 m/s.\n\n: 20 m/s\n\n; 30 m/s\n\n; 50 m/s\n\n; 60 m/s\n\n; 40 m/s\n\n', '50 m/s\n\n', NULL, 1631537580),
(10696, 5561, 1, 'deferredfeedback', 18890, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Train P crosses a pole in 6 sec. Train Q coming from opposite direction crosses a bogie of train P of length 1/3 of train P in 4 seconds. Length of Train P and Train Q are in the ratio 5 : 4. Find the speed of Train P, if the speed of Train Q is 21 m/s.\n\n: 20 m/s\n\n; 50 m/s\n\n; 30 m/s\n\n; 60 m/s\n\n; 40 m/s\n\n', '50 m/s\n\n', NULL, 1631604189),
(10697, 5562, 1, 'deferredfeedback', 18890, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Train P crosses a pole in 6 sec. Train Q coming from opposite direction crosses a bogie of train P of length 1/3 of train P in 4 seconds. Length of Train P and Train Q are in the ratio 5 : 4. Find the speed of Train P, if the speed of Train Q is 21 m/s.\n\n: 30 m/s\n\n; 60 m/s\n\n; 50 m/s\n\n; 20 m/s\n\n; 40 m/s\n\n', '50 m/s\n\n', NULL, 1631604196),
(10698, 5563, 1, 'deferredfeedback', 18891, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'One ball is picked up randomly from a bag containing 8 yellow, 7 blue and 6 black balls. What is the probability that it is neither yellow nor black?\n\n: 1/3\n; None of the above\n\n; 4/7\n; 3/4\n; 2/9\n', '2/9\n', NULL, 1631605205),
(10699, 5564, 1, 'deferredfeedback', 18892, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A and B together can do a piece of work in 60 days, A and C can do the same work in 45 days. The ratio of Work efficiency of B and C is 1:2. In how many days they together can do the same work?\n\n: 36 days\n; 30 days\n; None of these.\n\n; 25 days\n; 24 days\n', '36 days\n', NULL, 1631605936),
(10700, 5565, 1, 'deferredfeedback', 18893, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Swami brought pulses of worth INR 32/kg and INR 45/kg. He mixed them with a third variety in the ratio 1 : 1 : 2. If the mixture is worth INR 88/kg, then the price of the third variety per kg will be:\n\n: None of the above\n\n; 169.50\n\n; 175.50\n\n; 137.50\n\n; 145.50\n\n', '145.50\n\n', NULL, 1631606987),
