(10726, 5591, 1, 'deferredfeedback', 18975, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Gaganyaan will be launched by Indian Space Research Organisation by which of the following years? (January 2019)\n\n: 2021\n\n; 2022\n\n; 2025\n\n; 2024\n\n; 2023\n\n', '2021\n\n', NULL, 1631779840),
(10727, 5592, 1, 'deferredfeedback', 18981, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What percent of the junked Rs. 500 and Rs 1,000 notes have returned to the banking system as per a report published by Reserve Bank of India?\n\n: 98%\n\n; 99.7%\n\n; 99.3%\n\n; 99%\n\n; 100%\n\n', '99.3%\n\n', NULL, 1631781161),
(10728, 5593, 1, 'deferredfeedback', 18984, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A give some amount to person B at 10% per annum for one year , B gives the same amount to the bank at 20% per annum compounded half yearly . If bank distribute the same amount in ratio 2:3 to C and D respectively at 25% per annum. If in this transaction Bank earns a profit of Rs 2640. Then what is the amount invested by A?[Time = 1 year]\n\n: Rs 60000\n\n; Rs 66000\n\n; Rs 70000\n\n; Rs 64000\n\n; Rs 60000\n\n', 'Rs 66000\n\n', NULL, 1631782171),
(10729, 5594, 1, 'deferredfeedback', 18987, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Ameer’s age is 5/3 times of Shahrukh\'s age. Shahrukh is now 3 times as old as he was, when Ameer was as old as Shahrukh is today. Find Ameer\'s age when Shahrukh\'s was half as old as Ameer is now.\n\n: 50\n; 60\n; 40\n; 30\n; Data insufficient\n\n', 'Data insufficient\n\n', NULL, 1631783358),
(10730, 5595, 1, 'deferredfeedback', 18996, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In a recruitment test, by mistake Akash gave his weight as 25 % more then the actual weight. At the time of the selection he stated his weight was 75Kg 600gm . What is the percentage correction made b the akash from his stated weight to actual weight.\n\n: 20%\n; 24%\n; 29.365%\n\n; 23%\n; 26.32%\n\n', '20%\n', NULL, 1631790724),
(10731, 5596, 1, 'deferredfeedback', 19037, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Direction: Each question is followed by two statements, I and II. Answer each question using the following instructions: I have a box containing 48 balls which are either tennis balls or rubber balls. What is the minimum number of balls to be drawn from the box in order to ensure that a tennis balls is drawn?\n\nI. The ratio of tennis balls to rubber balls is 3:1 \n\nII. There are 12 rubber balls in the bo\n\n.\n\n: The question cannot be answered even by using both the statements together.\n\n; The question can be answered by using statement II alone but cannot be answered using the other statement alone.\n\n; The question can be answered by using statement I alone but cannot be answered using the other statement alone.\n\n; The question can be answered by using either of the statement alone.\n\n; The question can be answered using both of the statements together, but cannot be answered using either of the statement alone.\n\n', 'The question can be answered by using either of the statement alone.\n\n', NULL, 1631797177),
(10732, 5597, 1, 'deferredfeedback', 19055, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A bus travels at 15m/sec from A to B at 9a.m. and a jeep leaves B for A at 9.20 a.m. At what distance from A, does the bus meet the jeep? I. The distance from A to B is 10 km. II. The jeep is 3 times faster than the bus.\n\n: The question can be answered by using statement I alone but cannot be answered using the other statement alone.\n\n; The question cannot be answered even by using both the statements together.\n\n; The question can be answered by using statement II alone but cannot be answered using the other statement alone.\n\n; The question can be answered by using either of the statement alone.; The question can be answered using both of the statements together, but cannot be answered using either of the statement alone.\n\n', 'The question can be answered using both of the statements together, but cannot be answered using either of the statement alone.\n\n', NULL, 1631800148),
(10733, 5598, 1, 'deferredfeedback', 19057, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The radii of two circles are 10cm. and 17 cm. what is the distance between their centres? I. The length of a common chord of both the circles is 16cm. II. The length of a direct common tangent is 20cm.\n\n: The question can be answered by using statement I alone but cannot be answered using the other statement alone.\n\n; The question cannot be answered even by using both the statements together.\n\n; The question can be answered by using statement II alone but cannot be answered using the other statement alone.\n\n; The question can be answered by using either of the statement alone.\n\n; The question can be answered using both of the statements together, but cannot be answered using either of the statement alone.\n\n', 'The question can be answered by using either of the statement alone.\n\n', NULL, 1631860583),
