(10807, 5672, 1, 'deferredfeedback', 19321, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (Q. 27-30): Each of the questions below consists of a question and two statements numbered I and II given below it. You have to decide whether the data provided in the statements are sufficient to answer the question. Read both the statements and give answer\n\n: if the data in both the statements I and II together are not sufficient to answer the question.\n\n; if the data either in statement I alone or in statement II alone are sufficient to answer the question.\n\n; if the data in statement I alone are sufficient to answer the question, while the data in statement II alone are not sufficient to answer the question.\n\n; if the data in statement II alone are sufficient to answer the question, while the data in statement I alone are not sufficient to answer the question.\n\n; if the data in both the statements I and II together are necessary to answer the question.\n\n', 'if the data in statement II alone are sufficient to answer the question, while the data in statement I alone are not sufficient to answer the question.\n\n', NULL, 1632138398),
(10808, 5673, 1, 'deferredfeedback', 19323, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'P, Q, R, S and T are sitting around a circle, facing the centre. Who is second to the right of P?\n\nI. R is on the immediate left of T and second to the right of S. \n\nII. Q is on the immediate right of S and third to the left of P.\n\n: if the data in both the statements I and II together are necessary to answer the question.\n\n; if the data in statement I alone are sufficient to answer the question, while the data in statement II alone are not sufficient to answer the question.\n\n; if the data in statement II alone are sufficient to answer the question, while the data in statement I alone are not sufficient to answer the question.\n\n; if the data either in statement I alone or in statement II alone are sufficient to answer the question.\n\n; if the data in both the statements I and II together are not sufficient to answer the question.\n\n', 'if the data in both the statements I and II together are not sufficient to answer the question.\n\n', NULL, 1632138633),
