(10812, 5677, 1, 'deferredfeedback', 19328, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (Q. 31-35): Read the following information carefully and answer the questions \n\ngiven below: \n\nK, P, T, C, N, D, L and J are standing in a row facing north, but not necessarily in the same order. Only N is between C and D whereas only L is between D and J. T and K are P’s neighbours. Neither T nor C is at the extreme end of the row. J is to the right of T but not necessarily on the immediate right.\n\nWho among the following are neighbours?\n\n: L, T\n\n; T, K\n\n; N, L\n\n; T, C\n\n; K, J\n\n', 'T, C\n\n', NULL, 1632139134),
(10813, 5678, 1, 'deferredfeedback', 19329, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is true?\n\n: T is at one of the extreme ends.\n\n; N is on the immediate right of D.\n\n; P is between K and T.; None of these\n\n; K is not at either of the extreme ends.\n\n', 'P is between K and T.', NULL, 1632139244),
