(10833, 5698, 1, 'deferredfeedback', 19383, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Six women and 10 children together take six days to complete a piece of work. How many days will 10 children take to complete that piece of work if six women together can complete the same piece of work in 10 days?\n\n: 18\n; None of these\n\n; 15\n; 21\n; 12\n', '15\n', NULL, 1632143063),
(10834, 5699, 1, 'deferredfeedback', 19384, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The ratio of the monthly incomes of Sneha, Tina and Akruti is 95:110:116. If Sneha’s annual income is `3,42,000, what is Akruti’s annual income?\n\n: None of these\n\n; `3,96,900\n\n; `5,63,500\n\n; `3,88,000\n\n; `4,17,600\n\n', '`4,17,600\n\n', NULL, 1632143189),
(10835, 5700, 1, 'deferredfeedback', 19385, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Meghna covered 3.36 km in four weeks by walking an equal distance each day. How many metres does she walk each day?\n\n: None of these\n\n; 140 m\n\n; 100 m\n\n; 60 m\n; 120 m\n', '120 m\n', NULL, 1632143389),
(10836, 5701, 1, 'deferredfeedback', 19386, 1, '1.0000000', '0.0000000', '1.0000000', 0, ' The perimeter of a square is twice the perimeter of a rectangle. If the perimeter of the square is 56 cm and the length of the rectangle is 9 cm, what is the difference between the breadth of the rectangle and the side of the square?\n\n: 5 cm\n\n; 9 cm\n\n; None of these\n\n; 11 cm\n\n; 7 cm\n\n', '9 cm\n\n', NULL, 1632143907),
