(10838, 5703, 1, 'deferredfeedback', 19391, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A man riding a bicycle completes one lap of a square field along its perimeter at the speed of 39.6 kmh–1 in 1 minute 20 seconds. What is the area of the field?\n\n: 44100 sq m\n\n; Cannot be determined\n\n; 48400 sq m\n\n; 52900 sq m\n\n; None of these\n\n', '48400 sq m\n\n', NULL, 1632144434),
