(10841, 5706, 1, 'deferredfeedback', 19401, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'On Teachers’ Day, 3200 sweets were to be equally distributed among a certain number of children. But on that particular day 80 children remained absent and hence each child got two sweets extra. How many children were originally supposed to be there?\n\n: 540\n; 320\n\n; Cannot be determined\n\n; 400\n; 500\n', '400\n', NULL, 1632144874),
