(10843, 5708, 1, 'deferredfeedback', 19406, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (Q. 61-65): A total of x students appeared in a class test consisting of three papers, viz Physics, Chemistry and Maths. The following Venn diagram shows the number of students who passed these three papers. None of the students failed in all the three papers together. \n\nAnswer given questions based on this diagram.\n\nHow many students are there who passed in Chemistry and Maths but failed in Physics?\n\n: ; ; ; ; ', '', NULL, 1632145182),
(10844, 5709, 1, 'deferredfeedback', 19410, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What is the difference between the number of students who passed in Chemistry and the number of students who passed in Physics? (The number of students who passed in all the three papers is 15.)\n\n: 15\n; None of these\n\n; 5\n; 20\n; 10\n', '5\n', NULL, 1632145316),
(10845, 5710, 1, 'deferredfeedback', 19412, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'DIRECTIONS (Q. 95-100): IN THE FOLLOWING PASSAGE, SOME OF THE WORDS HAVE BEEN LEFT OUT, EACH OF WHICH IS INDICATED BY A NUMBER. FIND THE SUITABLE WORD FROM THE OPTIONS GIVEN AGAINST EACH NUMBER AND FILL UP THE BLANKS WITH APPROPRIATE WORDS TO MAKE THE PARAGRAPH MEANINGFULLY COMPLETE.\n\nNormally, the police (95) a missing person’s (96) to the missing persons (97), which issues lookout notices. The police search hospitals, mortuaries and even their lock-ups for the missing people. If anyone is (98), relatives are (99). According to data available with the missing persons bureau on an average 28 people (100) missing in Mumbai every day.\n\n 1) forward   2) ask    3) call    4) approve   5) sign\n\n: 3\n; 2\n; 4\n; 1\n; 5\n', '1\n', NULL, 1632145420),
