(10850, 5715, 1, 'deferredfeedback', 19417, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Two trains start at the same time from Delhi and Pune and proceed towards each other at the rate of 50 km/hr and 2 1 37 km/hr respectively. When they meet, it is found that one train has travelled 400 km more than the other train. What is the distance between Delhi and Pune?\n\n: 2000 km\n\n; 2800 km\n\n; 2400 km\n; 3000 km\n; None of these\n\n', '2800 km\n\n', NULL, 1632145863),
