(10855, 5720, 1, 'deferredfeedback', 19424, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (Q. 69-70): Each of the questions below consists of a question and two statements numbered (I) and (II). You have to decide whether the data provided in the statements are sufficient to answer the question. Read both the statements and give answer.\n\nA student scored 300 marks in five subjects, viz A, B, C, D and E. What is his score in A? \n\n(I) The average of marks scored by him in B, C, D and E is 63. \n\n(II) His marks in A is 80% of the average of marks scored by him in all five subjects.\n\n: if the data in statement (II) alone are sufficient to answer the question, while the data in statement (I) alone are not sufficient to answer the question.\n\n; If the data in both statements (I) and (II) together are necessary to answer the question.\n\n; if the data either in statement (I) alone or in statement (II) alone are sufficient to answer the question.\n\n; if the data in statement (I) alone are sufficient to answer the question, while the data in statement (II) alone are not sufficient to answer the question.\n\n; if the data even in both statements (I) and (II) together are not sufficient to answer the question.\n\n', 'if the data either in statement (I) alone or in statement (II) alone are sufficient to answer the question.\n\n', NULL, 1632146418),
