(10881, 5746, 1, 'deferredfeedback', 19457, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What, according to the passage, is definitely the root cause of problems with global food prices?\n\n: Increase in global liquidity\n\n; Financialisation of commodities\n\n; Food crisis faced globally in 2008\n\n; Shortage of commodities that constitute food items\n\n; None of these\n\n', 'Increase in global liquidity\n\n', NULL, 1632209580),
