(10914, 5779, 1, 'deferredfeedback', 19510, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (Q. 16-20): Rearrange the following five sentences A, B, C, D and E in the proper sequence so as to form a meaningful paragraph; then answer the questions given below them:\n\nA) Devika was told that the report was urgent. (B) Even though the whole day was available she could not finish it. (C) Her boss had told her this right in the morning. (D) Her boss asked her again when the office was about to close. (E) She had to disappoint her boss that day.\n\nWhich sentence should come THIRD in the paragraph?\n\n: E\n; B\n; A\n; C\n; D\n', 'B\n', NULL, 1632213092),
