(10919, 5784, 1, 'deferredfeedback', 19515, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Directions (Q. 21-30): Read the passage carefully and answer the questions given below it. Certain words/phrases are given in bold to help you locate them while answering some of the questions.\n\nThe RBI orders a moratorium when a bank’s financial stability is threatened. Depositors face some restrictions on withdrawing money from their accounts during this period. Currently the restriction is confined to premature withdrawal of FDs in case of Kapol Bank. Customers can still withdraw money from their savings and current accounts. However, the Banking Regulation Act has provisions for relief to customers facing a financial emergency. “Banks’ administrative board can approach the RBI with a plea for relaxing the withdrawal limits in case of account holders such as those who have saved or deposited money for their medical treatment or educational purpose and pensioners,” says VN Kulkarni, chief credit counsellor with the Bank of India-backed Abhay Credit Counselling Centre.\n\nSince one cannot do much after the bank gets into trouble or the RBI comes into the picture, it would be wise to take some precautions. “Depositors need to be selective not only in choosing the bank, but also in depositing the amount using different combinations,” says Kulkarni. For instance, you can maintain the first deposit in your name, held jointly with your spouse or children. Similarly, the second joint FD could be created with your wife as the first holder. This will help you benefit from the deposit insurance cover extended to retail depositors.\n\nCurrently, deposits are insured up to `1 lakh per bank, and not per branch of the same bank. You can also look at maintaining FDs in more than one bank to spread out the risk.\n\nHowever, this may not be feasible for some individuals. For instance, a retiree who wishes to invest her huge retirement corpus in FDs. “It is not feasible to split a huge amount of, say, `50 lakh into 50 deposits with different banks. Senior citizens have to strike a balance between convenience, risks and higher returns that some of the smaller banks offer,” says Suresh Sadagopan, certified financial planner and founder, Ladder7 Financial Advisories. He recommends diversification by investing in fixed-income options like company FDs, non-convertible debentures (NCDs) as also more secure alternatives such as taxfree bonds and senior citizens savings scheme, which offers an interest rate of 9.2 % . You must also evaluate the bank’s credentials carefully before parking your money in it. “While selecting the bank, you need to ascertain its gross NPAs. It should be not higher than 5%. Similarly, ensure that your bank has adequate capital as prescribed by the regulators,” says Kulkarni. “That is, minimum 9% of risk-weighted assets, and at least 12%, in case of co-operative banks.” You will find this information in the balance sheets of banks.\n\nWhat is the effect of a moratorium on a bank?\n\nA) Only senior citizens are allowed partial withdrawal of maturity amount for their medical treatment. (B) Maturity amount is paid in instalments rather than in one lump sum. \n\n(C) Certain restrictions are imposed on withdrawal of money from bank account.\n\n: Only (C)\n\n; All (A), (B) and (C)\n\n; Only (A) and (B)\n\n; Only (B)\n\n; Only (A)\n\n', 'Only (C)\n\n', NULL, 1632213487),
(10920, 5785, 1, 'deferredfeedback', 19516, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following statements is based on the provisions related to bank deposits? \n\n(A) Every branch of a bank allows insurance covers on deposits upto `1 lakh. \n\n(B) FD can be maintained in more than one bank to spread out the risk with the exception of retirees wishing to invest a very huge amount in FDs. \n\n(C) Senior citizens are allowed extra risk cover and high returns on their fixed deposits.\n\n: Only (B) and (C)\n\n; Only (C)\n\n; Only (B)\n\n; Only (A)\n\n; Only (A) and (B)\n\n', 'Only (B)\n\n', NULL, 1632213601),
(10921, 5786, 1, 'deferredfeedback', 19519, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is not definitely true with respect to Kapol Bank?\n\n: None of these\n\n; There are no restrictions on withdrawal except of premature fixed deposits.\n\n; At present, premature withdrawal of FD cannot be allowed.\n\n; It is a private sector bank.\n\n; Customers of this bank have been allowed withdrawal of money from their CASA.\n\n', 'It is a private sector bank.\n\n', NULL, 1632213708),
(10922, 5787, 1, 'deferredfeedback', 19519, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of the following is not definitely true with respect to Kapol Bank?\n\n: At present, premature withdrawal of FD cannot be allowed.\n\n; It is a private sector bank.\n\n; None of these\n\n; There are no restrictions on withdrawal except of premature fixed deposits.\n\n; Customers of this bank have been allowed withdrawal of money from their CASA.\n\n', 'It is a private sector bank.\n\n', NULL, 1632213712),
(10923, 5788, 1, 'deferredfeedback', 19520, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'What care should be taken before depositing money with a bank? Answer in the context of the given passage. \n\n(A) The NPA of the concerned bank is not higher than five per cent. \n\n(B) The bank has adequate capital as per the provisions for the bank. \n\n(C) There is a minimum 9% of risk-weighted assets (if the bank is other than a cooperative bank).\n\n: Only (A) and (C)\n\n; Only (B) and (C)\n\n; Only (C)\n\n; Only (A) and (B)\n\n; All (A), (B) and (C)\n\n', 'All (A), (B) and (C)\n\n', NULL, 1632213801),
(10924, 5789, 1, 'deferredfeedback', 19523, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Find the statement which is not based on the facts mentioned in the passage.\n\n: When the financial stability of a bank is at stake the central bank orders a moratorium.\n\n; Under certain circumstances, account holders facing financial emergency can be allowed withdrawal of money beyond withdrawal limit as per the provisions laid down in the Banking Regulation Act.\n\n; None of these\n\n; The central bank has ordered a moratorium on Kapol Bank.\n\n; When the bank gets into trouble it is better for a depositor to be selective in both choosing the bank and depositing the amount using different combinations.\n\n', 'When the bank gets into trouble it is better for a depositor to be selective in both choosing the bank and depositing the amount using different combinations.\n\n', NULL, 1632213933),
