(11008, 5873, 1, 'deferredfeedback', 19695, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (11-20): In the following questions, read the following passage carefully and answer the questions given below it. Certain words/phrases are given in bold to help you locate them while answering some of the questions.\n\nOver the past few days alone, the China’s central bank has pumped extra cash into the financial system and cut interest rates. The aim is to free more cash for banks to lend and provide a boost for banks seeking to improve the return on their assets. The official data though, suggested that bad loans make up only 1,4% of their balance sheets. How to explain the discrepancy? One possible answer is that bad loans are a tagging indicator i.e. it is only after the economy has struggled for a while that borrowers began to suffer. Looked at this way, China is trying to anticipate problems keeping its banks in good health by sustaining economic growth of nearly 7% year on year. Another more worrying possibility is that bad loans are worse than official data indicate. This does not look to be the cause for China’s biggest banks, which are man­aged conservatively and largely focus on the county’s biggest value and quality borrowers. But there is mounting evidence that when it comes to smaller banks, especially those yet to list on the stock market, bad loans piling up. That is important because unlisted lenders account for just over a third of the Chinese banking sector, making them as big as Japan’s entire banking industry.\n\nAlthough, non-performing loans have edged up slowly, the in­crease in special­mention loans (a category that includes those over­due but not yet classified as impaired loans.) has been much bigger. Special-mention loans are about 2% at most of China’s big listed banks, suggesting that such loans must be much higher at their smaller, unlisted peers. Many of these loans are simple bad debts which banks have not yet admitted to. Another troubling fact is that fifteen years ago, the government created asset-management companies (often referred to as bad-banks) to take on the non-performing loans of the lenders. After the initial transfer these companies had little to pay. But, last year, Cinda, the biggest of the bad banks, bought nearly 150 billion Yuan ($24 billion) of distressed assets last year, two- thirds more than in 2013. These assets would have raised the banks bad-loans ratio by a few tenths of a percentage point. Although such numbers do not seem very alarming, experts who reviewed last year’s results for 158 banks, of which only 20 are listed found that “shadow loans”, loans recorded as investments which may be a disguise for bad loans have grown to as much as 5.7 billion Yuan, or 5% of the industry’s assets. These are heavily concentrated on the balance sheets of smaller-unlisted banks, and at the very least, all this points to a need for recapitalisation of small banks.\n\nChoose the word which is most nearly the same in meaning to the word ‘TAGGING’ given in bold as used in the passage.\n\n: tying\n\n; breaking\n\n; delayed\n\n; stopping\n\n; protecting\n\n', 'tying\n\n', NULL, 1632295927),
(11009, 5874, 1, 'deferredfeedback', 19696, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Choose the word which is opposite in meaning to the word FREE given in bold as used in the passage.\n\n: charged\n\n; restrict\n\n; expensive\n\n; complimentary\n\n; secret\n\n', 'restrict\n\n', NULL, 1632296056),
(11010, 5875, 1, 'deferredfeedback', 19697, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'According to the passage, which of the following can be said about China’s large bank\n\n(A) These are cautiously run. \n\n(B) Their clients are mainly high value. \n\n(C) 2 percent of their loans have been classified as overdue but not impa\n\n: Only (A)\n\n; Only (B) and (C)\n\n; All (A), (B) and (C)\n\n; Only (B)\n\n; Only (A) and (C)\n\n', 'Only (B) and (C)\n\n', NULL, 1632296270),
(11011, 5876, 1, 'deferredfeedback', 19698, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following is the central idea of the passage?\n\n: The government should do away with asset management companies.\n\n; Small banks should be permitted to become listed\n\n; There is trouble brewing in China’s small unlisted banks.\n\n; China’s central bank has failed to predict and stop the decline of its banks.\n\n; China’s financial crisis is not as serious as it is being made out to be.\n\n', 'There is trouble brewing in China’s small unlisted banks.\n\n', NULL, 1632296467),
(11012, 5877, 1, 'deferredfeedback', 19700, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following is true in the context of the passage?\n\n: China has not implemented any resources to help its banking sector in recent times.\n\n; China’s stock market has plummeted in recent times.\n\n; None of the given options is true in the context of the passage.\n\n; Japan’s banking industry is experiencing a boom unlike that of China.\n\n; Approximately 32% of China’s banking sector is unlisted.\n\n', 'None of the given options is true in the context of the passage.\n\n', NULL, 1632296846),
(11013, 5878, 1, 'deferredfeedback', 19242, 1, '1.0000000', '0.0000000', '1.0000000', 0, '                              ENGLISH LANGUAGE\n\nDirections (1-10): Read the following passage carefully and answer the questions. Certain words / phrases are given in bold to help you locate them while answering some of the questions. \n\nInequality is at the top of the agenda around the world. Hilary Clinton, the leading Democratic candidate to succeed Barack Obama as president of the United States, made inequality the centerpiece of a major campaign speech.\n\nEconomists at the IMF too have recently released a study assessing the causes and consequences of rising inequality. Its authors reckon that while inequality could cause all sorts of problems, governments should be especially concerned about its effects on growth. They estimate that a one percentage point increase in the income share of the top 20% will drag down growth by 0.08% percentage points over five years, while a rise in the income share of the bottom 20% actually boosts growth. But how does inequality affect economic growth rates?. Economists say that some inequality is needed to propel growth. Without the carrot of large financial rewards, risky entrepreneurship and innovation would grind to a halt. In 1975, an American economist, argued that societies cannot have both perfect equality and perfect efficiency, but must choose how much of one to sacrifice for the other. While most economists continue to hold that view, the recent rise in inequality has prompted a new look at its economic costs. Inequality could impair growth if those with low incomes suffer poor health and low productivity as a result, or if, as evidence suggests, the poor struggle to finance investments in education, inequality could also threaten public confidence in growth-boosting capitalist strategies like free trade.\n\nMore recent work suggests that inequality could lead to economic or financial instability. The governor of the Reserve Bank of India argued that governments often respond to inequality by easing the flow of credit to poorer households, however, American households borrowed heavily prior to the crisis to prop up their consumption. But for this rise in household debt, consumption would have stagnated as a result of poor wage growth. Crafting a response to rising inequality is therefore tricky, he says. Some of the negative impact of inequality on growth can be blamed on poor government policies in highly unequal countries. In Latin America, for instance, populist pressure for excessive state economic control seems to shorten the average duration of growth spells. Yet in moderation, redistribution seems to benign effects perhaps by reducing dependence on risky borrowing among poorer households. Over the past generation or two inequality has risen most in places where progressive policies, such as high top tax-rates, have been weakened. A little more redistribution now might improve the quality and quantity of economic-growth and reduce the demand for more aggressive state interventions later.\n\nQ. Choose the word which is most nearly the same in meaning to the word CARROT given in bold as used in the passage.\n: satisfaction\n\n; incentive\n\n; nutrient\n\n; argument\n\n; threat\n\n', 'incentive\n\n', NULL, 1632298979),
(11014, 5879, 1, 'deferredfeedback', 19705, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (21-25): Rearrange the given six sentences/group of sentences (A), (B), (C), (D), (E) and (F) in a proper sequence as to form a meaningful paragraph and then answer the given question.\n\nA) Global investors are quaking over the prospect of a devastating stump in the world’s second biggest economy. \n\n(B) A possible answer could be that the country’s troubles raise doubts about whether its policymakers have the tools to keep their economy growing at a healthy place something that has been a constant reassurance for more than two decades \n\n(C) And they are fast losing confidence that the country’s policymakers, seemingly so sure-footed in the past know how to solve the problem. \n\n(D) However, such a domino effect is significant but hardly catastrophic so why the hysteria? \n\n(E) China is exporting something new to the world economy Fear? \n\n(F) Apart from the shrinking confidence, the biggest fear is that a collapsing Chinese economy would derail others around the world — from emerging markets in Chile and Indonesia to industrial powers such as the United States.\n\nWhich of the following should be the SECOND sentence after rearran\n\n: B\n; A\n; D\n; F\n; E\n', 'A\n', NULL, 1632300973),
