(11019, 5884, 1, 'deferredfeedback', 19710, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (26-30): In the following passage, there are blanks, each of which has been numbered. Against each, five words are suggested, one of which fits the blank appropriately. Find out the appropriate word in each case.\n\nPrimary school enrolment in India has been a success story. (26) due to various programmes and drives to increase enrolment even in remote areas. With enrolment reaching at least 96 percent since 2009, and girls (27) up 56 percent of new students between 2007 and 2013, it is clear that many (28) of access to schooling have been (29). Improvement in infrastructure has been the (30) behind achieving this and now in India 98 percent habitations have a primary school within one kilometer and 92 percent have an upper primary school within a three kilometre walking distance.\n\n(1) most (2) properly (3) totally (4) optionally (5) largely\n\n: 5\n; 2\n; 1\n; 4\n; 3\n', '5\n', NULL, 1632301952),
