(11024, 5889, 1, 'deferredfeedback', 19715, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'QUANTITATIVE APTITUDE\n\nirections (31-35): Study the table carefully and answer the given questions. \n\nData related to number of candidates appeared and qualified in a competitive exam from 2 states during 5 years:\n\nNOTE : Few values are missing in the table (indicated by —). A candidate is expected to calculatethe missing value, if it is required to answer the given question on the basis of given data and informatio\n\nOut of the number of qualified candidates from State P in 2008, the respective ratio of male and candidates is 11 : 7. If the number of female qualified candidates from State P in 2008 is 126, what is the number of appeared candidates (both male and female) from State P in 2008 ? female.\n\n: 510\n; 540\n; 630\n\n; 570\n; 690\n', '540\n', NULL, 1632303069),
