(11107, 5972, 1, 'deferredfeedback', 19838, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (Q. 6-10) : Rearrange the following five sentences (A), (B), (C), (D) and (E) in the proper sequence to form a meaningful paragraph and then answer the questions given below.\n\nA) Opposition parties have opposed the EPFO\'s move to raise exposure to equities to ostensibly protect workers\' interest. \n\n(B) Further, the National pension System (NPS), which invests in equity, generates superior returns for its subscribers. \n\n(C) They must see the reason that, equities tend to fetch better returns than government bonds in which the EPF mostly invests, and will help workers grow their retirement nest. \n\n(D) Its corpus of about ` 10 lakh crore is large enough to be invested across risk classes to minimise risk and maximise returns. \n\n(E) Now, the EPFO invests only 5% of its incremental deposits every month in exchange-traded funds tracking benchmark indices Sensex and Nifty, though rules allow a maximum 15% of exposure to stock markets, a higher exposure makes sense.\n\nWhich of the following would be the FIRST sentence after rearrangement ?\n\n: B\n; A\n; D\n; E\n; C\n', 'A\n', NULL, 1632389030),
