(11113, 5978, 1, 'deferredfeedback', 19843, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (Q. 11-15) : Each questions below has two blanks, each blank indicating that something has been omitted. Choose the set of words for each blank that best fits the meaning of the sentence as whole.\n\nTo accomplish anything, one must not only ________ certain positive qualities but also _______ certain negative qualities.\n\n: acquire, avoid\n\n; chase, absquatulate\n\n; obtain, withdraw\n\n; attain, diverge\n\n; inherit, stray\n\n', 'acquire, avoid\n\n', NULL, 1632390422),
(11114, 5979, 1, 'deferredfeedback', 19844, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'With the Constitutional Amendment Bill passed in the Rajya Sabha, _________ India is keen to ________ the historic development in the country\'s indirect tax regime.\n\n: corporate, witness\n\n; independent, cope\n\n; solidarity, disproof\n\n; concord, confront\n\n; ecumenical, combat\n\n', 'corporate, witness\n\n', NULL, 1632391681),
(11115, 5980, 1, 'deferredfeedback', 19846, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'The productivity of pulses in India has ________ almost _________ at 5.5-7.5 quintals per hectare during the last 50 years or so.\n\n: vamoosed, precarious\n\n; moved, whimsical\n\n; remained, stagnant\n\n; pushed on, volatile\n\n; bailed, transient\n\n', 'remained, stagnant\n\n', NULL, 1632392079),
(11116, 5981, 1, 'deferredfeedback', 19849, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (Q. 16-25) : Read the following passage carefully and answer the given questions. Certain words/phrases have been given in bold to help you locate them while answering some of the questions. Recently 110 Nobel Laureates issued a strongly worded plea to Greenpeace to “abandon their campaign against [genetically modified organisms] in general and Golden Rice in particular.” This is not the first time notable scientists have waded into the controversy surrounding genetically modified (GM) crops. What is remarkable about this latest foray, however, is their poor grasp of the facts surrounding Golden Rice.\n\nGolden Rice is an orange-yellow-coloured rice, genetically modified to produce beta-carotene, the precursor of Vitamin A. Advocates claim it is a powerful way to combat Vitamin A deficiency, the cause of diseases like childhood blindness, and deaths, particularly among the poor in Africa, South and Southeast Asia. Golden Rice was first developed around 1999 by two European scientists, Ingo Potrykus and Peter Beyer. The transnational agribusiness corporation Syngenta currently holds commercial rights to it. Moved apparently by humanitarian sentiments, Syngenta decided in 2004 to sublicense it free of charge (subject to several conditions, not all of which are straightforward) to agricultural research institutions in developing countries, through an entity named the Golden Rice Humanitarian Board. The project of taking Golden Rice to developing countries is housed within the International Rice Research Institute (IRRI) in Philippines.\n\nThe Nobel Laureates argue that the reason this innovation has not started saving lives yet is Greenpeace’s criminal opposition. This narrative of conspiracy glosses over the rather more straightforward explanation: As IRRI itself admits on its website, Golden Rice is not ready for farmers, yet. There are above-board reasons for this which have little to do with antiGM activists.\n\nThe Laureates say that Golden Rice has “the potential to reduce or eliminate much of the death and disease caused by Vitamin A deficiency” (emphasis added). At least two conditions need to be met for Golden Rice to work as hoped: it should be suitable for cultivation by farmers; and it should be bio-available, that is, the digestive system should be able to extract the beta-carotene and make it available to the body, thus improving Vitamin A levels.\n\nThe two versions of Golden Rice developed so far, Golden Rice 1 and 2, are both Japonica (sticky, dryland) rices, while people in areas with Vitamin A deficiency in South and Southeast Asia generally cultivate and consume the non-sticky, submerged Indica paddies. Japonica varieties are easier to modify genetically, but do not perform well in Asian fields. IRRI is still in the process of crossing Golden Rice into Indica varieties. In 2014, IRRI stated, “Results of the first round of multi-location trials of Golden Rice showed that… yields of candidate lines were not consistent across locations and seasons, prompting research direction toward assessing [other] Golden Rice versions.” This is hardly a rice ready for cultivation by farmers - it has not even entered the stage of biosafety evalution by government regulatory institutions.\n\nThe question of bioavailability is even more vexed. The body does not necessarily absorb beta-carotene because one eats Golden Rice. The Golden Rice Humanitarian Board’s website quotes a study published in 2012 in The American Journal of Clinical Nutrition for establishing the effectiveness of Golden Rice. On July 29, 2015, the journal retracted this paper citing ethical concerns.\n\nEven assuming that ethical concerns do not detract from the paper’s findings, the study design merits attention. The study saw middle-income, healthy Chinese children consuming a total of 210 grams of pork and other foods over breakfast and lunch daily, with 40 per cent of their total calorie intake coming from fat. Fats help the body absorb beta-carotene, since the latter dissolves easily in fats. Unlike customary practice, the Golden Rice fed to the children had been stored at minus 70°C after drying for three days, to avoid any decline in beta-carotene levels with time. Thus, the study design favoured Golden Rice, rather than reflecting the actual lives and habits of poor Asians and Africans, who generally cannot afford fatrich meals every day.\n\nThe Nobel Laureates accuse Greenpeace’s campaign of raising the regulatory bar for GM crops. The facts above suggest that neither Greenpeace nor regulatory hurdles have delayed Golden Rice’s release. In fact, in 2009, the distinguished biotechnologist, former Deputy Director-General (Crop Science) of the Indian Council of Agricultural Research, who had worked on Golden Rice at IRRI, categorically stated, “The regulatory system is not the barrier to releasing Golden Rice in India.” IRRI itself, in its last update released in 2014, said: “Golden Rice will only be made available broadly to farmers and consumers if it is successfully developed into rice varieties suitable for Asia, approved by national regulators, and shown to improve Vitamin A status in community conditions.”\n\nLet us, for the moment, ignore the political aspects of Golden Rice and GM crops. Let us overlook the fact that many sciences (other than physics, chemistry, and medicine represented in the letter) have something to contribute to the debate over GM crops — in India, agricultural scientists, ecologists, nutritionists, and sociologists, among others, have insightfully contributed to the debate\n\nAccording to the passage, which of the following is the cause of Vitamin A deficiency?\n\n: Childhood stone-blindness and death.\n\n; Childhood blindness, and infections.\n\n; Childhood blindness and malnutrition.\n\n; Childhood blindness.\n\n; Measles, diarrhoea, long sightedness and death.\n\n', 'Childhood stone-blindness and death.\n\n', NULL, 1632392652),
(11117, 5982, 1, 'deferredfeedback', 19852, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following can be said about the international Rice Research Institute (IRRI)? \n\n(A) IRRI\'s international prestige lends secondary to the country as the center for collaboration in rice reasearch. \n\n(B) IRRI changes the lives of people providing beta-carotene. \n\n(C) IRRI develops new rice varieties and rice crop management techniques that help rice farmers improve the yield and the quality of rice.\n\n: Only A\n\n; Only B and C\n\n; Only C\n\n; Only B\n\n; Only A and B\n\n', 'Only C\n\n', NULL, 1632393464),
(11118, 5983, 1, 'deferredfeedback', 19868, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 11-15): IN EACH OF THESE QUESTIONS, TWO SENTENCES (I) & (II) ARE GIVEN. EACH SENTENCE HAS A BLANK IN IT. FIVE WORDS 1), 2), 3), 4) & 5 ) ARE SUGGESTED. OUT OF THESE, ONLY ONE FITS AT BOTH THE PLACES IN THE CONTEXT OF EACH SENTENCE. THE NUMBER OF THAT WORD IS THE ANSWER.\n\nI. Prices have _________ by 21% since the beginning of the year. \n\nII. The plane took off for Los Angeles, lost an engine as it ________ and crashed off the runway.\n\n: climbed\n\n; declined\n\n; rose\n\n; increased\n\n; reduced\n\n', 'climbed\n\n', NULL, 1632393713),
(11119, 5984, 1, 'deferredfeedback', 19869, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following is/are NOT TRUE in the context of the passage? \n\nA) The Golden Rice will only be made, if it is successfully advanced into rice varieties suitable for Asia and approved by national regulators and shown to improve Vitamin A. \n\nB) The Golden Rice is bio-available and the digestive system is able to lay away the beta-carotene. C) The Golden Rice has not entered the stage of biosafety evaluation by government regulatory institutions.\n: Only B\n\n; Only A and B\n\n; Only A\n\n; Only C\n\n; Only A and C\n\n', 'Only B\n\n', NULL, 1632393753),
