(11156, 6021, 1, 'deferredfeedback', 19991, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Reasoning Ability\n\nDIRECTIONS (Q. 66-70) : STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nThere are eight employes Sapna, Ujit, Wasim, Yunis, Zaheer, Tanmay, Vansh and Xavier of an organisation working in three departments viz— Production, R & D and Designing. Each of them has a different choice of colours, viz— Blue, Yellow, Orange, White, Green, Voilet, Black and Brown but not necessarily in same order. There are no more than three employees in any department.\n\nVansh likes Brown colour and does not work in R & D. Zaheer does not work in Designing and does not like either Yellow or White colour. Wasim works in Desiging and likes neither Blue nor Yellow colour. Yunis works in production with only Ujit, who likes Balck colour. Sapna and Xavier do not work in the same department as Wasim. The one who likes Blue colour works in Designing. The one who likes Orange colour work in production. Those who work in Designing like neither white nor Green colour. Xavier does not like Yellow colour.\n\nWhich of the following colours does Zaheer like ?\n\n: Orange\n\n; Green\n\n; Brown\n\n; Blue\n\n; None of these\n\n', 'Green\n\n', NULL, 1632473238);
