(11248, 6043, 71, 'deferredfeedback', 19996, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (Q. 71-75) : In each questions given below four statements are followed by three conclusions numbered I, II and III. You have to take the given statements to be true even if they seem to be at variance from the commonly knows facts. Read the conclusions and decide which logically follows from the given statements disregarding commonly known facts and give answer.\n\nStatements : \n\n     All pets are dogs. \n\n     All dogs are cats. \n\n     Some cats are rats. \n\n     Some rats are goat. \n\nConclusions : \n\n     I. some cats are pets. \n\n     II. Some goats are cats. \n\n     III. Some rats are dogs.\n\n: Only I follows\n\n; Only I and II follow\n\n; Only I and III follow\n\n; All follows\n\n; None of these\n\n', 'Only I follows\n\n', NULL, 1632611921),
(11249, 6043, 72, 'deferredfeedback', 19997, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Statements : \n\n     Some roses are jasmine. \n\n     Some jasmines are lilies. \n\n     Some jasmines are marigold. \n\n     No marigold is sunflower. \n\nConclusions : \n\n     I. Some lilies are marigold. \n\n     II. No lily is marigold. \n\n     III. No sunflower is jasmine.\n\n: None follows\n\n; Only I follows\n\n; Only II follows\n\n; Only III follows\n\n; Only either I or II follows.\n\n', 'Only either I or II follows.\n\n', NULL, 1632611921),
