(11258, 6043, 81, 'deferredfeedback', 20009, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 81-84) :STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nRahul, who is a student going to school everyday. At first he walked 80 m towards east from his home and took a right turn and walked 40 m. He again took a right turn and walked 60 m. Finally he took a right turn and reached the school, which was 20 metres away\n\nOne day, there was a long queue at the school and when Rhaul reached it was 9 : 45 O’clock. He was a little worried about he would be late to reach his school. It was taking one and half minutes for every student to enter the school.\n\nIn which direction was the school located from Rahul’s home ?\n\n: South\n\n; South-East\n\n; North-East\n\n; North-West\n\n; East\n\n', 'South-East\n\n', NULL, 1632611921),
(11259, 6043, 82, 'deferredfeedback', 20010, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What was the total distance covered by Rahul to reach school ?\n\n: 200 m\n\n; 80 m\n\n; 160 m\n\n; 120 m\n\n; 100 m\n\n', '200 m\n\n', NULL, 1632611921),
(11260, 6043, 83, 'deferredfeedback', 20011, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'If there were 30 students ahead of Rahul, at what time did he enter the school?\n\n: 10 : 15 O’clock\n\n; 10 : 30 O’clock\n\n; 10 : 05 O’clock\n\n; Can’t be determined\n\n; None of these\n\n', '10 : 30 O’clock\n\n', NULL, 1632611921),
(11261, 6043, 84, 'deferredfeedback', 20012, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What is the shortest distance between the school to Rahul’s home ?\n\n: ; ; ; ; ', '', NULL, 1632611921),
(11262, 6043, 85, 'deferredfeedback', 20013, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Pointing to a child, Ragini says, “He is the son of my grandmother’s only son.” How is the boy’s mother related to Ragini?\n\n: Mother\n\n; Aunt\n\n; Sister\n\n; Cousin\n\n; None of these\n\n', 'Cousin\n\n', NULL, 1632611921),
(11263, 6043, 86, 'deferredfeedback', 20014, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'N is sister of U and V is brother of U. Z is father of U and X is daughter of Y, who is mother of N. How many daughter’s does Y have ?\n\n: One\n\n; Two\n; Three\n; Can’t be determined\n\n; None of these\n\n', 'Can’t be determined\n\n', NULL, 1632611921),
(11264, 6043, 87, 'deferredfeedback', 20015, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 87-91) : STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nIn a play school eight baby A, B, C, D, E, F, G and H are sitting around a circular table, facing outside from the centre. Each of them was born in a different months of a year—January, February, March, April, May, June, July and August but not necessarily in the same order.\n\nD is sitting second to the left of B. C is sitting third to the left of A. C and A were born before April. Only the one who born in June is sitting exactly between A and B. E, who is the eldest, is not an immediate neighbour of A or D. H is older than only D. H is sitting second to the right of G. G is not an immediate neighbour of E. A is younger than C. B was born before F.\n\nWho is the second oldest in the group ?\n\n: A\n; C\n; B\n; G\n; None of these\n\n', 'C\n', NULL, 1632611921),
(11265, 6043, 88, 'deferredfeedback', 20016, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Who is sitting third to the left of F ?\n\n: The one who born in March.\n\n; The one who born in April.\n\n; The one who born in July.\n\n; The one who born in June.\n\n; None of these\n\n', 'The one who born in March.\n\n', NULL, 1632611921),
(11266, 6043, 89, 'deferredfeedback', 20017, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'In which month was H born ?\n\n: March\n\n; February\n\n; April\n\n; July\n\n; None of these\n\n', 'July\n\n', NULL, 1632611921),
(11267, 6043, 90, 'deferredfeedback', 20018, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following statements is true regarding B ?\n\n: B is sitting fourth to the right of H.\n\n; The one who was born in February is on the immediate left of B.\n\n; B is younger than H.\n\n; There are four persons sitting between E and D.\n\n; None of these\n\n', 'The one who was born in February is on the immediate left of B.\n\n', NULL, 1632611921),
(11268, 6043, 91, 'deferredfeedback', 20019, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Who sits exactly opposite the one who was born in April ?\n\n: A\n; H\n; F\n; D\n; None of these\n\n', 'None of these\n\n', NULL, 1632611921),
(11269, 6043, 92, 'deferredfeedback', 20022, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 92-96) : STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nTwelve people A, B, C, D, E, F, T, U, V, W, X, and Y are sitting in two parallel rows. In row-1 A, B, C, D, E and F are seated and all of them face south while in row-2 T, U, V, W, X and Y seated and all of them face north but not necessarily in the same order. Therefore in the given sitting arrangement each person seated in a row faces another member of the other row. \n\nV, who is at one of the ends of the row, is second to the left of Y. There are two persons between U and T. There is only one person sits between F and A. B sits third to the right of D. B doesn’t sit opposite either V or Y. F and A don’t sit opposite V. C sits adjacent to F. W, who doesn’t sit opposite A, is not adjacent to U.\n\nWho sits opposite D ?\n\n: U\n; Y\n; W\n; X\n; T\n', 'T\n', NULL, 1632611921),
(11270, 6043, 93, 'deferredfeedback', 20023, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'How many persons sit between E and F ?\n\n: Four\n\n; Three\n; Two\n; One\n; None of these\n\n', 'Two\n', NULL, 1632611921);
INSERT INTO `mo_question_attempts` (`id`, `questionusageid`, `slot`, `behaviour`, `questionid`, `variant`, `maxmark`, `minfraction`, `maxfraction`, `flagged`, `questionsummary`, `rightanswer`, `responsesummary`, `timemodified`) VALUES
(11271, 6043, 94, 'deferredfeedback', 20024, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'If E is related to X in the same way as B is related to T, based on the given arrangement. Who among the following is related to D, following the same pattern ?\n\n: U\n; V\n; W\n; Y\n; None of these\n\n', 'U\n', NULL, 1632611921),
(11272, 6043, 95, 'deferredfeedback', 20025, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Who sits at extreme ends of the row ?\n\n: V, T\n\n; B, D\n\n; V, W\n\n; E, A\n\n; None of these\n\n', 'E, A\n\n', NULL, 1632611921),
(11273, 6043, 96, 'deferredfeedback', 20026, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following statements is true about C ?\n\n: Y sits opposite C.\n\n; U is not neighbour of the person who sits opposite C\n\n; F is not adjacent to C\n\n; C sits second from the right end.\n\n; T sits opposite that the person who sits third to the left of C.\n\n', 'Y sits opposite C.\n\n', NULL, 1632611921),
(11274, 6043, 97, 'deferredfeedback', 20027, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 97-100) : STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\n In a certain code language ‘net income from operations’ is written as ‘P81 S84 Q85 K82’, ‘net profit from ordinary activities’ is written as ‘Q85 S72 T91 P81 R87’, ‘the ordinary income’ is written as ‘K82 N75 S72’ and ‘net profit for the period’ is written as ‘L77 N75 M93 R87 P81’.\n\nWhat does ‘M93’ stands ?\n\n: for\n\n; profit\n\n; period\n\n; Can’t be determined\n\n; None of these\n\n', 'Can’t be determined\n\n', NULL, 1632611921),
(11275, 6043, 98, 'deferredfeedback', 20028, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following is the code for ‘operation’ ?\n\n: Q85\n\n; S84\n\n; K82\n\n; Can’t be determined\n\n; None of these\n\n', 'S84\n\n', NULL, 1632611921),
(11276, 6043, 99, 'deferredfeedback', 20029, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following represent the code for ‘profit from activities’ ?\n\n: R87 Q85 T91\n\n; C77 Q85 R87\n\n; R85 Q87 T91\n\n; R87 Q87 T91\n\n; None of these\n\n', 'R87 Q85 T91\n\n', NULL, 1632611921),
(11277, 6043, 100, 'deferredfeedback', 20030, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following may be the code for ‘income tax’ ?\n\n: K82 Q85\n\n; K82 R87\n\n; K82 H52\n\n; K82 L77\n\n; None of these\n\n', 'K82 H52\n\n', NULL, 1632611921),
(11278, 6044, 1, 'deferredfeedback', 20035, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'If the length of a rectangle is increased by 230%, its area becomes 828 sq cm and perimeter 162 cm. What is the perimeter of the original rectangle?\n\n: 84 cm\n\n; 120 cm\n\n; 76 cm\n\n; None of these\n\n; 114 cm\n\n', '84 cm\n\n', NULL, 1632732686),
(11279, 6045, 1, 'deferredfeedback', 20046, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What is the rate of simple interest on which a man took a loan from the bank?\n\n I. The man took a loan of Rs.5000 for five years from the bank.\n\nII. The man returned Rs.6700 to the bank at the end of two years and settled the loan.\n\n: If the data even in both the statements (I) and (II) together are not sufficient to answer the question.\n\n; If the data in statement (II) alone is sufficient to answer the question while the data in statement (I) alone is not sufficient.\n\n; If the data in both the statements (I) and (II) together are necessary to answer the question.\n\n; If the data either in statement (I) alone or in statement (II) alone is sufficient to answer the question.\n\n; If the data in statement (I) alone is sufficient to answer the question, while the data in statement (II) alone is not sufficient.\n\n', 'If the data in both the statements (I) and (II) together are necessary to answer the question.\n\n', NULL, 1632738281),
(11280, 6046, 1, 'deferredfeedback', 20047, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'A rectangular floor is to be carpeted. What will be the cost of carpeting the floor?\n\n I. The perimeter of the floor is 160 metres.\n\n II. The cost of carpeting per square metre is Rs 16.\n\n: If the data in statement (II) alone is sufficient to answer the question while the data in statement (I) alone is not sufficient.\n\n; If the data in both the statements (I) and (II) together are necessary to answer the question.\n\n; If the data even in both the statements (I) and (II) together are not sufficient to answer the question.\n\n; If the data either in statement (I) alone or in statement (II) alone is sufficient to answer the question\n\n; If the data in statement (I) alone is sufficient to answer the question, while the data in statement (II) alone is not sufficient.\n\n', 'If the data even in both the statements (I) and (II) together are not sufficient to answer the question.\n\n', NULL, 1632738460),
(11281, 6047, 1, 'deferredfeedback', 20049, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'A car travels from P to Q in 33 hours. If the speed is reduced by 10 kmh–1 it will cover the same distance in 55 hours. What is the distance between P and Q?\n\n: 875 km\n\n; 825 km\n\n; 850 km\n\n; 800 km\n\n; 775 km\n\n', '825 km\n\n', NULL, 1632738779),
(11282, 6048, 1, 'deferredfeedback', 20055, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following is the code for ‘poor team did seniors’?\n\n:  cha me pho la\n\n; pho me la pic\n\n; su la fa pic\n\n; la pic dic pa\n\n; None of these\n\n', 'pho me la pic\n\n', NULL, 1632739279),
(11283, 6049, 1, 'deferredfeedback', 20064, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTION (1-4): STUDY THE FOLLOWING INFORMATION TO ANSWER THE GIVEN QUESTIONS:\n\nTwelve persons are sitting around two circular table as one is inscribed in another one. All of them are facing towards the center.\n\nA, B, C, D, E, F six persons are sitting around the inner circular table. \n\nP, Q, R, S, T, U six persons are sitting around the outer circular table. \n\nNote- The persons of outer circular table are sitting exactly behind the persons sitting around the inner circular table.\n\nB is sitting second to the right of E. R is an immediate neighbour of the one who is sitting behind B. Only one person sits between A and F (either from the left or from the right). A is not an immediate neighbour of B. P is sitting behind F. Only two persons sit between R and T (either from the left or from the right). U is an immediate neighbour of P. D is an immediate neighbour of A. T is not sitting behind D. Q is not an immediate neighbour of R.\n\nWho among the following person is sitting third to the left of A?\n\n: F\n; E\n; D\n; B\n; None of these\n\n', 'B\n', NULL, 1632741547),
(11284, 6050, 1, 'deferredfeedback', 20067, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'How many persons are sitting between S and P in the outer circle?\n\n: Two\n; None\n; More than three\n\n; One\n; Three\n\n', 'Two\n', NULL, 1632741730),
(11285, 6051, 1, 'deferredfeedback', 20069, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Four of the following are alike in a certain way so form a group which of the following does not belong to the group?\n\n: E, T\n\n; C, R\n\n; A, P\n\n; B, U\n\n; D, S\n\n', 'A, P\n\n', NULL, 1632741844),
(11286, 6052, 1, 'deferredfeedback', 20070, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Who among the following person is sitting immediate right of S?\n\n: T\n; R\n; U\n; P\n; Q\n', 'Q\n', NULL, 1632741947),
(11287, 6053, 1, 'deferredfeedback', 20072, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Six persons A, B, C, D, E and F lives on 6 different floors of a same building. Bottommost floor is first, the floor above it is second and so on till topmost floor which is sixth. A lives on odd numbered floor. C lives immediately below A. Two floors gap between floors of C and F. D lives immediately above F. B lives above E, who lives below F. How many persons live below E?\n\n: One\n; Three\n\n; None\n\n; Two\n; Four\n', 'None\n\n', NULL, 1632742081),
(11288, 6054, 1, 'deferredfeedback', 20067, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'How many persons are sitting between S and P in the outer circle?\n\n: Two\n; One\n; More than three\n\n; None\n; Three\n\n', 'Two\n', NULL, 1632742464),
(11289, 6055, 1, 'deferredfeedback', 20068, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Statements: Only a few brush is wallet. All brush is money. Some money is enamel.: Some money is not brush\n\n; Some enamel is not money\n\n; All brush can be wallet.\n\n; All wallet can be brush.\n\n; Some enamel is wallet\n\n', 'All wallet can be brush.\n\n', NULL, 1632742520),
(11290, 6056, 1, 'deferredfeedback', 20076, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTION (1-4): STUDY THE FOLLOWING INFORMATION TO ANSWER THE GIVEN QUESTIONS:\n\nTwelve persons are sitting around two circular table as one is inscribed in another one. All of them are facing towards the center.\n\nA, B, C, D, E, F six persons are sitting around the inner circular table. \n\nP, Q, R, S, T, U six persons are sitting around the outer circular table. \n\nNote- The persons of outer circular table are sitting exactly behind the persons sitting around the inner circular table.\n\nB is sitting second to the right of E. R is an immediate neighbour of the one who is sitting behind B. Only one person sits between A and F (either from the left or from the right). A is not an immediate neighbour of B. P is sitting behind F. Only two persons sit between R and T (either from the left or from the right). U is an immediate neighbour of P. D is an immediate neighbour of A. T is not sitting behind D. Q is not an immediate neighbour of R.\n\nWho among the following person is sitting third to the left of A?\n\n: F\n; E\n; D\n; B\n; None of these\n\n', 'B\n', NULL, 1632742953),
(11291, 6057, 1, 'deferredfeedback', 20079, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Who among the following person is sitting immediate right of S?\n\n: T\n; U\n; P\n; Q\n; R\n', 'Q\n', NULL, 1632743390),
(11292, 6058, 1, 'deferredfeedback', 20081, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Seven letters are arranged in a linear arrangement to form a meaningful word. A is second to the left of I. L is to the left of N. Not more than two letters are placed between I and G. G is placed to the right of I. G is not neighbor of E and D. D and E are placed next to each other. Which letter is placed in exactly middle of the meaningful word so formed. If more than one word is formed mark your option as X?\n\n: E\n; N\n; X\n; L\n; G\n', 'X\n', NULL, 1632743625),
(11293, 6059, 1, 'deferredfeedback', 20084, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Which of the following element will be 3rd to the left of 7th from the left end in step III?\n\n: 34\n; 37\n; 25\n; 35\n; None of these\n\n', '35\n', NULL, 1632744446),
(11294, 6060, 1, 'deferredfeedback', 20085, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Direction (10-10): In the following question a statement is given followed by two more statements numbered as I and II. You have to read both the statement and decide which of them strength which of them strengthens or weakens the statement.\n\nThe company A used to outsource its recruitment process for some years but this year the company has decided to conduct the recruitment process within the Organisation.\n\nI. The employees who have been working in the Organisation are aware of that hard work is required to work in the company. \n\nII. The company has decided to appoint three new persons in its senior level authority for the smooth recruitment process.\n\n: Both I and II weakens.\n\n; I strengthen while II weakens\n\n; Both I and II strengthens\n\n; Statement I and Statement II is neutral.\n\n; II strengthens while I is neutral\n\n', 'II strengthens while I is neutral\n\n', NULL, 1632744755),
(11295, 6061, 1, 'deferredfeedback', 20085, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTION (10-10): IN THE FOLLOWING QUESTION A STATEMENT IS GIVEN FOLLOWED BY TWO MORE STATEMENTS NUMBERED AS I AND II. YOU HAVE TO READ BOTH THE STATEMENT AND DECIDE WHICH OF THEM STRENGTH WHICH OF THEM STRENGTHENS OR WEAKENS THE STATEMENT.\n\nThe company A used to outsource its recruitment process for some years but this year the company has decided to conduct the recruitment process within the Organisation.\n\nI. The employees who have been working in the Organisation are aware of that hard work is required to work in the company. \n\nII. The company has decided to appoint three new persons in its senior level authority for the smooth recruitment process.\n\n: Both I and II weakens.\n\n; I strengthen while II weakens\n\n; Both I and II strengthens\n\n; II strengthens while I is neutral\n\n; Statement I and Statement II is neutral.\n\n', 'II strengthens while I is neutral\n\n', NULL, 1632744783),
(11296, 6062, 1, 'deferredfeedback', 20086, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Directions (11-14): Study the following information carefully and answer the questions given below:\n\nSix boxes P, Q, R, S, T and U are placed in a stack one above other. Each contains different number of chocolates viz. 250, 190, 119, 175, 280 and 210. \n\nBox P is placed immediately above box R. Three boxes placed between R and the box which contains 250 chocolates. Box which have 175 chocolates is just above the box which have 250 chocolates. One box placed between box T and the box which have 175 chocolates. U contains 210 chocolates. The box which contain 119 chocolates is placed below box U. Three boxes placed between box S and the box which have 119 chocolates. One box is placed between box Q and the box which have 190 chocolates.\n\nWhich box contains 210 chocolates?\n\n: Q\n; U\n; P\n; R\n; S\n', 'U\n', NULL, 1632744929),
(11297, 6063, 1, 'deferredfeedback', 20087, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Which box is placed at topmost position?\n\n: Q\n; S\n; P\n; U\n; R\n', 'Q\n', NULL, 1632745032),
(11298, 6064, 1, 'deferredfeedback', 20088, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Box R and T together contains how many chocolates?\n\n: 309\n\n; 399\n\n; 400\n; 294\n\n; 369\n\n', '309\n\n', NULL, 1632745133),
(11299, 6065, 1, 'deferredfeedback', 20092, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Directions (15-17): In each of the questions below are given some statements followed by some conclusions. You have to take the given statements to be true even if they seem to be at variance with commonly known facts. Read all the conclusions and then decide which of the given conclusions logically follows from the given statements, disregarding commonly known facts. Give answer\n\nStatements: \n\n    Some tube are bulb. \n\n    All light are tube. \n\n    All current are light. \n\nConclusions: \n\n    I. Some Current are bulb \n\n    II. Some light being bulb is a possibility. \n\n    III. Some tube are not current.\n\n: Both I and III follows\n\n; either I or II follows\n\n; Only II follows\n\n; None follows\n\n; None follows\n\n', 'Only II follows\n\n', NULL, 1632745579),
(11300, 6066, 1, 'deferredfeedback', 20092, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTIONS (15-17): IN EACH OF THE QUESTIONS BELOW ARE GIVEN SOME STATEMENTS FOLLOWED BY SOME CONCLUSIONS. YOU HAVE TO TAKE THE GIVEN STATEMENTS TO BE TRUE EVEN IF THEY SEEM TO BE AT VARIANCE WITH COMMONLY KNOWN FACTS. READ ALL THE CONCLUSIONS AND THEN DECIDE WHICH OF THE GIVEN CONCLUSIONS LOGICALLY FOLLOWS FROM THE GIVEN STATEMENTS, DISREGARDING COMMONLY KNOWN FACTS. GIVE ANSWER\n\nStatements: \n\n    Some tube are bulb. \n\n    All light are tube. \n\n    All current are light. \n\nConclusions: \n\n    I. Some Current are bulb \n\n    II. Some light being bulb is a possibility. \n\n    III. Some tube are not current.\n\n: Both I and III follows\n\n; either I or II follows\n\n; Only II follows\n\n; None follows\n\n; None follows\n\n', 'Only II follows\n\n', NULL, 1632745652),
(11301, 6067, 1, 'deferredfeedback', 20076, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTION (1-4): STUDY THE FOLLOWING INFORMATION TO ANSWER THE GIVEN QUESTIONS:\n\nTwelve persons are sitting around two circular table as one is inscribed in another one. All of them are facing towards the center.\n\nA, B, C, D, E, F six persons are sitting around the inner circular table. \n\nP, Q, R, S, T, U six persons are sitting around the outer circular table. \n\nNote- The persons of outer circular table are sitting exactly behind the persons sitting around the inner circular table.\n\nB is sitting second to the right of E. R is an immediate neighbour of the one who is sitting behind B. Only one person sits between A and F (either from the left or from the right). A is not an immediate neighbour of B. P is sitting behind F. Only two persons sit between R and T (either from the left or from the right). U is an immediate neighbour of P. D is an immediate neighbour of A. T is not sitting behind D. Q is not an immediate neighbour of R.\n\nWho among the following person is sitting third to the left of A?\n\n: F\n; E\n; D\n; B\n; None of these\n\n', 'B\n', NULL, 1632745776),
(11302, 6068, 1, 'deferredfeedback', 20095, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Statements: \n\n   Some file are copy. \n\n   Some copy are eraser. \n\n   No Pen is file. \n\nConclusions:\n\n    I. Some file are eraser \n\n   II. All pen can never be copy. \n\n   III. No file is eraser\n\n: Only I follow\n\n; Only II follows\n\n; Only III follows\n\n; Either I or III follows\n\n; None of the above\n\n', 'Either I or III follows\n\n', NULL, 1632745880),
