(11328, 6094, 1, 'deferredfeedback', 20130, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Statement:- The Union health ministry has made Aadhaar a compulsory document for tuberculosis patients to be able to avail treatment under the government\'s Revised National Tuberculosis Control Programme (RNTCP). \n\n(I) A person cannot take treatment of TB without Aadhar card. \n\n(II) Patients suffering from TB will be unable to get benefits under a central government scheme till they produce their Aadhaar card. \n\n(III) An individual eligible to receive the benefit under the scheme, is hereby, required to furnish proof of possession of Aadhaar number or undergo Aadhaar authentication. \n\n(IV) The World Health Organisation (WHO) recently said that tuberculosis epidemic in India was \"larger\" than what had been previously estimated. Which of the following could be the inference of the given statement?\n\n: Only II\n\n; Only I and III\n\n; Only II and III\n\n; Only I\n\n; None of these\n\n', 'Only II and III\n\n', NULL, 1632809630),
(11329, 6095, 1, 'deferredfeedback', 20131, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Statement- The Captain Amarinder Singh-led government in Punjab has announced free education for girls in government schools and colleges from Nursery to PhD. \n\n (I) Good social welfare law. It is initially for girls as they are comparatively disadvantaged. Hopefully it will soon be followed by free education for everyone. \n\n(II) It is gender biased as if a poor or average person wants to educate his son for higher education he has to pay higher bills .If you are introducing a law / scheme / bills under no circumstance it should not favour any particular gender, if they are really concerned about education. \n\n(III) Do not differentiate a poor or average person on gender. A poor boy or man should also get free education as well.\n\nWhich of the following argument holds strong for the given statement?\n\n: Only II\n\n; Only III\n\n; Only II and III\n\n; Only I and II\n\n; All of the above\n\n', 'Only II and III\n\n', NULL, 1632809811),
(11330, 6096, 1, 'deferredfeedback', 20131, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Statement- The Captain Amarinder Singh-led government in Punjab has announced free education for girls in government schools and colleges from Nursery to PhD. \n\n (I) Good social welfare law. It is initially for girls as they are comparatively disadvantaged. Hopefully it will soon be followed by free education for everyone. \n\n(II) It is gender biased as if a poor or average person wants to educate his son for higher education he has to pay higher bills .If you are introducing a law / scheme / bills under no circumstance it should not favour any particular gender, if they are really concerned about education. \n\n(III) Do not differentiate a poor or average person on gender. A poor boy or man should also get free education as well.\n\nWhich of the following argument holds strong for the given statement?\n\n: Only II\n\n; Only III\n\n; Only II and III\n\n; Only I and II\n\n; All of the above\n\n', 'Only II and III\n\n', NULL, 1632809811),
