(11414, 6101, 80, 'deferredfeedback', 19369, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 80-84): THE FOLLOWING QUESTIONS CONSIST OF A SINGLE SENTENCE WITH ONE BLANK ONLY. YOU ARE GIVEN SIX WORDS DENOTED BY A, B, C, D, E AND F AS ANSWER CHOICES AND FROM THE SIX CHOICES YOU HAVE TO PICK TWO CORRECT ANSWERS, EITHER OF WHICH WILL MAKE THE SENTENCE MEANINGFUL COMPLETE.\n\n________ the Washington Post corrected the story to say that the comments on the article first appeared in Caravan.\n\n(A) Subsequently     (B) Previously       (C) Later           (D) When         (E) After      (F) Now\n\n: (A) and (F)\n\n; (A) and (C)\n\n; (B) and (C)\n\n; (E) and (F)\n\n; (B) and (D)\n\n', '(A) and (C)\n\n', NULL, 1632813659),
