(11435, 6102, 1, 'deferredfeedback', 19736, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Directions (1 - 10) : Read the following passage carefully and answer the questions given below it. Certain words have been printed in bold to help you locate them while answering some of the questions.\n\nThinking of what education might look like in the next decade, one quickly realizes that the trends in technology are leaving a large number of our students behind. Today is an age of exponential change. New and ever-improving technologies are popping up every day and in every corner of society.\n\nEducating the best and the brightest in this brave new world will take a new and improved educational paradigm. Allowing our educational tools to age in the corner of the classroom will be the mistake that may cost us our future. Throwing away masses of children to inequitable access will ensure that we languish at the bottom of the global pool of employable workers for decades to come.\n\nTechnology will shape the way we educate students in the next decade. A user is not simply a person who uses. For the student. being a user should involve using the latest technology in a free and autonomous manner. This new-found freedom will allow the student to become an active participant in his / her education instead of a passive passenger. In our current technological society, being a user also means being tracked. Tracking a student means having the ability to target education towards weaknesses and strengths. The ability to accurately customize curricula to the individual has been the holy grail of educational philosophy for many years. This golden age of technological development may soon enable this dream to become a reality.\n\nCurrent educational curricula and individual assessment is arbitrary at best. Accurately assessing a student can only be achieved by using modern tracking and database technologies. Imagine a world where every child has a tablet computer with ready access to the internet. Further, imagine that every student can access all the knowledge of humankind freely at any moment in time. Continue to imagine a world where a misspelled word brings up a spelling challenge application instead of an auto correction. Try to contemplate what it would mean for a teacher to have a database of every misspelled word, every misunderstood concept or every missed, equation for each of their students. Try to envision a teacher with the ability to customize the experience of the individual “user” with minimal effort. Imagine the curriculum being automatically targeted to user through an intuitive educational platform that knows all strengths and each unique weakness. In the last few hundred years, most individuals would consider an education as something you receive. You often hear the question asked, “Where did you receive your education?” As we proceed through the next decade, education will slowly move away from reception and toward being custom designed for the individual user. New technology will not only . allow us to receive an education, but also develop an education. The question we might ask in ten years, How did you develop your education? The question of where will still be important, but the how of the matter will be the focus that defines the individual.\n\nTo make this a reality we will need a standardized platform from which to develop a student’s unique education. This standardized platform will allow us to tailor a custom curriculum that will be matched to talents,. interests and life goals. For the educator, a standardized platform will create a way to assist the student in discovering a true purpose in life through a unique educational experience. The basics of reading, writing and arithmetic will not be taught as much as they will be discovered and used. Learning will become a reciprocal experience between the teacher, the student and the machine.\n\nUnder a standardized platform, each of these three participants will have a role to play. The teacher will be the facilitator, assisting the development of the curriculum and inspiring the direction the student takes. The student will be the user, gathering re- sources, skills and knowledge in an efficient and measured sequence. The machine will do the work of data gathering and analysis, which will assist the teacher and student in refining the curriculum. This data gathering work of the machine will also free the teacher from the burden of record-keeping and tedious tasks that currently distract from the real job of teaching and learning. Under a standardized system, grade level will be far less important. Achievement and progression will be measured by accomplishment and intelligence as a benchmark for success. The question of failure or success will be irrelevant and replaced with a standard and consistent measurement of potential and overall intelligence. lnformation will no longer be missed but continually rehearsed and monitored for retention by the machine. Tasks such as data tracking, reporting and record keeping are currently accomplished manually. These tasks could easily be delegated to an intuitive database. Developing a standard to follow would eliminate these tasks and free the teacher to do their main job of teaching students.\n\nThe next decade may mark the moment in history when all are granted equal access to technology. Access to quality education will only be gained through investment and universal standardization of this technology. If we continue to divert wealth towards fruitless goals and corporate greed, this opportunity will be lost or hopelessly delayed.\n\nQ. According to the author, which of the following will be the benefit(s) of introducing a standardized technological platform? \n\n(A) Potential of a child will take precedence over the grades he/ she scores. \n\n(B) Improving the educational syllabus would become easier. \n\n(C) Teachers would be able to devote more time to teaching\n: Only (C)\n\n; All (A), (B) and (C)\n\n; Only (B) and (C)\n\n; Only (A) and (B)\n\n; Only (A)\n\n', 'All (A), (B) and (C)\n\n', 'Only (B) and (C)\n\n', 1632814639),
(11436, 6102, 2, 'deferredfeedback', 19737, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Which of the following is / are true in the context of the passage ? \n\n(A) In the presence of technology each student would require constant monitoring by other individuals to maximize learning. \n\n(B) Educational philosophy is based on the belief of tailoring educational syllabus to individual student capability. \n\n(C) The author visualizes that each student will have access to technology in the future. \n\n: Only (A) and (B)\n\n; Only (B)\n\n; Only (C)\n\n; Only (B) and (C)\n\n; All (A), (B) and (C)\n\n', 'Only (B) and (C)\n\n', 'Only (C)\n\n', 1632814639),
(11437, 6102, 3, 'deferredfeedback', 19738, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Which of the following is possibly the most appropriate title for the passage ?\n\n: Technology - A Welcome Relief to Teachers\n\n; Revamping the Educational Sector - An Impossible Future\n\n; Education - Arbitrary But a Reality\n\n; Technology and the Economy\n\n; Technology - Reshaping the Future of Education\n\n', 'Technology - Reshaping the Future of Education\n\n', 'Revamping the Educational Sector - An Impossible Future\n\n', 1632814639),
(11438, 6102, 4, 'deferredfeedback', 19743, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What does the author mean by the term “tracking a student” ?\n\n: Analyzing the strengths and weaknesses of a student and designing an educational syllabus accordingly\n\n; Assessing whether a student is paying due attention to the existing curriculum offered by an institute of learning\n\n; Following a student to the educational institute that he visits frequently in order to estimate the time he spends there\n\n; Analyzing the positives and negatives of an educational institute and modifying it suitably to cater to industrial requirements\n\n; None of these\n\n', 'Analyzing the strengths and weaknesses of a student and designing an educational syllabus accordingly\n\n', 'None of these\n\n', 1632814639),
(11439, 6102, 5, 'deferredfeedback', 19744, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'According to the author, why is the current education provided not satisfactory ?\n\n: The teachers providing education are not qualified enough to emphasize on quality\n\n; Quality of education provided is not uniform across the globe and individual assessment is subjective\n\n; The educational sector is fraught with corrupt practices and thus does not produce the desired result\n\n; The education system is not guided by technology and hence the pace of learning is slow\n\n; There are too many schools in the country which cannot be monitored effectively\n\n', 'The education system is not guided by technology and hence the pace of learning is slow\n\n', 'The educational sector is fraught with corrupt practices and thus does not produce the desired result\n\n', 1632814639),
(11440, 6102, 6, 'deferredfeedback', 19745, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What is the author’s vision regarding the integration of technology with education ? \n\n(A) A substantial database consisting of each student’s learning curve would be readily available. \n\n(B) An error would activate a software which would encourage learning rather than auto-correcting. \n\n(C) Experimentation in academics would be encouraged.\n\n: Only (C)\n\n; Only (A) and (B)\n\n; All (A). (B) and (C)\n\n; Only (A) and (C)\n\n; None of these\n\n', 'All (A). (B) and (C)\n\n', 'All (A). (B) and (C)\n\n', 1632814639),
