(11445, 6102, 11, 'deferredfeedback', 19750, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Directions (11-15) : Which of the phrases (1), (2), (3) and (4) given below each sentence should replace the phrase given in bold in the following sentence to make the sentence grammatically meaningful and correct. If the sentence is correct as it is and ‘No correction is required, mark (5) as the answer. \n\nQ. After enjoying one of the biggest successes of Indian cinema, the actor is pulled the brakes on his career.\n\n: brakes on his career.\n\n; has pulled the brakes\n\n; is put braking\n\n; is put brakes\n\n; No correction required\n\n', 'has pulled the brakes\n\n', 'brakes on his career.\n\n', 1632814639),
