(11480, 6102, 46, 'deferredfeedback', 19830, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Twenty per cent of Anuj’s annual salary is equal to seventy five per cent of Raj’s annual salary. Raj‘s monthly salary is 60% of Ravi’s monthly salary. If Ravi‘s annual salary is Rs. 1.44 lacs, what is Anuj’s monthly salary ?\n\n: Rs. 2,70,000\n\n; Rs. 27,000\n\n; Rs. 3,24,000\n\n; Rs. 5,400\n\n; None of these\n\n', 'Rs. 27,000\n\n', 'Rs. 27,000\n\n', 1632814639),
(11481, 6102, 47, 'deferredfeedback', 19831, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Ram’s present age is three times his son’s present age and two- fifth of his father‘s present age. The average of the present ages of all of them is 46 years. What is the difference between the Ram’s son’s present age and Ram’s father‘s present age ?\n\n: 68 years\n\n; 88 years\n\n; 58 years\n\n; Cannot be determined\n\n; None of these\n\n', 'None of these\n\n', '68 years\n\n', 1632814639),
(11482, 6102, 48, 'deferredfeedback', 19832, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'The ratio between the speed of a train and a car is 16 : 15 respectively. Also, a bus covered a distance of 480 kms. in 8 hours. The speed of the bus is three-fourth the speed of the train. How much distance will the car cover in 6 hours ?\n\n: 450km\n\n; 480km\n\n; 360 km\n\n; Cannot be determined\n\n; None of these\n\n', '450km\n\n', 'Cannot be determined\n\n', 1632814639),
