(11600, 6103, 66, 'deferredfeedback', 19312, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'DIRECTIONS (Q. 66-70): IN THE FOLLOWING QUESTIONS, THE SYMBOLS \\( \\DELTA \\), %, H, $ AND © ARE USED WITH THE FOLLOWING MEANINGS AS ILLUSTRATED BELOW:\n\n: if only conclusion I is true.\n\n; if only conclusion II is true.\n\n; if either conclusion I or II is true.\n\n; if neither conclusion I nor II is true.\n\n; if both conclusions I and II are true.\n\n', 'if only conclusion II is true.\n\n', NULL, 1632814712),
(11601, 6103, 67, 'deferredfeedback', 19319, 1, '1.2500000', '-0.2500000', '1.0000000', 0, ': if only conclusion I is true\n\n; if only conclusion II is true.\n\n; if either conclusion I or II is true.\n\n; if neither conclusion I nor II is true.\n\n; if both conclusions I and II are true.\n\n', 'if only conclusion I is true\n\n', NULL, 1632814712),
