(11644, 6113, 1, 'deferredfeedback', 20182, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'DIRECTION (Q. 87): READ THE FOLLOWING INFORMATION AND SENTENCES A), B), C), D) AND E) GIVEN BELOW IT CAREFULLY AND ANSWER THE QUESTIONS WHICH FOLLOW:\n\n The fifth conference of labour ministers of Non-Aligned and other developing countries, which concluded in New Delhi on December 23, was not just another conference held under the auspices of International Labour Organisation to discuss labour welfare and social clauses such as employment creation, poverty reduction and eradication, and social integration. Participating nations were represented by their labour ministers. (A) The fourth conference of labour ministers was not held at New Delhi. (B) International Labour Organisation took an active part in a conference of labour ministers. (C) Linking labour standards to international trade would benefit the industrial countries. (D) The last summit did not discuss questions on poverty. (E) The labour minister of India attended the conference.\n\nWhich of the statements (A), (B), (C), (D) and (E) can be inferred from the facts/information given in the passage? (An inference is something which is not directly stated but can be inferred from the given facts.)\n\n: Only (C)\n\n; Only (D)\n\n; Only (B) and (E)\n\n; Only (B)\n\n; Only (A)\n\n', 'Only (B) and (E)\n\n', NULL, 1632820615),
