(11693, 6117, 46, 'deferredfeedback', 19830, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Twenty per cent of Anuj’s annual salary is equal to seventy five per cent of Raj’s annual salary. Raj‘s monthly salary is 60% of Ravi’s monthly salary. If Ravi‘s annual salary is Rs. 1.44 lacs, what is Anuj’s monthly salary ?\n\n: Rs. 2,70,000\n\n; Rs. 27,000\n\n; Rs. 3,24,000\n\n; Rs. 5,400\n\n; None of these\n\n', 'Rs. 27,000\n\n', NULL, 1633160584),
(11694, 6117, 47, 'deferredfeedback', 19831, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Ram’s present age is three times his son’s present age and two- fifth of his father‘s present age. The average of the present ages of all of them is 46 years. What is the difference between the Ram’s son’s present age and Ram’s father‘s present age ?\n\n: 68 years\n\n; 88 years\n\n; 58 years\n\n; Cannot be determined\n\n; None of these\n\n', 'None of these\n\n', NULL, 1633160584),
(11695, 6117, 48, 'deferredfeedback', 19832, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'The ratio between the speed of a train and a car is 16 : 15 respectively. Also, a bus covered a distance of 480 kms. in 8 hours. The speed of the bus is three-fourth the speed of the train. How much distance will the car cover in 6 hours ?\n\n: 450km\n\n; 480km\n\n; 360 km\n\n; Cannot be determined\n\n; None of these\n\n', '450km\n\n', NULL, 1633160584),
(11696, 6117, 49, 'deferredfeedback', 19848, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'The total area of a circle and a square is equal to 5450 sq.cm. The diameter of the circle is 70 cms. What is the sum of the circumference of the circle and the perimeter of the square ?\n\n: 360 cm\n\n; 380 cm\n\n; 270 cm\n\n; Cannot be determined\n\n; None of these\n\n', '380 cm\n\n', NULL, 1633160584),
(11697, 6117, 50, 'deferredfeedback', 19850, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'The largest and the second largest angles of a triangle are in the ratio of 3 : 2 respectively. The smallest angle is 20% of the sum of the largest and the second largest angles. What is the sum of the smallest and the second largest angles ?\n\n: 80°\n\n; 60°\n\n; 100°\n\n; 90°\n\n; None of these\n\n', '90°\n\n', NULL, 1633160584),
(11698, 6117, 51, 'deferredfeedback', 19855, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Directions (51 -55) : Study the information carefully to answer the questions that follow.\n\nIn a school there are 1200 students who have visited five different cities viz. Delhi, Kolkata, Varanasi, Mumbai and Jodhpur. Forty five per cent of the total students are boys. Thirty per cent of the total girls visited Mumbai. Two-fifth of the total girls visited Delhi. Number of girls who visited Jodhpur is half of the girls visited Delhi. Two-third of the remaining girls visited Kolkata. Total number of students who visited Mumbai is 300. Twenty per cent of the total boys visited Delhi. Forty per cent of the total boys visited Jodhpur. Equal number of boys visited Kolkata and Varanasi.\n\nQ. What is the total number of girls who visited Delhi, Mumbai and Varanasi together ?\n: 464\n\n; 484\n\n; 536\n\n; 556\n\n; None of these\n\n', '484\n\n', NULL, 1633160584),
(11699, 6117, 52, 'deferredfeedback', 19857, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Total number of students who visited Jodhpur is approximately what per cent of number of girls who visited Delhi ?\n\n: 111\n\n; 91\n\n; 132\n\n; 32\n\n; 72\n\n', '132\n\n', NULL, 1633160584),
(11700, 6117, 53, 'deferredfeedback', 19859, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What is the average number of boys who visited Kolkata, Varanasi and Jodhpur together 7\n\n: 110\n\n; 122\n\n; 101\n\n; 104\n\n; None of these\n\n', '110\n\n', NULL, 1633160584),
(11701, 6117, 54, 'deferredfeedback', 19862, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What is the total number of students who visited Varanasi ?\n\n: 78\n\n; 69\n\n; 102\n\n; 103\n\n; None of these\n\n', 'None of these\n\n', NULL, 1633160584);
