(11702, 6117, 55, 'deferredfeedback', 19865, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What is the respective ratio between the number of girls who visited Kolkata and number of boys who visited Mumbai ?\n\n: 22:51\n\n; 23:51\n\n; 21:55\n\n; 51:22\n\n; None of these\n\n', '22:51\n\n', NULL, 1633160584),
(11703, 6117, 56, 'deferredfeedback', 19870, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Directions (56-60) : Study the following graph carefully to answer the questions that follow.\n\nQ. What was the average number of students in all the Schools together in the year 2006 ?\n: 30,000\n\n; 9,000\n\n; 3,000\n\n; 6,000\n\n; None of these\n\n', '3,000\n\n', NULL, 1633160584),
(11704, 6117, 57, 'deferredfeedback', 19872, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Total number of students in School B and School C together in the year 2004 was approximately what percentage of the total number of students in School B and School C together in the year 2007 ?\n\n: 85\n\n; 80\n\n; 75\n\n; 184\n\n; 131\n\n', '85\n\n', NULL, 1633160584),
(11705, 6117, 58, 'deferredfeedback', 19875, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'How many times the total number of students in all the three Schools A, B and C together was exactly equal among the given years ?\n\n: 2\n; 5\n; 4\n; 3\n; None of these\n\n', '3\n', NULL, 1633160584),
(11706, 6117, 59, 'deferredfeedback', 19879, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What was the approximately average number of students in School A over all the years together ?\n\n: 1990\n\n; 2090\n\n; 2300\n\n; 1800\n\n; 2700\n\n', '2090\n\n', NULL, 1633160584),
(11707, 6117, 60, 'deferredfeedback', 19888, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'What was the difference between the total number of students in all the schools together in the year 2003 and number of students in School B in the year 2005?\n\n: 2000\n\n; 3000\n\n; 3500\n\n; 2500\n\n; None of these\n\n', '3500\n\n', NULL, 1633160584),
(11708, 6117, 61, 'deferredfeedback', 19889, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Directions (61- 65) : Study the given information carefully and answer the questions that follow: An urn contains 3 red, 6 blue, 2 green and 4 yellow marbles.\n\n: 2 /15\n\n; 1 /15\n\n; 2 /7\n\n; 1\n; None of these\n\n', 'None of these\n\n', NULL, 1633160584),
(11709, 6117, 62, 'deferredfeedback', 19891, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'If three marbles are picked at random, what is the probability that two are blue and one is yellow ?\n\n: 2 /15\n\n; 6 /91\n\n; 12/ 91\n\n; 3 /15\n\n; None of these\n\n', '12/ 91\n\n', NULL, 1633160584),
(11710, 6117, 63, 'deferredfeedback', 19894, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'lf four marbles are picked at random, what is the probability that at least one is yellow ?\n\n: 91/ 123\n\n; 69/ 91\n\n; 125 /143\n\n; 1 /4\n\n; None of these\n\n', '69/ 91\n\n', NULL, 1633160584),
(11711, 6117, 64, 'deferredfeedback', 19898, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'lf two marbles are picked at random, what is the probability that either both are red or both are green?\n\n: 3 /5\n\n; 4/ 105\n\n; 2/ 7\n\n; 5/ 91\n\n; None of these\n\n', '4/ 105\n\n', NULL, 1633160584),
(11712, 6117, 65, 'deferredfeedback', 19904, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'If four marbles are picked at random, what is the probability that one is green, two are blue and one is red ?\n\n: 4/ 15\n\n; 17/ 280\n\n; 6 /91\n\n; 11 /15\n\n; None of these\n\n', '6 /91\n\n', NULL, 1633160584),
(11713, 6117, 66, 'deferredfeedback', 19907, 1, '1.2500000', '-0.2500000', '1.0000000', 0, '                                                                                                     Reasoning\n\nSushil walked 15 metres towards South, took a left turn and walked 20 metres again he took a left turn and walked 15 metres. How far and in which direction is he from the starting point ?\n\n: 20 metres, West\n\n; 20 metres, East\n\n; 50 metres, West\n\n; 50 metres, East\n\n; Data inadequate\n\n', '20 metres, East\n\n', NULL, 1633160584),
(11714, 6117, 67, 'deferredfeedback', 19910, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'How many such pairs of digits are there in the number 254983 each of which has as many digits/ between them in the number as when the digits are rearranged in descending order within the number ?\n\n: None\n\n; One\n\n; Two; Three\n\n; More than three\n\n', 'More than three\n\n', NULL, 1633160584),
(11715, 6117, 68, 'deferredfeedback', 19916, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'How many such pairs of letters are there in the word CHRONICLE each of which has as many letters between them in the word as in the English alphabet?\n\n: None\n\n; One\n\n; Two\n; Three\n\n; More than three\n\n', 'Three\n\n', NULL, 1633160584),
(11716, 6117, 69, 'deferredfeedback', 19919, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'lf ‘÷‘ means ‘×’: ‘+’ means ‘÷`;` ‘–’ means ‘+’ and ‘×’ means ‘ –’ then 20 – 16 + 4 × 3 ÷ 2 = ?\n\n: 16\n\n; 30\n\n; 18\n\n; 24\n\n; None of these\n\n', '18\n\n', NULL, 1633160584),
(11717, 6117, 70, 'deferredfeedback', 19926, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Pointing to a boy in a photograph Sudhir said “He is the son of my maternal grandfathers only child”. How is the boy related to Sudhir?\n\n: Self\n\n; Brother\n\n; Cousin brother\n\n; Data inadequate; None of these\n\n', 'Data inadequate', NULL, 1633160584),
(11718, 6117, 71, 'deferredfeedback', 19931, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Directions (71 - 75) : In each of the questions below are given four statements followed by four conclusions numbered I, II, III and IV. You have to take the given statements to be true even if they seem to be at variance from commonly known facts. Read all the conclusions and then decide which of the given conclusions logically follows from the given statements disregarding commonly known facts.\n\nStatements: \n\nSome tools are radios. \n\nSome radios are ponds. \n\nSome ponds are mirrors. \n\nAll mirrors are chalks. \n\nConclusions: \n\nI. Some mirrors are tools. \n\nII. Some chalks are ponds. \n\nIII. Some ponds are tools. \n\nIV. Some chalks are radios.\n\n: None follows\n\n; Only I follows\n\n; Only II follows\n\n; Only III follows\n\n; Only IV follows\n\n', 'Only II follows\n\n', NULL, 1633160584),
(11719, 6117, 72, 'deferredfeedback', 19935, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Statements: \n\nAll chairs are sofas. \n\nAll sofas are books. \n\nAll books are nets. \n\nAll nets are gardens. \n\nConclusions: \n\nI. Some nets are sofas. \n\nII. Some gardens are books. \n\nIII. Some nets are chairs. \n\nIV. All books are gardens.\n\n: Only I, II and III follow\n\n; Only I, III and IV follow\n\n; Only II, III and IV follow\n\n; All I, ll, III and IV follow\n\n; None of these\n\n', 'All I, ll, III and IV follow\n\n', NULL, 1633160584),
(11720, 6117, 73, 'deferredfeedback', 19938, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Statements: \n\nAll monkeys are parrots. \n\nNo parrot is crow. \n\nSome crows are horses. \n\nAll horses are tigers. \n\nConclusions : \n\nI. Some tigers are parrots. \n\nII. Some crows are monkeys. \n\nIII. No tiger is parrot. \n\nIV. Some horses are parrots.\n\n: None follows\n\n; Only II follows\n\n; Only III follows\n\n; Only I follows\n\n; Only either I or III follows\n\n', 'Only either I or III follows\n\n', NULL, 1633160584),
(11721, 6117, 74, 'deferredfeedback', 19939, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Statements: \n\nAll houses are rooms. \n\nAll rooms are baskets. \n\nAll baskets are tyres. \n\nSome tyres are lanterns. \n\nConclusions : \n\nI. Some lanterns are rooms. \n\nII. Some tyres are houses. \n\nIII. Some tires are rooms. \n\nIV. All houses are baskets\n\n: Only I, II and III follow\n\n; Only II, III and IV follow\n\n; Only I, III and IV follow\n\n; All I., II, III and IV follow\n\n; None of these\n\n', 'Only II, III and IV follow\n\n', NULL, 1633160584),
(11722, 6117, 75, 'deferredfeedback', 19940, 1, '1.2500000', '-0.2500000', '1.0000000', 0, 'Statements: \n\nSome tractors are buses. \n\nAll buses are trains. \n\nSome trains are boats. \n\nAll boats are ships. \n\nConclusions : \n\nI. Some boats are buses. \n\nII. Some ships are buses. \n\nIII. Some trains are tractors. \n\nIV. Some ships are trains.\n\n: Only l and II follow\n\n; Only I and III follow\n\n; Only I and IV follow\n\n; Only II and IV follow\n\n; None of these\n\n', 'Only l and II follow\n\n', NULL, 1633160584),
