(11791, 6161, 1, 'deferredfeedback', 20321, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'In the question below three phrases are given which must be filled in the positions given in i, ii and iii in the passage. From the options given below, choose the correct order of phrases that should be filled in the positions given. \n\n A. necessary to deter such shady operations \n\nB. sale of shares of private unlisted companies \n\n C. imposed on the wider start-up\n\n: CAB\n\n; BCA\n\n; BAC\n\n; ABC\n\n; ACB\n\n', 'BAC\n\n', NULL, 1632997457),
(11792, 6162, 1, 'deferredfeedback', 20322, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'The sentence given in C has four words given in bold. Amongst given bolded words, which of the followings must replace each other to make the sentence contextually correct and meaningful.\n\n: 1-4\n\n; 3-4\n\n; 2-4\n\n; Both (a) and (b)\n\n; 2-4\n\n', 'Both (a) and (b)\n\n', NULL, 1632997643),
(11793, 6163, 1, 'deferredfeedback', 20326, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'It is (A) imperative that there be course corrections; otherwise the (B)exercise runs the risk of fueling a (C) parallel movement against the state by those being (D)victimised now.\n\n: No interchange is possible\n\n; B-D\n\n; A-D\n\n; A-B\n\n; A-C\n\n', 'No interchange is possible\n\n', NULL, 1632998238),
(11794, 6164, 1, 'deferredfeedback', 20334, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (21-25): In each of the following questions a sentence is given with a word given in BOLD. Corresponding to each question three sentences are given with the use of the same word. From the options choose the sentences which give a DIFFERENT MEANING for the word used in the sentence above. The meaning used in the sentence(s) should be different from the one used in the main sentence.\n\nThe leaders of our ruling dispensation seem to have no respect for the rule of law, nor for the rules that regulate speech in public spaces. \n\n(I) Because the soldier had saved his entire unit, the president gave him dispensation for his wartime crimes. \n\n(II) Scholarship is conveyed to a wider audience than under the old dispensation. \n\n(III) At the close of the Jubilee this dispensation was extended to all who had expired on the way to\n\n Rome.\n\n: Both I and II\n\n; Only I\n\n; Only III\n\n; Both I and III\n\n; Only II\n\n', 'Both I and III\n\n', NULL, 1632998718),
