(11958, 6179, 1, 'deferredfeedback', 20479, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTIONS (10-12): STUDY THE FOLLOWING ALPHANUMERIC SERIES CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW: 12AIFR 42 WBOL 63EOCN 15TVMR 75GYTR .\n\nHow many meaningful words can be formed from the letters of the words which are attached with the numbers in which At least one digit is even digit in the given alphanumeric series?\n\n: More than four\n\n; one\n\n; four\n\n; two\n\n; three\n\n', 'two\n\n', NULL, 1633078593),
(11959, 6180, 1, 'deferredfeedback', 20479, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'DIRECTIONS (10-12): STUDY THE FOLLOWING ALPHANUMERIC SERIES CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\n12AIFR 42 WBOL 63EOCN 15TVMR 75GYTR .\n\nHow many meaningful words can be formed from the letters of the words which are attached with the numbers in which At least one digit is even digit in the given alphanumeric series?\n\n: one\n\n; two\n\n; three\n\n; four\n\n; More than four\n\n', 'two\n\n', NULL, 1633078617),
(11960, 6181, 1, 'deferredfeedback', 20480, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'The words are arranged according to the descending order of the numbers which are attached to them from left to right, then how many alphabets are between the letters of second letter from the left end and seventh letter from the right end?\n\n: three\n\n; one\n\n; four\n\n; two\n\n; More than five\n\n', 'two\n\n', NULL, 1633078692),
