(11965, 6183, 4, 'deferredfeedback', 400, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A retaining wall with measurements 30m × 12m × 6m was constructed with bricks of dimensions 8cm × 6cm × 6cm. If 60% of the wall consists of bricks, the number of bricks used for the construction is       lakhs.\n\n: 30; 40\n; 75\n; 45\n', '45\n', NULL, 1633080695),
(11966, 6183, 5, 'deferredfeedback', 401, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Hima Das was             only Indian athlete to win _    gold for India.\n\n: the, a\n\n; an, a\n\n; the, many\n\n; an, the\n\n', 'the, a\n\n', NULL, 1633080695),
(11967, 6183, 6, 'deferredfeedback', 402, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Mohan, the manager, wants his four workers to work in pairs. No pair should work for more than 5 hours. Ram and John have worked together for 5 hours. Krishna and Amir have worked as a team for 2 hours. Krishna does not want to work with Ram. Whom should Mohan allot to work with John, if he wants all the workers to continue working?\n\n: Ram\n\n; None of the three\n\n; Krishna\n\n; Amir\n\n', 'Krishna\n\n', NULL, 1633080695),
(11968, 6183, 7, 'deferredfeedback', 403, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The Newspaper reports that over 500 hectares of tribal land spread across 28 tribal settlements in Mohinitampuram forest division have already been “alienated”. A top forest official said, “First the tribals are duped out of their land holdings. Second, the families thus rendered landless are often forced to encroach further into the forests”.\nOn the basis of the information available in  the paragraph, ____________is/are responsible for duping the tribals.\n: forest officials\n\n; landless families\n\n; it cannot be inferred who\n\n; The Newspaper\n\n', 'it cannot be inferred who\n\n', NULL, 1633080695),
(11969, 6183, 8, 'deferredfeedback', 404, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An oil tank can be filled by pipe X in 5 hours and pipe Y in 4 hours, each pump working  on its own. When the oil tank is full and the drainage hole is open, the oil is drained in 20 hours. If initially the tank was empty and someone started the two pumps together but left the drainage hole open, how many hours will it take for the tank to be filled? (Assume that the rate of drainage is independent of the Head)\n\n: 4.00\n\n; 1.50\n\n; 2.00\n\n; 2.50\n\n', '2.50\n\n', NULL, 1633080695),
(11970, 6183, 9, 'deferredfeedback', 406, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A steel column is restrained against both translation and rotation at one end and is restrained only against rotation but free to translate at the other end.  Theoretical  and  design  (IS:800- 2007) values, respectively, of effective length factor of the column are\n\n: 1.2 and 1.2\n\n; 1.0 and 1.0\n\n; 1.0 and 1.2\n\n; 1.2 and 1.0\n\n', '1.0 and 1.2\n\n', NULL, 1633080695),
(11971, 6183, 10, 'deferredfeedback', 407, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If the fineness modulus of a sample of fine aggregates is 4.3, the mean size of the particles in the sample is between\n\n: 300 _mm _and 600 _mm_\n\n; 2.36 _mm _and 4.75 _mm_\n\n; 1.18 _mm _and 2.36 _mm_\n\n; 150 _mm _and 300 _mm_\n\n', '1.18 _mm _and 2.36 _mm_\n\n', NULL, 1633080695),
(11972, 6183, 11, 'deferredfeedback', 408, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which one of the following options contains ONLY primary air pollutants?: Hydrocarbons and nitrogen oxides\n\n; Ozone and peroxyacetyl nitrate\n\n; Hydrocarbons and ozone\n\n; Nitrogen oxides and peroxyacetyl nitrate\n\n', 'Hydrocarbons and nitrogen oxides\n\n', NULL, 1633080695),
(11973, 6183, 12, 'deferredfeedback', 409, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Structural failures considered in the mechanistic method of bituminous pavement design are\n\n: Fatigue and Shear\n\n; Shear and Slippage\n\n; Rutting and Shear\n\n; Fatigue and Rutting\n\n', 'Fatigue and Rutting\n\n', NULL, 1633080695),
(11974, 6183, 13, 'deferredfeedback', 410, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An inflow hydrograph is routed through a reservoir to produce an outflow hydrograph. The peak flow of the inflow hydrograph is _P__I _and the time of occurrence of the peak is _t__I_. The peak flow of the outflow hydrograph is _P__O _and the time of occurrence of the peak is _t__O_. Which one of the following statements is correct?\n\n: _PI _< _P__O _and _t__I _> _t__O_\n\n; _PI _> _P__O _and _t__I _> _t__O_; _PI _> _P__O _and _t__I _< _t__O_\n\n; _PI _< _P__O _and _t__I _< _t__O_\n\n', '_PI _> _P__O _and _t__I _< _t__O_\n\n', NULL, 1633080695),
(11975, 6183, 14, 'deferredfeedback', 411, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The notation “SC” as per _Indian Standard Soil Classification System _refers to\n\n: Clayey silt\n\n; Clayey sand\n\n; Silty clay\n\n; Sandy clay\n\n', 'Clayey sand\n\n', NULL, 1633080695),
(11976, 6183, 15, 'deferredfeedback', 412, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The value of the function _f(x) _is given at _n _distinct values of _x _and its value is to be interpolated at the point _x*_, using all the _n _points. The estimate is obtained first by the Lagrange polynomial, denoted by _I__L_, and then by the Newton polynomial, denoted by _I__N_. Which one of the following statements is correct?\n\n: _IL _and _I__N _are always equal\n\n; No definite relation exists between _I__L _and _I__N_\n\n; _IL _is always greater than _I__N_\n\n; _IL _is always less than _I__N_\n\n', '_IL _and _I__N _are always equal\n\n', NULL, 1633080695),
(11977, 6183, 16, 'deferredfeedback', 413, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Construction of a new building founded on a clayey soil was completed in January 2010. In January 2014, the average consolidation settlement of the foundation in clay was recorded as 10 _mm_. The ultimate consolidation settlement was estimated in design as 40 _mm_. Considering double drainage to occur at the clayey soil site, the expected consolidation\nsettlement in January 2019 (in _mm, round off to the nearest integer_) will be             \n', '15to15', NULL, 1633080695),
(11978, 6183, 17, 'deferredfeedback', 414, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The command area of a canal grows only one crop, i.e., wheat. The base period of wheat is 120 days and its total water requirement, _Δ_, is 40 _cm_. If the canal discharge is 2 _m3/s_, the area, in _hectares_, rounded off to the nearest integer, which could be irrigated (_neglecting all __losses_) is         \n', '5180 to 5190', NULL, 1633080695),
(11979, 6183, 18, 'deferredfeedback', 415, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A vehicle is moving on a road of grade +4_% _at a speed of 20 _m/s_. Consider the coefficient of rolling friction as 0.46 and acceleration due to gravity as 10 _m/s2_. On applying brakes to reach a speed of 10 _m/s_, the required braking distance (in _m, round off to nearest integer_) along the horizontal, is             \n', '30 to 30', NULL, 1633080695),
(11980, 6183, 19, 'deferredfeedback', 416, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The critical bending compressive stress in the extreme fibre of a structural steel section is 1000 _MPa_. It is given that the yield strength of the steel is 250  _MPa_, width of flange is  250 _mm _and thickness of flange is 15 _mm_. As per the provisions of IS:800-2007, the non-dimensional slenderness ratio of the steel cross-section is\n\n: 0.75\n\n; 0.25\n\n; 2.00\n\n; 0.50\n\n', '0.50\n\n', NULL, 1633080695),
(11981, 6183, 20, 'deferredfeedback', 417, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In the context of provisions relating to durability of concrete, consider the following assertions:\n\nASSERTION (1): As per IS 456-2000, air entrainment to the extent of 3% to 6% is required for concrete exposed to marine environment.\n\nASSERTION (2): The equivalent alkali content (in terms of Na2O equivalent) for a cement containing 1% and 0.6% of Na2O and K2O, respectively, is approximately 1.4% (rounded to 1 decimal place).\n\nWhich one of the following statements is CORRECT?\n\n: Both Assertion (1) and Assertion (2) are FALSE\n\n; Assertion (1) is FALSE and Assertion (2) is TRUE\n\n; Both Assertion (1) and Assertion (2) are FALSE; Assertion (1) is TRUE and Assertion (2) is FALSE\n\n', 'Assertion (1) is FALSE and Assertion (2) is TRUE\n\n', NULL, 1633080695),
(11982, 6183, 21, 'deferredfeedback', 418, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Chlorine is used as the disinfectant in a municipal water treatment plant. It achieves 50 percent of disinfection efficiency measured in terms of killing the indicator microorganisms (E-Coli) in 3 minutes. The minimum time required to achieve 99 percent disinfection efficiency would be\n\n: 21.93 minutes\n\n; 9.93 minutes\n\n; 19.93 minutes\n\n; 11.93 minutes\n\n', '19.93 minutes\n\n', NULL, 1633080695),
(11983, 6183, 22, 'deferredfeedback', 419, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A camera with a focal length of 20 _cm _fitted in an aircraft is used for taking vertical aerial photographs of a terrain. The average elevation of the terrain is 1200 _m _above mean sea level (MSL). What is the height above MSL at which an aircraft must fly in order to get the aerial photographs at a scale of 1:8000?\n\n: 3000 _m_\n\n; 2800 _m_\n\n; 3200 _m_\n\n; 2600 _m_\n\n', '2800 _m_\n\n', NULL, 1633080695),
(11984, 6183, 23, 'deferredfeedback', 420, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A flexible pavement has the following class of loads during a particular hour of the day.\n\ni.     80 buses with 2-axles (each axle load of 40 _kN_);\n\nii.   160 trucks with 2-axles (front and rear axle loads of 40 _kN _and 80 _kN_, respectively)\n\nThe equivalent standard axle load repetitions for this vehicle combination as per IRC:37- 2012 would be\n: 240\n\n; 180\n\n; 250\n\n; 320\n\n', '180\n\n', NULL, 1633080695),
(11985, 6183, 24, 'deferredfeedback', 421, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A long uniformly distributed load of 10 _kN/m _and a concentrated load of 60 _kN _are moving together on the beam ABCD shown in the figure (_not drawn to scale_). The relative positions of the two loads are not fixed. The maximum shear force (in _kN, round off to the nearest integer_) caused at the internal hinge B due to the two loads is                                                                                                               \n\n', '70 to 70', NULL, 1633080695),
(11986, 6183, 25, 'deferredfeedback', 422, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'When a specimen of M25 concrete is loaded to a stress level of 12.5 _MPa_, a strain of 500×10-6 is recorded. If this load is allowed to stand for a long time, the strain increases to 1000×10-6. In accordance with the provisions of IS:456-2000, considering the long-term effects, the effective modulus of elasticity of the concrete (in _MPa_) is      \n\n', '12500 to 12500', NULL, 1633080695),
(11987, 6183, 26, 'deferredfeedback', 423, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The new cotton technology, Bollgard-II, with herbicide tolerant traits has developed into a thriving business in India. However, the commercial use of this technology is not legal in India. Notwithstanding that, reports indicate that the herbicide tolerant Bt cotton had been purchased by farmers at an average of Rs 200 more than the control price of ordinary cotton, and planted in 15% of the cotton growing area in the 2017 Kharif season.\n\nWhich one of the following statements can be inferred from the given passage?\n\n: Farmers want to access the new technology if India benefits from it\n\n; Farmers want to access the new technology for experimental purposes\n\n; Farmers want to access the new technology even if it is not legal\n\n; Farmers want to access the new technology by paying high price\n\n', 'Farmers want to access the new technology even if it is not legal\n\n', NULL, 1633080695),
(11988, 6183, 27, 'deferredfeedback', 424, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In a sports academy of 300 people, 105 play only cricket, 70 play only hockey, 50 play only football, 25 play both cricket and hockey, 15 play both hockey and football and 30 play both cricket and football. The rest of them play all three sports. What is the percentage of people who play at least two sports?\n\n: 28.00\n\n; 23.30\n\n; 50.00\n\n; 25.00\n\n', '25.00\n\n', NULL, 1633080695),
(11989, 6183, 28, 'deferredfeedback', 425, 1, '1.0000000', '0.0000000', '1.0000000', 0, '“The increasing interest in tribal characters might be a mere coincidence, but the timing is of interest. None of this, though, is to say that the tribal hero has arrived in Hindi cinema, or that the new crop of characters represents the acceptance of the tribal character in the industry. The films and characters are too few to be described as a pattern.”\n\nWhat does the word ‘arrived’ mean in the paragraph above?\n: attained a status\n\n; went to a place\n\n; reached a terminus\n\n; came to a conclusion\n\n', 'attained a status\n\n', NULL, 1633080695),
(11990, 6183, 29, 'deferredfeedback', 426, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A square has sides 5 cm smaller than the sides of a second square. The area of the larger square is four times the area  of  the  smaller  square.  The  side  of  the  larger  square  is cm.\n\n: 8.50\n\n; 15.10\n\n; 10.00\n\n; 18.50\n\n', '10.00\n\n', NULL, 1633080695),
(11991, 6183, 30, 'deferredfeedback', 427, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'P, Q, R, S and T are related and belong to the same family. P is the brother of S. Q is the wife of P. R and T are the children of the siblings P and S respectively. Which one of the following statements is necessarily FALSE?\n\n: S is the brother of P\n\n; S is the aunt of T\n\n; S is the aunt of R\n\n; S is the sister-in-law of Q\n\n', 'S is the aunt of T\n\n', NULL, 1633080695),
(11992, 6183, 31, 'deferredfeedback', 428, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'An element is subjected to biaxial normal tensile strains of 0.0030 and 0.0020. The normal strain in the plane of maximum shear strain is\n\n: Zero\n\n; 0.0010\n\n; 0.0050\n\n; 0.0025\n\n', '0.0010\n\n', NULL, 1633080695),
(11993, 6183, 32, 'deferredfeedback', 429, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Assuming that there is no possibility of shear buckling in the web, the maximum reduction permitted by IS 800-2007 in the (low-shear) design bending strength of a semi-compact steel section due to high shear is\n\n: 25%\n\n; governed by the area of the flange\n\n; 50%\n\n; zero\n\n', '50%\n\n', NULL, 1633080695),
(11994, 6183, 33, 'deferredfeedback', 430, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'In the reinforced beam section shown in the figure (_not drawn to scale_), the nominal cover provided at the bottom of the beam as per IS 456-2000, is\n\n                                       \n\n \n\n: 42 mm\n\n; 36 mm\n\n; 30 mm\n\n; 50 mm\n\n', '42 mm\n\n', NULL, 1633080695),
(11995, 6183, 34, 'deferredfeedback', 431, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The interior angles of four triangles are given below:\n\n \n\nTriangle\n\nInterior Angles\n\nP\n\n85°, 50°, 45°\n\nQ\n\n100°, 55°, 25°\n\nR\n\n100°, 45°, 35°\n\nS\n\n130°, 30°, 20°\n\n \n\nWhich of the triangles are ill-conditioned and should be avoided in Triangulation surveys?\n\n: Both P and R\n\n; Both Q and S\n\n; Both P and S\n\n; Both Q and R\n\n', 'Both Q and R\n\n', NULL, 1633080695),
(11996, 6183, 35, 'deferredfeedback', 432, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If the path of an irrigation canal is below the bed level of a natural stream, the type of cross- drainage structure provided is\n\n: Level crossing\n\n; Super passage\n\n; Sluice gate\n\n; Aqueduct\n\n', 'Super passage\n\n', NULL, 1633080695),
(11997, 6183, 36, 'deferredfeedback', 433, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A catchment may be idealised as a rectangle. There are three rain gauges located inside the catchment at arbitrary locations. The average precipitation over the catchment is estimated by two methods: (i) Arithmetic mean (_P__A_), and (ii) Thiessen polygon (_P__T_). Which one of the following statements is correct?\n\n: _PA _is always greater than _P__T_\n\n; _PA _is always equal to _P__T_\n\n; There is no definite relationship between _P__A _and _P__T_\n\n; _PA _is always smaller than _P__T_\n\n', 'There is no definite relationship between _P__A _and _P__T_\n\n', NULL, 1633080695),
(11998, 6183, 37, 'deferredfeedback', 434, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A retaining wall of height _H _with smooth vertical backface supports a backfill inclined at an angle _b _with the horizontal. The backfill consists of cohesionless soil having angle of internal friction _f_. If the active lateral thrust acting on the wall is _P__a_, which one of the following statements is TRUE?\n\n: _Pa _acts at a height _H_/2 from the base of the wall and at an angle _β_ with the horizontal\n\n; _Pa _acts at a height _H _/2 from the base of the wall and at an angle Φ with the horizontal\n\n; _Pa _acts at a height _H _/3 from the base of the wall and at an angle _β__ _with the horizontal\n\n; _Pa _acts at a height _H_/3 from the base of the wall and at an angle_ Ø _with the horizontal\n\n', '_Pa _acts at a height _H _/3 from the base of the wall and at an angle _β__ _with the horizontal\n\n', NULL, 1633080695),
(11999, 6183, 38, 'deferredfeedback', 435, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which one of the following is a secondary pollutant?\n\n: Carbon Monoxide\n\n \n\n \n\n \n\n \n\n \n\n; Volatile Organic Carbon (VOC)\n\n; Ozone\n\n; Hydrocarbon\n\n', 'Ozone\n\n', NULL, 1633080695),
(12000, 6183, 39, 'deferredfeedback', 436, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A rectangular open channel has a width of 5 _m _and a bed slope of 0.001. For a uniform flow of depth 2 _m_, the velocity is 2 _m/s_. The Manning’s roughness coefficient for the channel is\n\n:  0.033\n\n; 0.050\n\n; 0.017\n\n; 0.002\n\n', '0.017\n\n', NULL, 1633080695),
(12001, 6183, 40, 'deferredfeedback', 437, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'If the section shown in the figure turns from fully-elastic to fully-plastic, the depth of neutral axis (N.A.), _y _, decreases by\n\n                                           \n\n: 10.75 mm\n\n; 12.25 mm\n\n; 15.25 mm\n\n; 13.75 mm\n\n', '13.75 mm\n\n', NULL, 1633080695),
(12002, 6183, 41, 'deferredfeedback', 438, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A survey line was measured to be 285.5 _m _with a tape having a nominal length of 30 _m_. On checking, the true length of the tape was found to be 0.05 _m _too short. If the line lay on a slope of 1 in 10, the reduced length (horizontal length) of the line for plotting of survey work would be\n\n: 283.6 _m_\n\n; 284.5 _m_\n\n; 285.0 _m_\n\n; 285.6 _m_\n\n', '283.6 _m_\n\n', NULL, 1633080695),
(12003, 6183, 42, 'deferredfeedback', 439, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A 16 _mm _thick gusset plate is connected to the 12 _mm _thick flange plate of an I-section using fillet welds on both sides as shown in the figure (_not drawn to scale_). The gusset plate is subjected to a point load of 350 _kN _acting at a distance of 100 _mm _from the flange plate. Size of fillet weld is 10 _m_\n\n_\n_\n\n_\n_\n\nThe maximum resultant stress (in _MPa_, _round off to 1 decimal place_) on the fillet weld along the vertical plane would be       \n\n', '10.3 to 10.5', NULL, 1633080695),
(12004, 6183, 43, 'deferredfeedback', 440, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A granular soil has a saturated unit weight of 20 _kN/m3 _and an effective angle of shearing resistance of 30°. The unit weight of water is 9.81 _kN/m3_. A slope is to be made on this soil deposit in which the seepage occurs parallel to the slope up to the free surface. Under this seepage condition for a factor of safety of 1.5, the safe slope angle (in _degree_, _round off to 1 decimal place_) would be       \n\n', '100 to 100', NULL, 1633080695),
(12005, 6183, 44, 'deferredfeedback', 441, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A square footing of 4 _m _side is placed at 1 _m _depth in a sand deposit. The dry unit weight (_g_) of sand is 15 _kN/m3_. This footing has an ultimate bearing capacity of 600 _kPa_. Consider the depth factors: _d__q _= _d__g__ _= 1.0 and the bearing capacity factor: _N__g__ _= 18.75. This footing is placed at a depth of 2 _m _in the same soil deposit. For a factor of safety of 3.0 as per Terzaghi’s theory, the safe bearing capacity (in _kPa_) of this footing would be   _\n\n', '250 to 250 or 270 to 270', NULL, 1633080695),
(12006, 6183, 45, 'deferredfeedback', 442, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'With reference to the conventional Cartesian (x, y) coordinate system, the vertices of a triangle have the following coordinates: (x1, y1) = (1, 0); (x2 , y2) = (2, 2); and (x3, y3) = (4, 3). The area of the triangle is equal to\n\n: 4/5\n\n; 3/2\n\n; 3/4\n\n; 5/2\n\n', '3/2\n\n', NULL, 1633080695),
(12007, 6183, 46, 'deferredfeedback', 443, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'The potable water is prepared from turbid surface water by adopting the following treatment sequence\n\n: Turbid surface water → Coagulation → Flocculation → Sedimentation → Filtration → Disinfection → Storage & Supply \n\n; Turbid surface water → Sedimentation → Flocculation → Coagulation → Disinfection → Filtration → Storage & Supply; Turbid surface water → Disinfection → Flocculation → Sedimentation → Filtration → Coagulation → Storage & Supply\n\n; Turbid surface water → Filtration → Sedimentation → Disinfection → Flocculation → Coagulation → Storage & Supply \n\n', 'Turbid surface water → Coagulation → Flocculation → Sedimentation → Filtration → Disinfection → Storage & Supply \n\n', NULL, 1633080695),
(12008, 6183, 47, 'deferredfeedback', 444, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'For a broad gauge railway track on a horizontal curve of radius R (in m), the equilibrium cant e required for a train moving at a speed of V (in km per hour) is\n\n: e = 0.60 V2/R\n\n; e = 1.676 V2/R\n\n; e = 0.80 V2/R\n\n; e = 1.315 V2/R \n\n', 'e = 1.315 V2/R \n\n', NULL, 1633080695),
(12009, 6183, 48, 'deferredfeedback', 445, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'A triangular direct runoff hydrograph due to a storm has a time base of 90 hours. The peak flow of 60 tn3/s occurs at 20 hours from the start of the storm. The area of catchment is 300 km2. The rainfall excess of the storm (in cm), is\n\n: 5.40\n\n; 6.48\n\n; 3.24\n\n; 2.00 \n\n', '3.24\n\n', NULL, 1633080695),
