(12220, 6243, 1, 'deferredfeedback', 20701, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'The number of products sold by B increased by what percent from 2011 and 2014 ?\n\n: ; ; ; ; ', '', NULL, 1633247664),
(12221, 6244, 1, 'deferredfeedback', 20702, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What is the difference between the total number of products sold by B in 2011, 2012 and 2016 together and the total number of products sold by A in 2011, 2012 and 2013 together ?\n\n: 380\n; 280\n; 480\n; 360\n; 580\n', '380\n', NULL, 1633247803),
(12222, 6245, 1, 'deferredfeedback', 20703, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (6-10): Study the table carefully and answer the following questions.\n\n If the population in village A and C are in ratio of 2 : 1 then, what is the ratio of inoperative Bank Account in Bank A and C.\n\n: None of these\n\n; 3 : 2\n\n; 4 : 5\n\n; 1 : 2\n\n; 1 : 3\n\n', 'None of these\n\n', NULL, 1633248000),
(12223, 6246, 1, 'deferredfeedback', 20702, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What is the difference between the total number of products sold by B in 2011, 2012 and 2016 together and the total number of products sold by A in 2011, 2012 and 2013 together ?\n\n: 280\n; 360\n; 480\n; 580\n; 380\n', '380\n', NULL, 1633248004),
(12224, 6247, 1, 'deferredfeedback', 20704, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'If out of the total inoperative Bank account in village B half account holder is female which is equal to 300, then find the total population of village B?\n\n: 10000\n\n; 9000\n\n; 8000\n\n; 12000\n\n; 14000\n\n', '10000\n\n', NULL, 1633248118),
(12225, 6248, 1, 'deferredfeedback', 20705, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'If the population of village C and D are in ratio of 1 : 2, then number of people in village C having Bank account is by what approximately percent less or more than that of village D\n\n: 43.45%\n\n; 47.45%\n\n; 42.45%\n\n; 49.45%\n\n; 45.45%\n\n', '45.45%\n\n', NULL, 1633248230),
(12226, 6249, 1, 'deferredfeedback', 20706, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'If the ratio of population in village A, B and C are in 1 : 2 : 3 then what percent of people in village A, B and C taking together have a bank account.\n\n: 52.5%\n\n; 55.5%\n\n; 51.5%\n\n; 57.5%\n\n; 59.5%\n\n', '57.5%\n\n', NULL, 1633248327),
(12227, 6250, 1, 'deferredfeedback', 20707, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Percentage of inoperative Bank account in Village E is by what percent more than the percentage of operative Bank accounts in the same village:\n\n: 60%\n\n; 55%\n\n; 50%\n\n; 45%\n\n; 75%\n\n', '50%\n\n', NULL, 1633248484),
(12228, 6251, 1, 'deferredfeedback', 20708, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (11-15): The following questions are accopanied by three statements (A) or (I), (B) or (II), and (C) or (III). You have to determine which statement(s) is/are sufficient/necessary to answer the questions.\n\nWhat is the inradius of a right-angled triangle?\n\nA. The area of the triangle is known. \n\nB. Any two sides of the triangle are known. \n\n C. The perimeter of the triangle is known.\n\n: B alone is sufficient\n\n; A and C together are sufficient\n\n; Any one statement is sufficient\n\n; Either B alone or A and C together are sufficient\n\n; All together are necessary\n\n', 'Either B alone or A and C together are sufficient\n\n', NULL, 1633248660),
(12229, 6252, 1, 'deferredfeedback', 20709, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What is rate of interest per annum? \n\n A. The amount becomes Rs 9331.20 in 2 years at compound interest. \n\n B. The difference between CI and SI at the same rate of interest in 2 yrs is Rs 51.20. \n\n C. The amount invested in Rs 8000.\n\n: Only A and B together\n\n; C and either A or B only\n\n; Any two of them\n\n; Only B and C together\n\n; B and either A or C only\n\n', 'C and either A or B only\n\n', NULL, 1633248784),
(12230, 6253, 1, 'deferredfeedback', 20710, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Find the number of days in which Q can do a job if P can do the same job in 8 days.\n\n: Any of them\n\n; Either A or B is sufficient\n\n; Only A is sufficient\n\n; A and C together are sufficient\n\n; Only B is sufficient\n\n', 'Any of them\n\n', NULL, 1633248958),
(12231, 6254, 1, 'deferredfeedback', 20711, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What is the non-voting population of a certain country? \n\nA. Only males above 21 years of age can vote. \n\nB. Males above 21 years form 30% of the total population. \n\nC. The total population of the country is 30 million.\n\n: A only\n\n; B only\n\n; C only\n\n; A and C only\n\n; None of the above\n\n', 'None of the above\n\n', NULL, 1633249347),
(12232, 6255, 1, 'deferredfeedback', 20712, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'A shopkeeper sold an article and got Rs 300 as profit. Find the profit percentage. \n\nA. Selling price of the article is Rs 1200. \n\nB. He gave 25% discount, which is Rs 400, on the labelled price \n\nC. Cost price of the article is Rs 900.\n\n: Either A or C only\n\n; A and C together\n\n; B and either A or C\n\n; Any of them\n\n; Any two of them\n\n', 'Any of them\n\n', NULL, 1633249509),
