(12238, 6261, 1, 'deferredfeedback', 20718, 1, '1.0000000', '-0.2500000', '1.0000000', 0, ': 10 minutes\n\n; 12 minutes\n\n; 16 minutes\n\n; 8 minutes\n\n;  7 minutes\n\n', '8 minutes\n\n', NULL, 1633250735),
(12239, 6262, 1, 'deferredfeedback', 20719, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'In an examination P scored 25 marks less than Q. Q scored 45 more marks than R. T scored 75 marks which is 10 more than R. U\'s score is 80 less than maximum marks of the test. What approximate percentage of marks did U score in the examination if he gets 55 marks more than R?\n\n: 85\n; 70\n; 80\n; 90\n; 60\n', '60\n', NULL, 1633250888),
(12240, 6263, 1, 'deferredfeedback', 20720, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'The largest and the smallest angles of a triangle are in the ratio of 3:1 respectively. The second largest angle of the triangle is equal to 56°. What is the value of largest angle of the triangle?\n\n: 49\n; 129\n; 123\n; 93\n; None of these\n\n', '93\n', NULL, 1633251000),
(12241, 6264, 1, 'deferredfeedback', 20721, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'he difference between the sum of four consecutive odd numbers and three consecutive even numbers together is 20. Also, the largest even number is 5 more than the largest odd number. What is the sum of the smallest odd number and the smallest even number ?\n\n: 77\n; 71\n; 879\n; 83\n; Cannot be determined\n\n', '77\n', NULL, 1633251100),
(12242, 6265, 1, 'deferredfeedback', 20722, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Anoop sells a book to Mayank at a profit of 20% and Mayank sells this book to Siddharth at a profit of 25%. Now Siddharth sells this book at a loss of 10% to Shishir. At what percentage loss should Shishir sells this book now so that his SP becomes equal to Anoop’s CP?\n\n: 36.68%\n\n; 25.92%\n\n; 48.66%\n\n; 16.46%\n\n; Cannot be determined\n\n', '25.92%\n\n', NULL, 1633251206),
(12243, 6266, 1, 'deferredfeedback', 20723, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'A shopkeeper marks up the price of his product by 40%. If he increases the discount from 5% to 10% ,the profit would decrease by Rs 14. How much profit would he earn if he gives a discount of 20% on the marked price?\n\n: Rs. 28\n\n; Rs. 24\n\n; Rs. 32\n\n; Rs. 56\n\n; Rs. 38', 'Rs. 24\n\n', NULL, 1633251340),
(12244, 6267, 1, 'deferredfeedback', 20724, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Monica deposited a total of Rs. 10500 with a bank in two different deposit schemes at 10% p.a., interest being compounded annually. As per the schemes, she gets the same amount after 2 years on the first deposit as she gets after 3 years on the second deposit. How much money did she deposit for 3 years?\n\n: Rs. 4500\n\n; Rs. 5000\n\n; Rs. 6500\n\n; Rs. 7200\n\n; None of these\n\n', 'Rs. 5000\n\n', NULL, 1633251445),
(12245, 6268, 1, 'deferredfeedback', 20727, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Two places P and Q are 92 km apart. A train leaves P for Q and at the same time another train leaves Q for P. Both the trains meet 4 hrs after they start moving. If the train travelling from P to Q travels 7 km/hr faster than the other train, find the speed of the two trains.\n\n: 15 km/hr, 8 km/hr\n\n; 12 km/hr, 8 km/hr\n\n; 12 km/hr, 9 km/hr\n\n; 15 km/hr, 9 km/hr\n\n; None of these\n\n', '15 km/hr, 8 km/hr\n\n', NULL, 1633251796),
(12246, 6269, 1, 'deferredfeedback', 20728, 1, '1.0000000', '-0.2500000', '1.0000000', 0, ': 3 hours\n\n; 2 hours\n\n; 2.5 hours\n\n; 1 hours\n\n; None of these\n\n', '2 hours\n\n', NULL, 1633251917),
(12247, 6270, 1, 'deferredfeedback', 20729, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Raman took a loan of Rs. 15000 from Laxman. He was agreed that for the first three years rate of interest charged would be at 8% Simple Interest per annum and at 10% Compound Interest (compounded, annually) from the fourth year onwards. Ram did not pay anything until the end of the fifth year. How much would he repay if he clears the entire amount, only at the end of fifth year ? (inRs.)\n\n: Rs. 22105\n\n; Rs. 22500\n\n; Rs. 22450\n\n; Rs. 22506\n\n; Rs. 22900\n\n', 'Rs. 22506\n\n', NULL, 1633252022),
(12248, 6271, 1, 'deferredfeedback', 20730, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Ram and Shyam are travelling from point A to B, which are 60 km apart. Travelling at a certain speed ram takes one hour more than Shyam to reach point B. If Ram doubles his speed he will take 30 minutes less than Shyam to reach point B. At what speed was Ram driving from point A to B ?\n\n: 25 kmph\n\n; 15 kmph\n\n; 20 kmph\n\n; 35 kmph\n\n; 30 kmph\n\n', '20 kmph\n\n', NULL, 1633252137),
(12249, 6272, 1, 'deferredfeedback', 20731, 1, '1.0000000', '-0.2500000', '1.0000000', 0, '6 litres are drawn from a cask full of wine and it is then filled with water. 6 litres of the mixture are drawn and the cask is again filled with water. The quantity of wine now left in the cask is to that of the water in it as 121 : 23. How much does the cask hold?\n\n: 54 litres\n\n; 62 litres\n\n; 70 litres\n\n; 72 litres\n\n; None of these\n\n', '72 litres\n\n', NULL, 1633252251),
(12250, 6273, 1, 'deferredfeedback', 20732, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'A passenger train leaves Calcutta at 4 PM and travels at the rate of 30 kilometres an hour. The mail train leaves Calcutta at 9 PM and travels, on a parallel line of rails, at the rate of 45 km an hour, when will the second train overtake the first?\n\n: 10 hrs after the first train start\n\n; 12 hrs after the second train starts\n\n; 10 hrs after the second train starts\n\n; 12 hrs after the first train starts\n\n; None of these\n\n', '10 hrs after the second train starts\n\n', NULL, 1633252371),
