(12253, 6276, 1, 'deferredfeedback', 20735, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What will be come in place of question mark (?) in the following number series ?\n\n: 356\n; 376\n; 358\n; 364\n; 336\n', '376\n', NULL, 1633252827),
(12254, 6277, 1, 'deferredfeedback', 20738, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (81-88): Read the following passage carefully and certain words in the passage are printed in bold letters to help you locate them easily while answering some of these questions.\n\nThe Indian economy is currently passing through  phase of relatively slow growth. However, this should not cloud the fact that over the nine-year period beginning 2005-06, the average annual growth rate was 7.7 per cent. Against this background, the relevant question is whether India has the capability to grow at ͺ  to  ͻ  per cent in sustained way. In short, what is the potential rate of growth of India?\n\nNormally, potential growth is measured using trends with some filters. In one sense, these are backward-looking measures, since they depend on historically observed data. In the case of measuring capacity utilisation in manufacturing, the maximum capacity is very often taken as the maximum output achieved in the recent period. Perhaps, in the case of determining the potential rate of growth of the economy also, one can take the maximum growth rate achieved in the recent past as the lowest estimate of the potential. However, this assumption will be valid only if there is reason to believe that the maximum growth rate achieved in the recent past was not one-off event and that the growth rate achieved was robust and replicable.\n\nIndia achieved growth rate of 9.5 per cent in 2005-06, followed by 9.6 per cent and 9.3 per cent in the subsequent two years. After declining  bit in the wake of international financial crisis, the growth rate went back to 8.9 per cent in 2010-11. In many ways the growth rate achieved in the high phase period of 2005- 06 to 2007-08 was robust. The domestic savings rate during this period averaged 34.9 per cent of GDP. Similarly, the gross capital formation rate averaged 36.2 per cent. The current account deficit (CAD) remained low with an average of 1.2 per cent of GDP. Agricultural growth during this period averaged ͷ per cent, and the annual manufacturing growth rate was 11 per cent. The capital flows were large but as the CAD remained low, the accretion to reserves amounted to $144 billion. Inflation during the period averaged 5.2 per cent. The combined fiscal deficit of the Centre and States was 5.2 per cent of GDP, well below the stipulated  per cent. Thus on many dimensions the growth rate was robust.\n\nUnlike in the 1980s when the pick-up in growth was accompanied by deterioration in fiscal deficit and current account, the sharp increase in growth between 2005-06 and 2007-08 happened with the stability parameters at desired levels. Also, booming external environment provided good support.\n\nTo assess whether the high growth phase can be replicated, we need to understand the factors that\nled to the slowdown since 2011-12. Complicating the analysis of this period is the revision of national incomenumbers with new base. The two sets of numbers present somewhat differing picture. According to the earlier series, the growth rate of the Indian economy fell below ͷ per cent in 2012-13 and 2013-14. But the new series shows decline below ͷper cent only in 2012- 13. For 2013-14, the new series records growth rate of 6.6 per cent, as against 4.7 per cent according to the earlier estimate. For 2014-15 and 2015-16, there is onlyone set of numbers, that is, according to the new series. For both the years the growth rate is above per cent. These are good growth rates under any circumstance, let alone the current global situation. Anyway, we have come down from the growth rate of 9-plus per cent which we had seen earlier.Three sets of reasons are attributed for the slowdown. First, the external environment had deteriorated sharply. The recovery from the crisis of 2008 was tepidǤ  One country after another in the developed world came under pressure. Strangely, however, international commodity prices including crude oil prices remained high until couple of years ago. All this had an adverse impact on developing countries, including India. However, it would be wrong to attribute the slowdown in India primarily to external factors. The domestic factors are the key. Second, there were severe supply bottlenecks. Agricultural production fell sharply in 2009-10 because of severe drought. This triggered an inflation which lasted for several years thereafter. Coal output fell. Iron ore output fell, partly because of court decisions. The third set of reasons is basically non-economic which led collectively to weakening of investment. multitude of issues relating to scams and perceived delays in decision making created an element of uncertainty in the minds of investors. New investments began to fall.\n\nThe rise in investment rate must be supported by  rise in the domestic saving rate. An increase in investment rate supported by widening current account deficit is not sustainable and is fraught with serious consequences. Only current account deficit in the region of  ͳ  to 1.5 per cent is sustainable. Incremental capital output ratio is  catch-all variable which is influenced by host of factors. Obviously, it depends on technology. It also depends upon the skill of the labour force which in turn depends on the quality of the education system. Another catch-all expression “ease of doing business” is also relevant (i.e.) bureaucratic hurdles which impede speedy execution of projects need to be removed. Thus improving the productivity of capital needs action on several fronts. Making  prediction about the future is always hazardous. Many things can go wrong. The Indian economy in the recent past has shown that it has the resilience to grow at ͺ to ͻ  per cent. Therefore achieving the required investment rate to support such  high growth is very much in the realm of possibility. However, we need to overcome the current phase of declining investment rate. Investment sentiment is influenced by non-economic factors as well. An environment of political and social cohesion is imperative. Equally, we can get the incremental capital output ratio (ICOR) to  lower level. Raising the productivity of capital will require policy reforms including administrative reforms as well as firm-level improvements. The “potential” to grow at  ͺ to  ͻ  per cent at least for decade exists. We have to make it happen.\n\nIn context of the given passage, which of the following is/are the reason for economic slowdown of India?\n\n: Jaunty recovery from the crisis of 2008\n\n; Court’s verdict to stop production of coal.\n\n; Domestic barriers like draught, inflation etc.\n\n; Various barriers introduced by the government.\n\n; All of these\n\n', 'Domestic barriers like draught, inflation etc.\n\n', NULL, 1633254215),
(12255, 6278, 1, 'deferredfeedback', 20739, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'According to the given passage, what does ‘ease of doing business imply?\n\n: Availability of funds\n\n; Not clear from the passage\n\n; Eliminating nepotism\n\n; End of bureaucracy\n\n; Eliminating Red tapism\n\n', 'Eliminating Red tapism\n\n', NULL, 1633255903),
(12256, 6279, 1, 'deferredfeedback', 20740, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'On what factors does incremental capital output ratio NOT depend?\n\n:  It depends on all the given options\n\n; Low fiscal deficit\n\n; Technology\n\n; Better education system\n\n; Skilled labour\n\n', 'Low fiscal deficit\n\n', NULL, 1633256021),
(12257, 6280, 1, 'deferredfeedback', 20741, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'On the basis of the given passage, which of the following options cannot be inferred?\n\n: Nature also played an important role in slowing down Indian economy.\n\n; The Indian economy experiencedgreat robust throughout the previous decade.\n\n; Corruption is one of the reasons for the economic slowdown of India\n\n; There is dissimilitude between the calculations based on new base and the previous one.\n\n; Fiscal deficit below six percent is proviso.\n\n', 'The Indian economy experiencedgreat robust throughout the previous decade.\n\n', NULL, 1633256178),
(12258, 6281, 1, 'deferredfeedback', 20741, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'On the basis of the given passage, which of the following options cannot be inferred?\n\n: Corruption is one of the reasons for the economic slowdown of India\n\n; Fiscal deficit below six percent is proviso.\n\n; There is dissimilitude between the calculations based on new base and the previous one.\n\n; Nature also played an important role in slowing down Indian economy.\n\n; The Indian economy experienced great robust throughout the previous decade.\n\n', 'The Indian economy experienced great robust throughout the previous decade.\n\n', NULL, 1633256209),
(12259, 6282, 1, 'deferredfeedback', 20742, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'According to the given passage, which of the following option is the best reason which supports the author’s conclusion that ‘high growth is very much in the realm of possibility’?\n\n: Flourishing service, agricultural and manufacturing sectors of India.\n\n; Policy reforms introduced by the current government.\n\n; Increasing growth rate and investment rate\n\n; India’s potential to grow at a  high rate\n\n; None of these\n\n', 'None of these\n\n', NULL, 1633256362),
(12260, 6283, 1, 'deferredfeedback', 20743, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'On the basis of your reading, choose an appropriate title for the passage.\n\n: India’s promising past results.\n\n; Can India grow fast: An introspection; Ease of doing business; The Indian economy: The phase of sluggish growth.\n\n; India’s potential.\n\n', 'Can India grow fast: An introspection', NULL, 1633257070),
(12261, 6284, 1, 'deferredfeedback', 20744, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (87-88): Choose the word/group of words which is MOST SIMILAR in meaning to the word/group of words printed in bold as used in the passage. Q87. ACCRETION\n\n: Upsurge\n\n; Adherence\n\n; Devaluation\n\n; Approval\n\n; Accumulation\n\n', 'Accumulation\n\n', NULL, 1633257274),
(12262, 6285, 1, 'deferredfeedback', 20745, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Choose the word/group of words which is MOST SIMILAR in meaning to the word/group of words printed in bold as used in the passage\n\nIMPEDE\n\n: Delay\n\n; Diagnose\n\n; Defer\n\n; Taint\n\n; Violate\n\n', 'Delay\n\n', NULL, 1633257433),
(12263, 6286, 1, 'deferredfeedback', 20746, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (89-95): Read the following passage carefully and answer the questions given below it. Certain words have been printed in bold to help you to locate them while answering some of the questions.\n\nBrexit has evoked spate of comments. These comments fall into broadly two categories. The first set of comments focusses on the short-term and medium term impact of Brexit on the U.K., Europe and the rest of the world including India. The second goes into the reasons behind this decision of the British. Globalisation has been interpreted in many ways. In broad terms, globalisation denotes the free movement of goods, services, capital, funds, ideas, technology and people across countries. Many people think globalisation is recent phenomenon. This is not true. This has been going on for centuries. What has made it unique in recent times is the speed of the movement. Great Britain and many other countries in Europe have reached the present level of economic development only because of this free movement. In both demographic and geographic terms, Britain is small country. It is not the size of the domestic market that determined its growth. London could not have emerged as the financial centre of the world but for the free flow of capital.\n\nThe gamut of financial services offered by London is geared to meet world demand and not that of Britain alone. Even after the exit from the EU, Britain cannot remain as an isolated island. It has to be part of an international trade regime which allows for free trade. What then could have motivated little more than 50 per cent of the population to come out of the EU? It has something to do with the nature of the relationship within the EU. The EU has evolved over the last seven decades. From loose arrangement, it has become tight bureaucratic organisation with its\n\njurisdiction extending to multifarious activities. When the euro was created as common currency, Britain opted out of it. The European Central Bank sets common monetary policy stance for all member countries. This itself has been source of irritation to many member countries. This came out prominently at the time of the Greek crisis. With the loss of one instrument of control Ȅ namely, the exchange rate variation Ȅ the entire burden of adjustment had to be through employment and output changes. As one commentator put it, the EU has moved up its aspiration from the idea of ‘common’ market to ‘single’ market. It is this transition which half of Britain has resented. The complex set of regulations emanating from Brussels has made at least section of the British people feel that they have lost ‘independence’. Some of the elite of Britain who voted to ‘leave’ feel this way. They think that control has moved to unelected bureaucrats in Brussels. What has induced the ‘non-elite’ to vote for Brexit was the EU’s migration policy. The free movement of people has been the last straw that broke the camel’s back. The low-paid jobs in the U.K. have been taken over by migrants predominantly from Eastern Europe. In an economy which has been growing slowly (even though the U.K. is better performer than other European countries in recent years), this has come as shock. The spirit of ‘nationalism’ still runs high. The poor in Britain feel that they have been cheated by the migrants. Absorbing migrants is not new for Britain. The Asian and African migrants constitute significant proportion of the population. All this happened when the economy was strong and growing. But this is not the situation now, and the resentment is in one sense natural. However, looked at globally, the poor in the countries from which people migrate have benefited. The British have also gained to the extent that the free movement of people has enabled highly skilled professionals to find positions all over Europe. The ‘leave’ vote thus was motivated by two considerations: one, the degree of integration that the EU was trying to impose, and two, the migration policy which allowed free movement of people across countries. Globalisation is not really the devil. If the EU arrangement had been restricted only to free movement of goods, services, capital and funds, it could not have led to any deep resentment. It is the attempt at greater economic integration that has been interpreted as loss of sovereignty and resented. Globalisation, with its emphasis on efficiency (since goods and services will get produced at the least cost centres), can lead to greater inequality theoretically. Within country also, the more efficient including professionals gain disproportionately. This situation gets worse if economies are growing slowly. The U.S. has always prided itself on saying that the system they have is ‘people’s capitalism’. Inequalities do not matter much when economies are growing strongly and when new entrants to the labour force find employment easily. Countervailing measures are needed to take care of the adverse impact of globalisation. For this reason, we cannot throw the baby out with the bathwater. Thedeveloped countries face  serious dilemma. They have reached stage in their development when further growth will be slow. This will have implications for absorbing the labour that gets added to the market. Complicating the situation is technological development which is increasingly labour-saving. New technologies have twofold impact. First, they reduce the demand for labour in general. Second, in particular they make unskilled and semi-skilled work redundant. They demand new skills for which retraining may be needed. Distribution of income has thus become an issue which needs to be dealt with directly. Brexit is not blo againstglobalisation per se. Labour does not stand in the same category as capital, even though both are factors of production. Migration hurts whenthe economy is at low ebb. Britain, along with otherdeveloped countries, faces basic problem of coping with growth potential which is far lower than thegrowth rate they had seen before 2008. To what aspect this article is devoted by the author?\n\n: Motivation behind the vote against greater economic integration.\n\n; Impact of Brexit on U.K and Europe.\n\n; The implications of Brexit on the migration in Britain.\n\n; Impact of globalization.\n\n; Countervailing measures that are needed to take care of the adverse impact of globalisation.\n\n', 'Motivation behind the vote against greater economic integration.\n\n', NULL, 1633258986),
(12264, 6287, 1, 'deferredfeedback', 20747, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'What has been the reason for the infuriation of the member countries of European Union?\n\n: Technological development which is increasingly labour-saving.\n\n; The migration policy which allowed free movement of people across countries.\n\n; The increase of inequality in economically strong countries which has generated new nationalism.\n\n; The increase in the EU’s propensity towards single market.\n\n; Britain’s refusal to accept euro as its currency even after common monetary policy stance for all the members.\n\n', 'The increase in the EU’s propensity towards single market.\n\n', NULL, 1633259167),
(12265, 6288, 1, 'deferredfeedback', 20748, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following is one of the reasons for major section of British people to vote against European Union?\n\n: The spirit of nationalism among the some sections of British people.\n\n; The jurisdiction enjoyed by the unelected officials in Brussels.\n\n; Discrimination of Britain by other member countries because of both demography and geography.\n\n; Slow economic growth and incompetence of the new technologies because of which they are becoming more financially weak.; Low wages due to the abundance of labour force migrating from Asian countries to the Britain.\n\n', 'The jurisdiction enjoyed by the unelected officials in Brussels.\n\n', NULL, 1633259313),
(12266, 6289, 1, 'deferredfeedback', 20749, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Which of the following statement is false regarding the impact of globalization?\n\n (i) Globalization that stresses on productivity leads to inequality. (ii)Globalization has been attributed as the primary reason for the loss of supremacy in British people by the author. (iii) Globalization is major factor which helped London in becoming financial center of the World.\n\n: Only (ii)\n\n; Both (ii) and (iii)\n\n; Only (iii); Both (i) and (ii)\n\n; All of these.\n\n', 'Only (ii)\n\n', NULL, 1633259649),
