(12277, 6300, 1, 'deferredfeedback', 20834, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Five statements are given below, labelled a, b, c, and e. Among these, four statements are in logical order and form coherent paragraph. From the given options, choose the option that does not fit into the theme of the paragraph.\n\n: Each of these “worlds” is populated by experts in specific “fields” within the urban realm such as planning, environment, transport, housing,\nfinance and health.;  The multiple “fields” within these parallel “worlds” typically operate as silos and do not interact with the other “fields” and “worlds”\n\n; This can be seen in the growing importance cities are receiving in the distinct “worlds” of government, business, think tanks, academia and civil society.; After years of ambivalence, urbanization is increasingly being embraced, or at least acknowledged, in India.;  sustainability is at the core of the “New Urban Agenda”. substantial portion is dedicated to various “transformative commitments for sustainable urban development”\n\n', ' sustainability is at the core of the “New Urban Agenda”. substantial portion is dedicated to various “transformative commitments for sustainable urban development”\n\n', NULL, 1633416149),
