(12279, 6302, 1, 'deferredfeedback', 20836, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Five statements are given below, labelled a, b, c,  and e. Among these, four statements are in logical order and form  coherent paragraph. From the given options, choose the option that does not fit into the theme of the paragraph. \n\n: It is often said that the urgent and the immediate are not the same as important\n\n; All the urgent and the immediate commentary on the decision by the newly constituted monetary policy committee (MPC) of the Reserve Bank of India (RBI) has already come out.\n\n; Indeed, they are in conflict with one another.\n\n; Therefore, one should not be surprised that the Indian corporate sector has kept its calls for lower interest rates and competitive exchange rate on an auto-replay mode.\n\n; RBI has released the minutes of the MPC meeting too. The bulk of it has been seen earlier in the press release that followed the meeting\n\n', 'Therefore, one should not be surprised that the Indian corporate sector has kept its calls for lower interest rates and competitive exchange rate on an auto-replay mode.\n\n', NULL, 1633416555),
