(12281, 6304, 1, 'deferredfeedback', 20839, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Five statements are given below, labelled a, b, c, and e. Among these, four statements are in logical order and form  coherent paragraph. From the given options, choose the option that does not fit into the theme of the paragraph.\n\n: Recent attempts by Rahul Gandhi to mobilize farmers during his Kisan Yatra might not revive the fortunes of the Congress party in Uttar Pradesh, but they did contribute to bringing the issues of farmers and agriculture to the political mainstream.\n\n; Given that almost half of the total workers in the country are still engaged in farming and the majority of households in rural areas are still dependent on agriculture, directly or indirectly, issues confronting the farming community are naturally an important electoral plank.\n\n; It is also worth mentioning that most of them were seen as leaders of dominant farming communities or caste groups that benefited from rising profitability and price support\n\n; More so in an environment where rural areas, and the agricultural sector in particular, have been in some distress in recent years.\n\n; Notwithstanding the good monsoon this year after back-to-back drought years, most commentators agree that the rural economy and the agricultural sector may not be out of distress.\n\n', 'It is also worth mentioning that most of them were seen as leaders of dominant farming communities or caste groups that benefited from rising profitability and price support\n\n', NULL, 1633416770),
(12282, 6305, 1, 'deferredfeedback', 20842, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Five statements are given below, labelled a, b, c, and e. Among these, four statements are in logical order and form  coherent paragraph. From the given options, choose the option that does not fit into the theme of the paragraph.\n\n: Dyn is part of the backbone of the Internet, since it is one of the companies that provides domain name services or DNS to Internet users, and translates simple English-based commands like “livemint.com” typed into browser into the actual numeric addresses that the Internet’s computers use to identify each website.\n\n; It claims that hundreds of thousands of such devices were co-opted into the attack by being infected with malware.\n\n; This outage was astonishing in its ferocity, especially since it co-opted the much vaunted Internet of Things (IoT) into the attack.\n\n; This malware, called Mirai, was released by an anonymous hacker named Anna-senpai some weeks ago.\n\n; Security firm Flashpoint has said that it believes that seemingly innocuous items such as video recorders, webcams, closed-circuit security cameras and the like were taken over by malware, and then, without their owners’ knowledge, were used to help execute the massive cyber attack\n\n', 'Dyn is part of the backbone of the Internet, since it is one of the companies that provides domain name services or DNS to Internet users, and translates simple English-based commands like “livemint.com” typed into browser into the actual numeric addresses that the Internet’s computers use to identify each website.\n\n', NULL, 1633416967),
(12283, 6306, 1, 'deferredfeedback', 20845, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Five statements are given below, labelled a, b, c, and e. Among these, four statements are in logical order and form  coherent paragraph. From the given options, choose the option that does not fit into the theme of the paragraph.\n\n: Life happens on grid of squares that stretch in every direction (imagine an infinite chessboard). Each square, or cell, is either alive or dead (or call it black or white, filled or empty).\n\n;  Now, this is not  game in the conventional sense: there’s no way to “win”, nor do you play against an opponent. In fact, Life doesn’t even need player as it proceeds. You just set up an initial state and then watch what happens.\n\n; This is the endlessly fascinating question Conway’s game raises, and this is why it was and remains today much discussed favourite among mathematicians and computer scientists.\n\n; To start, you choose certain number of cells to be live—at random, or in pattern, whatever. Each cell now evolves according to  set of rules that considers its eight neighbours (left, right, above, below, and on the four corners).\n\n;  The mathematician Richard K. Guy is arguably best known for discovering glider.Assuming that’s an intriguing-enough opening, let me explain. In 1970, the British mathematician John Conway invented board game called, simply, “Life”.\n\n', 'This is the endlessly fascinating question Conway’s game raises, and this is why it was and remains today much discussed favourite among mathematicians and computer scientists.\n\n', NULL, 1633417261),
(12284, 6307, 1, 'deferredfeedback', 20848, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (106-109): In each of the following sentences four options are given. You are needed to identify the best way of writing the sentence in context of the correct usage of standard written English.\n\nThe entire cast and crew of the film, enjoyed splashing in the pool, bathing in the ocean, and, particularly, to sun bathe on the shore.\n\n: The entire cast and crew of the film, enjoyed splashing in the pool, bathing in the ocean, particularly to sun bathing on the shore.\n\n; The entire cast and crew of the film, enjoyed swimming in the pool to bathe in the ocean, and, particularly sun bathing on the shore.\n\n; The entire cast and crew of the film, enjoyed swimming in the pool, bathing in the ocean, and, particularly, sun bathing on the shore.\n\n; No error.\n\n; The entire cast and crew of the film, enjoyed splashing in the pool, to have bath in the ocean, and, particularly, to sun bathe on the shore.\n\n', 'The entire cast and crew of the film, enjoyed swimming in the pool, bathing in the ocean, and, particularly, sun bathing on the shore.\n\n', NULL, 1633417460),
