(12293, 6316, 1, 'deferredfeedback', 20874, 1, '1.0000000', '-0.2500000', '1.0000000', 0, 'Directions (115–116): Sentences given in each question, when properly sequenced form coherent paragraph. Each sentence is labeled with letter. Choose the most logical order of sentences amongst the five choices given to construct paragraph.\n\n(a) The newspaper man, the flower seller, the milkman, the sweeper, they are all privy to the chatting and sharing of news that the elderly find comforting. \n\n(b) When we remove them from their homes, it is not only the family that they are being removed from, but all those other people that they see every day and whose joys and woes become their own. \n\n(c) In our system of living, the elderly at home have circle of acquaintances, and friends.\n\n(d) The loneliness of the discarded elderly is manifold. \n\n(e) When we forcibly remove people from surroundings they have been part of for decades we put an un-mendable tear in the fabric of their lives.\n\n: DBAEC\n\n; DECAB\n\n; ABDCE\n\n; CBAED\n\n; ECADB\n\n', 'DECAB\n\n', NULL, 1633419711),
(12294, 6317, 1, 'deferredfeedback', 20875, 1, '1.0000000', '-0.2500000', '1.0000000', 0, '(a) Some of the worst cancers aren’t detected by screening. \n\n(b) The only way to be sure is to look at the results of randomized trials comparing cancer deaths in screened and unscreened people. \n\n(c) So how can we be confident that getting screening test regularly is good idea? \n\n(d) Even when screening “works” in such trials, the size of the benefit observed is surprisingly low: Generally, regular screening reduces fatalities from various cancers between 15 percent and 25 percent. \n\n(e) They appear suddenly, between regular screenings, and are difficult to treat because they are so aggressive.\n\n: DBAEC\n\n; ACBDE\n\n;  ADBEC\n\n; AECBD\n\n; ACBED\n\n', 'AECBD\n\n', NULL, 1633419902),
(12295, 6318, 1, 'deferredfeedback', 20877, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE BELOW QUESTIONS.\n\nTwelve people are sitting in two parallel rows six people each, in such a way that there is an equal distance between adjacent persons. In row-1 E, F, G, H, I and J are seated and all of them are facing south. In row-2 U, V, W, X, Y, and Z are seated and all of them are facing north. Therefore, in the given seating arrangement each member seated in a row faces another member of the other row. U sits third to the right of X. Neither U nor X sits at extreme ends. I faces X. J does not face U and J does not sit at any of the extreme ends. J is not an immediate neighbor of I. V sits at one of the extreme ends. Only two people sit between V and Y. Y does not face J. Two persons sit between G and F. G is not an immediate neighbor of I. W does not face J. E is not an immediate neighbor of G.\n\nWho among the following sit at extreme ends of the rows?\n: F, UG\n\n; G, X\n\n; V, I\n\n; E, Z\n\n; W, E\n\n', 'W, E\n\n', NULL, 1633420014),
(12296, 6319, 1, 'deferredfeedback', 20879, 1, '1.0000000', '-0.2500000', '1.0000000', 0, ' Directions (117–120): Read each of the following four sentences to find out whether there is any grammatical mistake/error in it. Choose the sentence with no grammatical error as the correct answer. If all of the given sentences are grammatically incorrect, mark (e) as an answer.\n\n:  John Wanamaker, founder of the stores that bear his name, once confessed, learnt 30 year ago that it is foolish to scold.\n\n;  Whether rich or poor, American or Indian, we all have the same emotions deep with us.\n\n;  This research indicate that we can no longer avoid significant warning during this century\n\n;  Every modern society depends on the trust in the skills and ethics of  variety of institutions such as schools and colleges, hospital and markets.\n\n;  None of these\n\n', ' Every modern society depends on the trust in the skills and ethics of  variety of institutions such as schools and colleges, hospital and markets.\n\n', NULL, 1633420266),
