(12466, 6370, 1, 'deferredfeedback', 20858, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'M, N, O, P, Q, R, S, and T are eight friends and sitting\n\naround a circular table facing outside the center but not\n\nnecessarily in the same order.\n\nQ sits third to the left of M. T is sitting second to the left\n\nof P. P is not an immediate neighbor of both M and Q. R\n\nand N are immediate neighbors of each other. N is not an\n\nimmediate neighbor of M. S is not an immediate neighbor\n\nof T.\n\nWhat is O’s position with respect to M?\n\n: Third to the right\n\n; Third to the left\n\n; Second to the right\n\n; Second to the left\n\n; None of these\n\n', 'Second to the right\n\n', NULL, 1633609222),
