(12468, 6370, 3, 'deferredfeedback', 20867, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Study the following information\n\nCAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nSeven people A, B, C, D, E, F and G are sitting in a single row. Some of them are facing north and some of\n\nthem are facing South at equidistant from each other but not necessarily in the same order. No two adjacent\n\npeople face same direction. Only two people sit between F and E. E faces South direction. C is not\n\nadjacent to F. D does not sit at any of the extreme end of the line. F Sit second from the right end of the line.\n\nE and A are adjacent to each other. Two persons sit between A and C. B faces North direction.\n\nWhich of the following pair sits at the end of the line?\n: C and F\n\n; G and C\n\n; B and G\n\n; E and G\n\n; None of these\n\n', 'G and C\n\n', NULL, 1633609116),
(12469, 6370, 4, 'deferredfeedback', 20869, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'How many people sit between B and G?\n\n: Three\n\n; One\n\n; Four\n\n; Two\n\n; None of these\n\n', 'Four\n\n', NULL, 1633609116),
(12470, 6370, 5, 'deferredfeedback', 20889, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE BELOW QUESTIONS.\n\nTwelve people are sitting in two parallel rows contains six people each, in such a way that there is an equal distance between adjacent persons. In row-1 T, U, V, W, X and Y are seated and all of them are facing south. In row-2 A, B, C, D, E and F are seated and all of them are facing north. All the above information is not necessarily in the same order.\n\nV sits second from one of the ends. Only three persons sit between the one who faces V and F. As many people sit to the left of F is same as to the right of C. W sits second to the right of X. Neither W nor X is an immediate neighbour of V. The one who faces W sits on the immediate right of E. Only one person sits between D and E. Neither Y nor T faces D. U faces an immediate neighbour of B. Y does not sit at any of the ends.\n\nHow many people are sitting between C and the one who faces V?\n: One\n\n; Two\n\n; Four\n\n; None\n\n; Three\n\n', 'None\n\n', NULL, 1633609116),
(12471, 6370, 6, 'deferredfeedback', 20890, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Who among the following person faces T?\n\n: E\n; B\n; C\n; A\n; D\n', 'C\n', NULL, 1633609116),
(12472, 6370, 7, 'deferredfeedback', 20891, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE GIVEN QUESTIONS:\n\nEight persons i.e. Vinod, Vishu, Reena, Kamal, Pritam, Ranbir, Tina and Juhi are sitting in a square\n\ntable such that four of them are sitting at the corner of the table and they are facing outside the table while\n\nfour of them are sitting at the middle of the table and they are facing inside the table.\n\nKamal sits second to the left of Vishu. Only one person sits between Vishu and Reena who doesn\'t sit at the\n\ncorner of the table. Tina who is an immediate neighbour of Vishu sits diagonally opposite to Pritam.\n\nVinod is neither an immediate neighbour of Vishu nor Ranbir. Juhi sits three places away from Ranbir who\n\ndoesn\'t faces Vishu. More than four persons sit between Tina and Kamal when counted in the\n\nclockwise direction from Kamal.\n\nWho among the following sits third to the left of the person who faces Vishu?\n: Vishu\n\n; Person sits diagonally opposite to Pritam\n\n; Person who is an immediate neighbour of Vinod\n\n; Juhi\n\n; Ranbir\n\n', 'Person sits diagonally opposite to Pritam\n\n', NULL, 1633609116),
(12473, 6370, 8, 'deferredfeedback', 20892, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Which of the following statement is/are correct?\n\n: Tina and Pritam sit opposite to each other\n\n; Vishu doesn\'t sit at the corner of the table\n\n; Vinod faces inside the table\n\n; Both A and B\n\n; Both A and C\n\n', 'Both A and B\n\n', NULL, 1633609116),
(12474, 6370, 9, 'deferredfeedback', 20893, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY TO ANSWER THE GIVEN QUESTIONS:\n\nEight persons sit in a rectangular table facing center such that one person sits at each corner and one person\n\nsits at each middle of the sides. V sits third to the right of W. Two persons sit between V and U . S sits third to\n\nthe right of T who sits at the corner. S is an immediate neighbour of neither W nor V. Q sits third to the right\n\nof P and third to the left of R.\n\nWho among the following sits third to the right of the one who sits to the immediate right of Q?\n: W\n; P\n; T\n; V\n; None of these\n', 'W\n', NULL, 1633609116),
(12475, 6370, 10, 'deferredfeedback', 20894, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'How many persons sit between T and S when counted from the left of T?\n: 1\n; 2\n; 3\n; 4\n; None \n', '4\n', NULL, 1633609116),
(12476, 6370, 11, 'deferredfeedback', 20895, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'READ THE INFORMATION CAREFULLY AND ANSWER THE FOLLOWING QUESTIONS.\n\nSix people- Akash, Raj, Govind, John, Surya and Amar are sitting around a triangular shaped table such that three of them sit at the corner while remaining three are sitting on the edges but not necessarily in the same order. People sitting at corner are facing outside the table and people who all are sitting on the edges of table are facing inside the table. Govind and Surya are facing in same direction. Raj is sitting third to the right of Surya who is sitting to the immediate left of John. Govind is sitting second to the left of Amar who is not sitting on the edges of table.\n\nWHO IS SITTING TO THE IMMEDIATE RIGHT OF JOHN?\n\n: Surya\n\n; Govind\n\n; Raj\n\n; Akash\n\n; Amar\n\n', 'Amar\n\n', NULL, 1633609116),
(12477, 6370, 12, 'deferredfeedback', 20896, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Who is sitting opposite to Raj?\n\n: Akash\n\n; John\n\n; Govind\n\n; Either b and c\n\n; Surya\n\n', 'Surya\n\n', NULL, 1633609116),
(12478, 6370, 13, 'deferredfeedback', 20905, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'ANSWER THE QUESTIONS BASED ON THE INFORMATION GIVEN BELOW.\n\nCertain number of persons sits in a linear row and all are facing towards the south. Only three persons are sitting between Nihaal and Rajan. Only three persons are sitting between Vishal and Sophia. More than two persons are sitting between Rajan and Sophia. Tripti sits second to the right of Rajan. More than three persons are sitting between Tripti and Dhairya. Only three persons are sitting between Mani and Kavya, who sits at the one end of the line. Only three persons are sitting between Mani and Nihaal and Mani is sitting to the right of Nihaal. Only two persons sit between Nihaal and Dhairya. Rajan is sitting second to the right of Vishal.\n\nWho sits third to the left of Dhairya?\n\n: Rajan\n\n; Vishal\n\n; Kavya\n\n; Nihaal\n\n; Sophia\n\n', 'Nihaal\n\n', NULL, 1633609116),
(12479, 6370, 14, 'deferredfeedback', 20907, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'If L sits second to the right of Sophia then who among the following sits second to the right of L?\n: Vishal\n\n; Nihaal\n\n; Kavya\n\n; Tripti\n\n; None of the above\n\n', 'Nihaal\n\n', NULL, 1633609116),
(12480, 6370, 15, 'deferredfeedback', 20911, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nSome people were sited around circular table facing center. Six persons sit between J and G. H and B are immediate neighbors of J. B sit to the left of H. Only one person sit between H and D. Six persons sit between G and B. Two persons sit between G and C who sit immediate right of I. Six person sit between B and A. A is not the neighbor of D. F is neighbor of neither B nor C. F is not the neighbor of D. F is neighbor of neither A nor G. Four persons sits between F and E.\n\nTotal how many persons sit around the table?\n\n: 12\n; 13\n; 14\n; 14\n; 15\n', '15\n', NULL, 1633609116),
