(12482, 6370, 17, 'deferredfeedback', 20916, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE BELOW QUESTIONS:\n\nSeven persons namely – P, Q, R, S, T, U and V were born on different days from Monday to Sunday. All the persons were born in the same week. One person was born between S and P. Two persons were born between S and T, who was born on Saturday. R was born on any day after P but not born on Tuesday. Two persons were born between R and V, who was not born on Sunday. U was born on any day before V but not born on Tuesday.\n\nOn which of the following day U was born?\n\n: Wednesday\n\n; Saturday\n\n; Sunday\n\n; Friday\n\n; None of these\n', 'Friday\n\n', NULL, 1633609116),
(12483, 6370, 18, 'deferredfeedback', 20920, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'How many people were born after R?: Three\n\n; One\n\n; More than three\n\n; Two\n\n; None\n', 'More than three\n\n', NULL, 1633609116),
(12484, 6370, 19, 'deferredfeedback', 20923, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW.\n\nEight persons viz. A, B, C, D, E, F, G and H are visiting the park on 5th and 12th of May, June, August and September of the same year, but not necessarily in the same order. Not more than one person visits the park on the same day of the same month. H visits the park, five persons before D. G visits between H and D but neither on an odd date nor in the month having 30 days. A visits two persons before G and three persons after F. E visits the park before B and both visit on the same date. C doesn’t visit the park in the month having 30 days.\n\nWho among the following person visits the park on12th May?\n: H\n; The one who visits three persons after G.; A\n; The one who visits two persons before A.\n\n; E\n', 'The one who visits two persons before A.\n\n', NULL, 1633609116),
(12485, 6370, 20, 'deferredfeedback', 20925, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'How many persons visit the park between E and F?\n\n: As many persons visit between B and E.\n\n; Two\n\n; As many persons visit between D and A.\n\n; More than three\n\n; None\n', 'As many persons visit between D and A.\n\n', NULL, 1633609116),
(12486, 6370, 21, 'deferredfeedback', 20930, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE BELOW QUESTIONS.\n\nEight boxes i.e. B, D, G, L, N, T, W, and Z are kept in two stacks i.e. stack 1 and stack 2 from west to east but not necessarily in the same order. Each stack has equal number of boxes. Each stack has four shelves in such a way that the lowermost shelf is numbered as 1, the shelf immediately above the lowermost shelf is numbered as 2 and so on...till the topmost shelf is numbered as 4. Box B is kept two shelves below box T, both are not kept in the same stack. The box which is placed just below box B is kept west to box N. Two shelves are there between box W and box L. Box G is not kept in the same stack with box D. Box W is kept to the south-west of box D. Box Z is not kept to the south of box D.\n\nWhich among the following boxes is kept at stack 1 of shelf 4?\n: W\n; B\n; G\n; L\n; None of these\n', 'L\n', NULL, 1633609116),
(12487, 6370, 22, 'deferredfeedback', 20932, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Four of the following five are related to each other in a certain way and thus form a group, which among\n\nthe following doesn’t belong to the group?\n: B\n; G\n; Z\n; W\n; N\n', 'B\n', NULL, 1633609116),
(12488, 6370, 23, 'deferredfeedback', 20948, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'ANSWER THE QUESTION BASED ON THE INFORMATION GIVEN BELOW:\n\nNine people namely P, Q, R, S, T, U, V, W and M are working in the same office but with different\n\ndesignation namely Attender, Clerk, Stenographer, Financial Adviser, Admin, Manager, Team Leader,\n\nChairman and CEO (Designations are in increasing seniority/experience order. Attender being the least\n\nexperienced while the CEO being the most experienced). Two person lie between P and W. P has\n\njust more experience than T (i.e. P is immediate senior to T). Two people lie between T and S. U have more\n\nexperience than M. U is not CEO. At least two persons have less experience than V. M is not a Financial\n\nAdviser. R has less experience than M. Only three people are more experienced than W. M is senior than\n\nV but both of them neither have the least experienced nor most experienced.\n\nQ is in which of the following post?\n\n: Attender\n\n; CEO\n\n; Manager\n\n; Clerk\n\n; None of these\n\n', 'CEO\n\n', NULL, 1633609116),
(12489, 6370, 24, 'deferredfeedback', 20949, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'Which of the following is Team Leader?\n\n: M\n; P\n; R\n; U\n; None of these\n', 'M\n', NULL, 1633609116),
(12490, 6370, 25, 'deferredfeedback', 20950, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION TO ANSWER THE GIVEN QUESTIONS:\n\nSeven persons P, Q, R, S, T, U, V born in seven different years viz. 1973, 1984, 1989, 1993, 1995, 1999, 2005.  (All the ages of the given persons have been calculated on the base year 2020 and all the persons are considered to be born on the same date of the same month). P is 4 years younger than U. The difference between the ages of U and T is 6 years. The average of the ages of Q and T is twice the average of the ages of V and R (average of the ages are considered in a whole number). V is younger than R, and T is younger than Q. S is not the oldest.\n\nWho among the following is the youngest person?\n\n: P\n; Q\n; R\n; V\n; T\n', 'V\n', NULL, 1633609116),
