(12492, 6370, 27, 'deferredfeedback', 20952, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'ANSWER THE QUESTIONS BASED ON THE INFORMATION GIVEN BELOW.\n\nEight persons i.e. A, B, C, D, E, F, G and H are going to the park on different months January, March, April, May, July, September, October and November of the same year but not necessarily in the same order. Three persons go to the park between C and B, who doesn’t go in the month of 31 days. G goes to the park just after C. One person goes between G and the one, who goes immediately after A. A goes to the park after C. No one goes between D and F, who goes in the month of 30 days but not in April. E goes to the park before H.\n\nWho among the following person goes to the park in May?\n: The one who visits immediately before E\n\n; C\n; The one who visits immediately before H\n\n; G\n; None of these\n\n', 'The one who visits immediately before H\n\n', NULL, 1633609116),
