(12494, 6370, 29, 'deferredfeedback', 20954, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE QUESTIONS GIVEN BELOW:\n\nTen persons namely A, B, C, D, E, F, G, H, I and J are living on five different floors of a building.\n\nNOTE 1: The ground floor is numbered as 1 and the top floor is numbered as 5. There are two flats on each floor. \n\nNOTE 2: Flat-1 and flat-2 from west to east such that flat 2 is in the east of Flat 1. \n\nNOTE 3: Flat-1 of the second floor is exactly above flat-1 of the first floor and other flats are placed in the same way. E lives on the 2nd floor. There are two floors gap between E and J and both do not live in the same numbered flat. I lives just below the floor on which J lives. More than two floors gap between B and G. Both H and G live on the same floor. A lives just above the floor in which D lives and in the North-east direction of G. F lives in the west of  I. Both C and D do not live in the same numbered flat.\n\nWho among the following person lives on Flat-2 of the 3rd floor?\n: A\n; B\n; C\n; D\n; None of these\n\n', 'A\n', NULL, 1633609116),
