(12496, 6370, 31, 'deferredfeedback', 20956, 1, '1.0000000', '-0.3000000', '1.0000000', 0, 'STUDY THE FOLLOWING INFORMATION CAREFULLY AND ANSWER THE BELOW QUESTIONS\n\nEight persons -A, B, C, D, E, F, G, and H are living in the eight-floor storey building such that the lowermost floor is numbered as 1, the floor just above it is numbered as 2 and so on till the topmost floor is numbered as 8. All the information is not necessarily in the same order. A is living on the odd-numbered floor but below the fourth floor. Three floors are between A and D. The number of person lives above D is the same as below E. G and D are living on adjacent floors. The one who lives immediately above F is living four floors above C. H lives on neither floor 8 nor floor 5.\n\nWhich of the following statement is/are true?\n\nI). Three floors are between C and A\n\nII). H lives on the third floor\n\nIII). F lives two floors above E\n: Both I and III\n\n; Only III\n\n; Both I and II\n\n; Both II and III\n\n; None is true\n\n', 'Only III\n\n', NULL, 1633609116),
